        $this->addSql('INSERT INTO rpg_challenge_global VALUES(227, NULL, \'The Lord of The Rings\', \'Walk with Frodo\', NULL, \'FitDistanceDailySummary\', 6833.5, \'flow\', 16, 450, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(228, 227, \'Go from Hobbiton to Rivendell\', \'\', NULL, \'FitDistanceDailySummary\', NULL, \'flow\', NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(229, 228, \'Sept 23 - Day 1: 18 miles\', \'Leave Bag End at full dark (ca. 7 p.m.). Go around (W) end, jump hedge.\', NULL, \'FitDistanceDailySummary\', 0, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(230, 228, \'Sept 23 - Day 1: 18 miles\', \'Go through gate into a lane. Head west.\', NULL, \'FitDistanceDailySummary\', 1, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(231, 228, \'Sept 23 - Day 1: 18 miles\', \'Leave lane, follow hedgerows south.\', NULL, \'FitDistanceDailySummary\', 2, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(232, 228, \'Sept 23 - Day 1: 18 miles\', \'Cross The Water on a plank bridge\', NULL, \'FitDistanceDailySummary\', 3, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(233, 228, \'Sept 23 - Day 1: 18 miles\', \'Cross The Great Road from the Brandywine Bridge. Enter Tookland.\', NULL, \'FitDistanceDailySummary\', 5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(234, 228, \'Sept 23 - Day 1: 18 miles\', \'Look back at lights of Hobbiton from first slopes of the Green Hill Country.\', NULL, \'FitDistanceDailySummary\', 7.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(235, 228, \'Sept 23 - Day 1: 18 miles\', \'Hobbiton hidden as slopes rise and fall.\', NULL, \'FitDistanceDailySummary\', 9, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(236, 228, \'Sept 23 - Day 1: 18 miles\', \'Stop in a birch grove. Eat a frugal supper (ca. 10 p.m.).\', NULL, \'FitDistanceDailySummary\', 11, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(237, 228, \'Sept 23 - Day 1: 18 miles\', \'Reach Stock Road\', NULL, \'FitDistanceDailySummary\', 14.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(238, 228, \'Sept 23 - Day 1: 18 miles\', \'Begin to sing. Walk through a deeply cloven track between tall trees.\', NULL, \'FitDistanceDailySummary\', 15.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(239, 228, \'Sept 23 - Day 1: 18 miles\', \'Climb a steep slope. Pippins yawns (\\\'Nearly midnight\\\').\', NULL, \'FitDistanceDailySummary\', 17.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(240, 228, \'Sept 23 - Day 1: 18 miles\', \'Camp - In a firwood just over top of the hill. Sleep by a large tree. Fox sees them.\', NULL, \'FitDistanceDailySummary\', 18, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(241, 228, \'Sept. 24 - Day 2: 28 miles\', \'Road rolls up and down.\', NULL, \'FitDistanceDailySummary\', 20, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(242, 228, \'Sept. 24 - Day 2: 28 miles\', \'Road zig-zigs to top of a steep bank and goes down for the last time. Can see across Woody End to the River. **THEY STOP TO REST, EAT, and REST more! (ca. 1:30-4:30 p.m.) Sun was â€˜beginning to get low\\\' as they went down the hill.\', NULL, \'FitDistanceDailySummary\', 29, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(243, 228, \'Sept. 24 - Day 2: 28 miles\', \'Road ahead runs fairly straight and level. Behind them it curves slightly. BLACK RIDER. Sam and Pippin hide in a hollow. Frodo behind tree by road (ca.5 p.m.).\', NULL, \'FitDistanceDailySummary\', 32, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(244, 228, \'Sept. 24 - Day 2: 28 miles\', \'Keep a stone\\\'s throw left of the road...slower going.\', NULL, \'FitDistanceDailySummary\', 35, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(245, 228, \'Sept. 24 - Day 2: 28 miles\', \'Road splits. Road to Stock bends left and goes down into the lowlands. They take a lane which branches to the right, winding through a wood of ancient Oaks. \\\'Sun down and evening coming on\\\' (ca. 6:30 p.m.). Quite close to the road-meeting they creep inside a huge tree. Eat and rest.\', NULL, \'FitDistanceDailySummary\', 37, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(246, 228, \'Sept. 24 - Day 2: 28 miles\', \'Go on in twilight. Begin to sing. (ca. 7:00 p.m.)\', NULL, \'FitDistanceDailySummary\', 38, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(247, 228, \'Sept. 24 - Day 2: 28 miles\', \'\\\'And NOW to bed!\\\' Pippin says, when BLACK RIDER is heard again (ca. 9 p.m.). ELVES arrive, RIDER leaves, and Frodo & Co. continue with Elves.\', NULL, \'FitDistanceDailySummary\', 41, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(248, 228, \'Sept. 24 - Day 2: 28 miles\', \'Wood more dense, and lane went lower, running in a fold of hills, with hazel on the slopes alongside. Pippin quickly becomes sleepy.\', NULL, \'FitDistanceDailySummary\', 42, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(249, 228, \'Sept. 24 - Day 2: 28 miles\', \'Turn right off the path on â€˜a green ride\\\' through thickets. \', NULL, \'FitDistanceDailySummary\', 45, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(250, 228, \'Sept. 24 - Day 2: 28 miles\', \'Camp - Woody End. A green floor in the wood, roofed by boughs of trees. To the east a steep shoulder falls, and they can overlook the river valley. The lights of the village of Woodhall seen below (ca. 11 p.m.).\', NULL, \'FitDistanceDailySummary\', 46, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(251, 228, \'Sept. 25 - Day 3: 27 miles\', \'A deep-banked stream below the hill cuts across their path. Looking back, they see a Black Rider on the hillcrest where they had camped. They force through the bushes alongside the stream.\', NULL, \'FitDistanceDailySummary\', 47, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(252, 228, \'Sept. 25 - Day 3: 27 miles\', \'Pippin realizes it is the Stock-brook. The banks are low enough now for them to cross. The land on its south bank is wet and reedy.\', NULL, \'FitDistanceDailySummary\', 48, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(253, 228, \'Sept. 25 - Day 3: 27 miles\', \'They reach a belt of trees, mostly oaks with a few elms and ash. Drops of rain fall.\', NULL, \'FitDistanceDailySummary\', 50, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(254, 228, \'Sept. 25 - Day 3: 27 miles\', \'Pippin realizes they\\\'ve turned too far south as they are still in the trees.\', NULL, \'FitDistanceDailySummary\', 52, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(255, 228, \'Sept. 25 - Day 3: 27 miles\', \'Still in the trees, they stop for lunch (ca. 2:00 p.m.). Their singing is cut by the cry of a Black Rider, and they leave (ca. 3:00 p.m.).\', NULL, \'FitDistanceDailySummary\', 54, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(256, 228, \'Sept. 25 - Day 3: 27 miles\', \'Wood ends. The land steadily becomes more tame. Sun is shining brightly.\', NULL, \'FitDistanceDailySummary\', 55, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(257, 228, \'Sept. 25 - Day 3: 27 miles\', \'Reach area of the Marish with fields, meadows, hedges, gates, and drainage dikes.\', NULL, \'FitDistanceDailySummary\', 56, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(258, 228, \'Sept. 25 - Day 3: 27 miles\', \'Edges of fields worked by Farmer Maggot.\', NULL, \'FitDistanceDailySummary\', 61, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(259, 228, \'Sept. 25 - Day 3: 27 miles\', \'After a turnip field there is a stout gate to a rutted lane, edged by hedges.    \', NULL, \'FitDistanceDailySummary\', 62, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(260, 228, \'Sept. 25 - Day 3: 27 miles\', \'Farmer Maggot\\\'s house and buildings: brick with thatched roofs, surrounded by a high wall cut by a wooden gate from the lane. Eat. (Est. time there: 5:30 - 7:00 p.m.: full dark when they leave).\', NULL, \'FitDistanceDailySummary\', 63, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(261, 228, \'Sept. 25 - Day 3: 27 miles\', \'Farmer Maggot\\\'s lane meets the Causeway to Buckleberry Ferry. Ride in wagon.\', NULL, \'FitDistanceDailySummary\', 65, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(262, 228, \'Sept. 25 - Day 3: 27 miles\', \'Boggy land all around. Foggy. Merry meets them at the Ferry landing. As they reach the other side of the river, they can see a Black Rider on the west shore.\', NULL, \'FitDistanceDailySummary\', 70, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(263, 228, \'Sept. 25 - Day 3: 27 miles\', \'Taking the main road north from the Ferry, Buck Hill is on the left and Buckleberry on the right. They take a lane to the right, and climb up and down into the country.\', NULL, \'FitDistanceDailySummary\', 70.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(264, 228, \'Sept. 25 - Day 3: 27 miles\', \'Crickhollow - spend the night. \\\'A Conspiracy Unmasked\\\'.\', NULL, \'FitDistanceDailySummary\', 73, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(265, 228, \'Sept. 26 - Day 4: 25 miles\', \'Enter tunnel under Hedge to reach The Old Forest. Path disappears (ca. 7:15 a.m.).\', NULL, \'FitDistanceDailySummary\', 75, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(266, 228, \'Sept. 26 - Day 4: 25 miles\', \'The Bonfire Glade - clear path beyond. Sunny, but not yet in clearing (ca. 8 a.m.).\', NULL, \'FitDistanceDailySummary\', 78, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(267, 228, \'Sept. 26 - Day 4: 25 miles\', \'On path in the Forest. Path climbs gently.\', NULL, \'FitDistanceDailySummary\', 79, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(268, 228, \'Sept. 26 - Day 4: 25 miles\', \'Top of knoll in Forest. Hazy. Surrounded by Trees. Eat, rest (11 a.m.-ca.1 p.m.)\', NULL, \'FitDistanceDailySummary\', 87, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(269, 228, \'Sept. 26 - Day 4: 25 miles\', \'Path veers SE. Company leaves path and tries to turn north.\', NULL, \'FitDistanceDailySummary\', 88, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(270, 228, \'Sept. 26 - Day 4: 25 miles\', \'Cross series of deep folds running SE. Keep turning east. Lose direction.\', NULL, \'FitDistanceDailySummary\', 89, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(271, 228, \'Sept. 26 - Day 4: 25 miles\', \'Enter fold too deep to leave. Follow it SE to Withywindle (ca. 4 p.m.).\', NULL, \'FitDistanceDailySummary\', 91, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(272, 228, \'Sept. 26 - Day 4: 25 miles\', \'Merry finds path along bank of the River. Follow it east through wetlands.\', NULL, \'FitDistanceDailySummary\', 93, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(273, 228, \'Sept. 26 - Day 4: 25 miles\', \'Stop by Old Man Willow to rest. (ca. 5:30) Rescued by Tom Bombadil (ca.6:00 p.m.).\', NULL, \'FitDistanceDailySummary\', 95, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(274, 228, \'Sept. 26 - Day 4: 25 miles\', \'Reach Tom Bombadil\\\'s house. Stars are out (ca. 7 p.m.).\', NULL, \'FitDistanceDailySummary\', 98, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(275, 228, \'Sept. 28 - Day 6: 17 miles \', \'Midday. Stop in a hollow atop a hill. Eat and fall asleep. Wake in fog, sun sinking.\', NULL, \'FitDistanceDailySummary\', 112, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(276, 228, \'Sept. 28 - Day 6: 17 miles \', \'Try to head north, but lose their way and become separated. Captured by Wights.\', NULL, \'FitDistanceDailySummary\', 115, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(277, 228, \'Sept. 29 - Day 7: 20 miles\', \'Ride north through a gap.\', NULL, \'FitDistanceDailySummary\', 118, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(278, 228, \'Sept. 29 - Day 7: 20 miles\', \'Reach dike and hedge. Former boundary of Cardolan, part of the North Kingdom of Arnor.\', NULL, \'FitDistanceDailySummary\', 123, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(279, 228, \'Sept. 29 - Day 7: 20 miles\', \'Return to Great East Road (ca.5:30). Tom departs. Strider sees them, but hides.\', NULL, \'FitDistanceDailySummary\', 131, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(280, 228, \'Sept. 29 - Day 7: 20 miles\', \'Reach Bree. Stay at The Prancing Pony. Meet Strider. Ponies stolen during night.\', NULL, \'FitDistanceDailySummary\', 135, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(281, 228, \'Sept. 30 - Day 8: 12 miles\', \'Leave road and head north into Chetwood. No living things all day.\', NULL, \'FitDistanceDailySummary\', 140, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(282, 228, \'Sept. 30 - Day 8: 12 miles\', \'Camp in Chetwood, east of Archet.\', NULL, \'FitDistanceDailySummary\', 147, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(283, 228, \'Oct. 1 - Day 9: 16 miles\', \'Camp in eastern Chetwood.\', NULL, \'FitDistanceDailySummary\', 163, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(284, 228, \'Oct. 2 - Day 10: 16 miles\', \'Come out of the Chetwood. \', NULL, \'FitDistanceDailySummary\', 165, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(285, 228, \'Oct. 2 - Day 10: 16 miles\', \'Ground becomes damp. Entering western edge of Midgewater Marshes.\', NULL, \'FitDistanceDailySummary\', 173, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(286, 228, \'Oct. 2 - Day 10: 16 miles\', \'Camp in western part of the Marshes.\', NULL, \'FitDistanceDailySummary\', 179, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(287, 228, \'Oct. 3 - Day 11: 15 miles\', \'Camp in eastern part of the Marshes. See flashes of light in the east during the night (Gandalf on Weathertop).\', NULL, \'FitDistanceDailySummary\', 194, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(288, 228, \'Oct. 4 - Day 12 (5th from Bree): 17 miles\', \'Reach eastern edge of the Marshes. Can see Weather Hills ahead. Land starts to rise. Land drier and very barren. A few birds.\', NULL, \'FitDistanceDailySummary\', 198, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(289, 228, \'Oct. 4 - Day 12 (5th from Bree): 17 miles\', \'Camp by a stream, among stunted alder trees. Moon waxing.\', NULL, \'FitDistanceDailySummary\', 211, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(290, 228, \'Oct. 5 - Day 13 (6th from Bree): 18 miles\', \'Reach foot of the Weather Hills. Camp there.\', NULL, \'FitDistanceDailySummary\', 229, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(291, 228, \'Oct. 6 - Day 14 (7th from Bree): 12 miles\', \'Midday - Near south end of path. Reach dell at western foot of hill.\', NULL, \'FitDistanceDailySummary\', 239, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(292, 228, \'Oct. 6 - Day 14 (7th from Bree): 12 miles\', \'Climb to top of Weathertop and enter the ruins of the watch Tower of Amon SÃ»l. See Black Riders on road below.\', NULL, \'FitDistanceDailySummary\', 240, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(293, 228, \'Oct. 6 - Day 14 (7th from Bree): 12 miles\', \'Return to dell. Camp there. Attack of Nazgul at night.\', NULL, \'FitDistanceDailySummary\', 241, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(294, 228, \'Oct. 7 - Day 15: 19 miles\', \'Cross Great East Road and enter thickets on south side. Land slopes south.\', NULL, \'FitDistanceDailySummary\', 251, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(295, 228, \'Oct. 7 - Day 15 (1st from Weathertop): 19 miles\', \'Camp in thickets.\', NULL, \'FitDistanceDailySummary\', 260, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(296, 228, \'Oct. 8 - Day 16 (2nd from Weathertop): 19 miles \', \'Camp.\', NULL, \'FitDistanceDailySummary\', 279, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(297, 228, \'Oct. 9 - Day 17 (3rd from Weathertop): 19 miles\', \'Camp - Follow a wide shallow curving valley.\', NULL, \'FitDistanceDailySummary\', 298, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(298, 228, \'Oct. 10 - Day 18 (4th from Weathertop): 19 miles\', \'Camp - Continue in valley.\', NULL, \'FitDistanceDailySummary\', 317, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(299, 228, \'Oct. 11 - Day 19 (5th from Weathertop): 19 miles \', \'Continue in valley. Land starts to rise. Can see â€˜huddle of hills\\\' ahead.\', NULL, \'FitDistanceDailySummary\', 336, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(300, 228, \'Oct. 12 - Day 20 (6th from Weathertop): 19 miles\', \'Camp not far SW of bridge. Camp is high enough for Merry to see the Loudwater far in the distance!\', NULL, \'FitDistanceDailySummary\', 355, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(301, 228, \'Oct. 13 - Day 21 (7th from Weathertop): 7 miles\', \'Return to The Great East Road\', NULL, \'FitDistanceDailySummary\', 356, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(302, 228, \'Oct. 13 - Day 21 (7th from Weathertop): 7 miles\', \'Strider scouts ahead and finds an elf-stone on The Last Bridge. He believes it is a token of safety. Company crosses the River Hoarwell/Mitheithel.\', NULL, \'FitDistanceDailySummary\', 358, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(303, 228, \'Oct. 13 - Day 21 (7th from Weathertop): 7 miles\', \'Turn north from the Road. Enter the steep lands of the Trollshaws. They can see ruined walls and towers frowning down.\', NULL, \'FitDistanceDailySummary\', 359, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(304, 228, \'Oct. 13 - Day 21 (7th from Weathertop): 7 miles\', \'Hills quickly shut them in. Difficult going. Camp.\', NULL, \'FitDistanceDailySummary\', 362, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(305, 228, \'Oct. 14 - Day 21 (8th from Weathertop): 6 miles\', \'More climbing. \', NULL, \'FitDistanceDailySummary\', 368, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(306, 228, \'Oct. 15 - Day 22 (9th from Weathertop): 6 miles\', \'Weather turns wet during the day.\', NULL, \'FitDistanceDailySummary\', 374, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(307, 228, \'Oct. 16 - Day 23 (10th from Weathertop): 6 miles\', \'Hills higher and steeper. They are forced north out of their way. Still raining. Camp on a stony shelf by a shallow cave.\', NULL, \'FitDistanceDailySummary\', 380, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(308, 228, \'Oct. 17 - Day 24 (11th from Weathertop): 6 miles\', \'Rain stops. Strider scouts. Start late. Turn SE, scrambling over rocky ground. Find a valley, but it ends in a high ridge. Climb ridge and camp in a saddle at top. COLD. Build a fire under a gnarled pine.\', NULL, \'FitDistanceDailySummary\', 386, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(309, 228, \'Oct. 18 - Day 25 (12th from Weathertop): 34 miles\', \'Slope beyond ridge is much easier. Bright, fair day. Strider briefly sees the Loudwater/Bruinen in the distance.\', NULL, \'FitDistanceDailySummary\', 387, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(310, 228, \'Oct. 18 - Day 25 (12th from Weathertop): 34 miles\', \'Reach a trail.\', NULL, \'FitDistanceDailySummary\', 389, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(311, 228, \'Oct. 18 - Day 25 (12th from Weathertop): 34 miles\', \'Find Troll-hole. Continue on level path through woods.\', NULL, \'FitDistanceDailySummary\', 392, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(312, 228, \'Oct. 18 - Day 25 (12th from Weathertop): 34 miles\', \'Stone Trolls. Rest. Sam recites \\\'Old Troll.\\\' Continue in afternoon. Woods.\', NULL, \'FitDistanceDailySummary\', 393, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(313, 228, \'Oct. 18 - Day 25 (12th from Weathertop): 34 miles\', \'Return to the Road.\', NULL, \'FitDistanceDailySummary\', 400, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(314, 228, \'Oct. 18 - Day 25 (12th from Weathertop): 34 miles\', \'While looking for a place to camp, hear a horse: Glorfindel. \', NULL, \'FitDistanceDailySummary\', 405, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(315, 228, \'Oct. 18 - Day 25 (12th from Weathertop): 34 miles\', \'March all night. Frodo is on Glorfindel\\\'s horse. Camp next to the road at dawn.\', NULL, \'FitDistanceDailySummary\', 420, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(316, 228, \'Oct. 19 - Day 26 (13sth from Weathertop): 20 miles\', \'Cross a small stream. Rest stop.\', NULL, \'FitDistanceDailySummary\', 429, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(317, 228, \'Oct. 19 - Day 26 (13sth from Weathertop): 20 miles\', \'Rest stop.\', NULL, \'FitDistanceDailySummary\', 432, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(318, 228, \'Oct. 19 - Day 26 (13sth from Weathertop): 20 miles\', \'Camp where road bends right to run down slope toward the River Bruinen.\', NULL, \'FitDistanceDailySummary\', 440, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(319, 228, \'Oct. 20 - Day 27 (14th from Weathertop): 18 miles\', \'Road running downhill. Much grass on sides.\', NULL, \'FitDistanceDailySummary\', 447, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(320, 228, \'Oct. 20 - Day 27 (14th from Weathertop): 18 miles\', \'Road plunges through a cutting of red stone with tall pines. Glorfindel says \\\'Run!\\\'\', NULL, \'FitDistanceDailySummary\', 449, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(321, 228, \'Oct. 20 - Day 27 (14th from Weathertop): 18 miles\', \'Hobbits are halfway across grassy flat when Nazgul burst through behind them.\', NULL, \'FitDistanceDailySummary\', 449.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(322, 228, \'Oct. 20 - Day 27 (14th from Weathertop): 18 miles\', \'Attack at the Ford (ca. noon). Glorfindel\\\'s horse carries Frodo across Ford. Nazgul drown. Frodo falls.\', NULL, \'FitDistanceDailySummary\', 450, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(323, 228, \'Oct. 20 - Day 27 (14th from Weathertop): 18 miles\', \'Company meets Elves sent from Rivendell (est. 2 p.m.). They take Frodo ahead. Rest of company follows on foot.\', NULL, \'FitDistanceDailySummary\', 452, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(324, 228, \'Oct. 20 - Day 27 (14th from Weathertop): 18 miles\', \'Come to the sudden cliff into the valley of Rivendell.\', NULL, \'FitDistanceDailySummary\', 457, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(325, 228, \'Oct. 20 - Day 27 (14th from Weathertop): 18 miles\', \'Frodo reaches Rivendell carried by the Elves (est. 4 p.m.). Others arrive in evening.\', NULL, \'FitDistanceDailySummary\', 458, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(326, 227, \'Rivendell to Lothlorien\', \'\', NULL, \'FitDistanceDailySummary\', NULL, \'flow\', NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(327, 326, \'Dec. 25/26 - Nt. 1: 22 miles - The Journey of the Fellowship of the Ring Begins\', \'Leave Rivendell at dusk on Dec. 25.\', NULL, \'FitDistanceDailySummary\', 458, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(328, 326, \'Dec. 25/26 - Nt. 1: 22 miles - The Journey of the Fellowship of the Ring Begins\', \'Climb out of the valley onto the moors.\', NULL, \'FitDistanceDailySummary\', 459, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(329, 326, \'Dec. 25/26 - Nt. 1: 22 miles - The Journey of the Fellowship of the Ring Begins\', \'At the Ford of Brúinen, turn south on ‘narrow paths among folded lands’.\', NULL, \'FitDistanceDailySummary\', 466, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(330, 326, \'Dec. 25/26 - Nt. 1: 22 miles - The Journey of the Fellowship of the Ring Begins\', \'To the west the Bruinen cuts a steep-sided canyon.\', NULL, \'FitDistanceDailySummary\', 476, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(331, 326, \'Dec. 25/26 - Nt. 1: 22 miles - The Journey of the Fellowship of the Ring Begins\', \'Walk until dawn. Camp during the day - Dec. 26.\', NULL, \'FitDistanceDailySummary\', 480, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(332, 326, \'Dec. 26/27 - Nt. 2: 15 miles\', \'Empty country - rough and barren. \', NULL, \'FitDistanceDailySummary\', 485, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(333, 326, \'Dec. 26/27 - Nt. 2: 15 miles\', \'Cross a small stream.\', NULL, \'FitDistanceDailySummary\', 484, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(334, 326, \'Dec. 26/27 - Nt. 2: 15 miles\', \'Empty country - rough and barren. \', NULL, \'FitDistanceDailySummary\', 485, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(335, 326, \'Dec. 26/27 - Nt. 2: 15 miles\', \'Camp in a hollow during the day - Dec. 27.\', NULL, \'FitDistanceDailySummary\', 495, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(336, 326, \'Dec. 27/28 - Nt. 3: 15 miles\', \'Crest the top of a hill. Snowcapped peak lies due east.\', NULL, \'FitDistanceDailySummary\', 504, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(337, 326, \'Dec. 27/28 - Nt. 3: 15 miles\', \'Cold and windy. Camp during the day - Dec. 28.\', NULL, \'FitDistanceDailySummary\', 510, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(338, 326, \'Dec. 28/29 - Nt. 4: 15 miles\', \'Reach a small stream. Follow it west.\', NULL, \'FitDistanceDailySummary\', 516, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(339, 326, \'Dec. 28/29 - Nt. 4: 15 miles\', \'Leave streambed.\', NULL, \'FitDistanceDailySummary\', 518, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(340, 326, \'Dec. 28/29 - Nt. 4: 15 miles\', \'Paths few and winding. Camp during the day - Dec. 29.\', NULL, \'FitDistanceDailySummary\', 525, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(341, 326, \'Dec. 29/30 - Nt. 5: 15 miles\', \'After reaching the top of a rise, angle southeast.\', NULL, \'FitDistanceDailySummary\', 528, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(342, 326, \'Dec. 29/30 - Nt. 5: 15 miles\', \'Camp in a thicket of thorn bushes during the day - Dec. 30.\', NULL, \'FitDistanceDailySummary\', 540, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(343, 326, \'D. 30/1 Yule - Nt. 6: 15 miles\', \'Reach crest of another low mountain spur. Turn southwest as they descend.\', NULL, \'FitDistanceDailySummary\', 544, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(344, 326, \'D. 30/1 Yule - Nt. 6: 15 miles\', \'Path comes to a steep drop-off. Go along cliff-top for a while\', NULL, \'FitDistanceDailySummary\', 548, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(345, 326, \'D. 30/1 Yule - Nt. 6: 15 miles\', \'Camp during the day - 1 Yule.\', NULL, \'FitDistanceDailySummary\', 555, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(346, 326, \'1 Yule/2 Yule - Nt. 7: 15 miles\', \'Cross a small stream.\', NULL, \'FitDistanceDailySummary\', 560, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(347, 326, \'1 Yule/2 Yule - Nt. 7: 15 miles\', \'Camp during the day - 2 Yule.\', NULL, \'FitDistanceDailySummary\', 570, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(348, 326, \'2 Yule/Jan. 1 - Nt. 8: 15 miles\', \'Another snowcapped peak lies to the east.\', NULL, \'FitDistanceDailySummary\', 578, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(349, 326, \'2 Yule/Jan. 1 - Nt. 8: 15 miles\', \'Camp during the day - Jan.1.\', NULL, \'FitDistanceDailySummary\', 585, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(350, 326, \'Jan. 1/J. 2 - Nt. 9: 15 miles\', \'Cross a small stream. It flows west into a swampy area.\', NULL, \'FitDistanceDailySummary\', 588, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(351, 326, \'Jan. 1/J. 2 - Nt. 9: 15 miles\', \'Camp during the day - Jan. 2. Continues cold, gray and windy.\', NULL, \'FitDistanceDailySummary\', 600, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(352, 326, \'Jan. 2/J. 7 - Nt. 10-14: 15 miles/day = 75 miles - Continues cold, gray and windy.\', \'After reaching a hilltop, turn southeast.\', NULL, \'FitDistanceDailySummary\', 608, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(353, 326, \'Jan. 2/J. 7 - Nt. 10-14: 15 miles/day = 75 miles - Continues cold, gray and windy.\', \'Camp during the day - Jan. 3. \', NULL, \'FitDistanceDailySummary\', 615, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(354, 326, \'Jan. 2/J. 7 - Nt. 10-14: 15 miles/day = 75 miles - Continues cold, gray and windy.\', \'Cross a small stream.\', NULL, \'FitDistanceDailySummary\', 627, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(355, 326, \'Jan. 2/J. 7 - Nt. 10-14: 15 miles/day = 75 miles - Continues cold, gray and windy.\', \'Camp during the day - Jan. 4.\', NULL, \'FitDistanceDailySummary\', 630, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(356, 326, \'Jan. 2/J. 7 - Nt. 10-14: 15 miles/day = 75 miles - Continues cold, gray and windy.\', \'Rolling lands.\', NULL, \'FitDistanceDailySummary\', 638, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(357, 326, \'Jan. 2/J. 7 - Nt. 10-14: 15 miles/day = 75 miles - Continues cold, gray and windy.\', \'Camp during the day - Jan. 5. \', NULL, \'FitDistanceDailySummary\', 645, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(358, 326, \'Jan. 2/J. 7 - Nt. 10-14: 15 miles/day = 75 miles - Continues cold, gray and windy.\', \'Camp during the day - Jan. 6. \', NULL, \'FitDistanceDailySummary\', 660, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(359, 326, \'Jan. 2/J. 7 - Nt. 10-14: 15 miles/day = 75 miles - Continues cold, gray and windy.\', \'Land drops more steeply. Go southeast into a valley.\', NULL, \'FitDistanceDailySummary\', 668, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(360, 326, \'Jan. 2/J. 7 - Nt. 10-14: 15 miles/day = 75 miles - Continues cold, gray and windy.\', \'Cross a small stream. Camp during the day - Jan. 7. \', NULL, \'FitDistanceDailySummary\', 675, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(361, 326, \'Jan. 7/J. 8 - Nt. 15: 15 miles\', \'Weather warmer and sunny. Can see Mts. of Moria in distance. Eerily quiet.\', NULL, \'FitDistanceDailySummary\', 678, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(362, 326, \'Jan. 7/J. 8 - Nt. 15: 15 miles\', \'Begin climb up north side of Hollin Ridge. \', NULL, \'FitDistanceDailySummary\', 686, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(363, 326, \'Jan. 7/J. 8 - Nt. 15: 15 miles\', \'Reach Hollin Ridge. Large holly trees mark ridge. Day camp on Hollin Ridge. They plan to stay overnight, but after the crebain fly over, they leave at dusk.\', NULL, \'FitDistanceDailySummary\', 690, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(364, 326, \'Jan. 8/J. 9 - Nt. 16: 18 miles\', \'Soon strike a good path that goes southeast toward the mountain pass. Path is lined with stones. Full moon. \', NULL, \'FitDistanceDailySummary\', 691, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(365, 326, \'Jan. 8/J. 9 - Nt. 16: 18 miles\', \'Frodo and Gandalf sense something flying over just before dawn.\', NULL, \'FitDistanceDailySummary\', 706, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(366, 326, \'Jan. 8/J. 9 - Nt. 16: 18 miles\', \'Cross a small stream. Camp during day of Jan. 9. Sunny, but colder.\', NULL, \'FitDistanceDailySummary\', 708, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(367, 326, \'Jan. 9/J. 10 - Nt. 17: 17 miles\', \'Road begins climbing as it winds into the hills. Mountains are closer.\', NULL, \'FitDistanceDailySummary\', 710, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(368, 326, \'Jan. 9/J. 10 - Nt. 17: 17 miles\', \'Camp during day of Jan. 10.\', NULL, \'FitDistanceDailySummary\', 725, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(369, 326, \'Jan. 10/J. 11 - Nt. 18: 17 miles\', \'Road climbs still higher.\', NULL, \'FitDistanceDailySummary\', 733, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(370, 326, \'Jan. 10/J. 11 - Nt. 18: 17 miles\', \'Almost to the feet of the Redhorn. Camp during day of Jan. 11. Gandalf and Aragorn debate path. Wind turns NW. Black clouds form during afternoon.\', NULL, \'FitDistanceDailySummary\', 742, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(371, 326, \'Jan. 11 - Nt. 19: 8 miles\', \'Leave camp at dusk. (ca. 5 p.m.). Fearing snow, each takes wood along.\', NULL, \'FitDistanceDailySummary\', 742, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(372, 326, \'Jan. 11 - Nt. 19: 8 miles\', \'Path is fairly smooth. They make good time.\', NULL, \'FitDistanceDailySummary\', 744, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(373, 326, \'Jan. 11 - Nt. 19: 8 miles\', \'Path becomes more steep and is dotted with fallen stones.\', NULL, \'FitDistanceDailySummary\', 746, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(374, 326, \'Jan. 11 - Nt. 19: 8 miles\', \'Path climbs a sharp slope: cliff on left, drop-off on right. Begins to snow as reach a ‘shelf’ at the top of the slope.\', NULL, \'FitDistanceDailySummary\', 748, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(375, 326, \'Jan. 11 - Nt. 19: 8 miles\', \'Snow begins to fall more thickly.\', NULL, \'FitDistanceDailySummary\', 749, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(376, 326, \'Jan. 11 - Nt. 19: 8 miles\', \'They stop briefly. Wind slackens. Snow lessens. Start again (ca. 8 p.m.).\', NULL, \'FitDistanceDailySummary\', 749.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(377, 326, \'Jan. 11 - Nt. 19: 8 miles\', \'Redhorn Pass. Snow becomes even heavier. Wind howls. Decide they can go no further. All huddle against the south-facing cliff, some behind Bill the Pony. Build fire. Stay until dawn.\', NULL, \'FitDistanceDailySummary\', 750, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(378, 326, \'Jan. 12 - Day 20: 28 miles\', \'Aragorn and Boromir start down, plowing through the snow.\', NULL, \'FitDistanceDailySummary\', 750, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(379, 326, \'Jan. 12 - Day 20: 28 miles\', \'Fellowship reaches great drift of snow. Clouds begin to break.\', NULL, \'FitDistanceDailySummary\', 750.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(380, 326, \'Jan. 12 - Day 20: 28 miles\', \'Snow steadily more shallow.\', NULL, \'FitDistanceDailySummary\', 751, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(381, 326, \'Jan. 12 - Day 20: 28 miles\', \'Back to shelf of stone ... no more snow (ca. 10:30 a.m.).\', NULL, \'FitDistanceDailySummary\', 752, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(382, 326, \'Jan. 12 - Day 20: 28 miles\', \'Turn west, away from path they took up to the Pass. Crebain return.\', NULL, \'FitDistanceDailySummary\', 754, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(383, 326, \'Jan. 12 - Day 20: 28 miles\', \'Turn more southwest around foothills of the Silvertine.\', NULL, \'FitDistanceDailySummary\', 768, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(384, 326, \'Jan. 12 - Day 20: 28 miles\', \'Stop to eat (ca.6 p.m.), camp, and debate. Cold wind. Hear Wargs! Climb to top of the hill above them. Enter a ring of stones with gnarled trees within. Wargs gather. Attack just before dawn.\', NULL, \'FitDistanceDailySummary\', 778, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(385, 326, \'Jan. 13 - Day 21: 20 miles\', \'Leave ca. 8 a.m. Head south-southeast toward the Sirannon.\', NULL, \'FitDistanceDailySummary\', 778, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(386, 326, \'Jan. 13 - Day 21: 20 miles\', \'A barren country of red stones.\', NULL, \'FitDistanceDailySummary\', 783, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(387, 326, \'Jan. 13 - Day 21: 20 miles\', \'Reach the Sirannon (ca. 11 a.m.). Dry. Head east on a path along stream.\', NULL, \'FitDistanceDailySummary\', 788, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(388, 326, \'Jan. 13 - Day 21: 20 miles\', \'Path lies in a deep trough. It is a rough, winding track.\', NULL, \'FitDistanceDailySummary\', 790, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(389, 326, \'Jan. 13 - Day 21: 20 miles\', \'Stop to EAT quickly (ca. 12:30 - 1 p.m.).\', NULL, \'FitDistanceDailySummary\', 792, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(390, 326, \'Jan. 13 - Day 21: 20 miles\', \'Fall of the Sirannon: Frodo, Gimli and Gandalf climb stairs to upland valley; return.\', NULL, \'FitDistanceDailySummary\', 796.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(391, 326, \'Jan. 13 - Day 21: 20 miles\', \'Climb curving road to upland valley. Most is filled with a lake.\', NULL, \'FitDistanceDailySummary\', 797, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(392, 326, \'Jan. 13 - Day 21: 20 miles\', \'Wade through stream at north end of lake.\', NULL, \'FitDistanceDailySummary\', 797.3, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(393, 326, \'Jan. 13 - Day 21: 20 miles\', \'Reach the Doors of Moria. (ca. 6 p.m.). Release Bill. Spend ca. ½ hour at Gate seeking the password. ATTACK by the Watcher in the Water.\', NULL, \'FitDistanceDailySummary\', 798, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(394, 326, \'Continuing Jan. 13: 20 miles\', \'Stop just inside Moria to eat and rest briefly. Leave ca. 7 p.m.\', NULL, \'FitDistanceDailySummary\', 798, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(395, 326, \'Continuing Jan. 13: 20 miles\', \'Frodo begins to hear Gollum’s pattering footsteps.\', NULL, \'FitDistanceDailySummary\', 801, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(396, 326, \'Continuing Jan. 13: 20 miles\', \'Stop to decide which path; brief halt.\', NULL, \'FitDistanceDailySummary\', 804, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(397, 326, \'Continuing Jan. 13: 20 miles\', \'Have to jump narrow fissure.\', NULL, \'FitDistanceDailySummary\', 808, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(398, 326, \'Continuing Jan. 13: 20 miles\', \'Have to jump 7 foot fissure; brief halt.\', NULL, \'FitDistanceDailySummary\', 811, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(399, 326, \'Continuing Jan. 13: 20 miles\', \'Reach junction of 3 passages, with Guardroom (ca. 1 a.m.). CAMP.\', NULL, \'FitDistanceDailySummary\', 818, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(400, 326, \'Jan. 14 - Day 22: 20 miles\', \'Leave Guardroom (ca. 8 a.m.). Take right hand passage.\', NULL, \'FitDistanceDailySummary\', 818, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(401, 326, \'Jan. 14 - Day 22: 20 miles\', \'Road climbs in great mounting curves with no side passages. (Est.) break.\', NULL, \'FitDistanceDailySummary\', 823, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(402, 326, \'Jan. 14 - Day 22: 20 miles\', \'(Est.) lunch and rest.\', NULL, \'FitDistanceDailySummary\', 828, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(403, 326, \'Jan. 14 - Day 22: 20 miles\', \'(Est.) break.\', NULL, \'FitDistanceDailySummary\', 833, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(404, 326, \'Jan. 14 - Day 22: 20 miles\', \'Reach the 21st Hall of the North End. Camp overnight.\', NULL, \'FitDistanceDailySummary\', 838, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(405, 326, \'Jan. 15 - Day 23 - 18 miles\', \'(ca. 8 a.m.) Eat. Enter Chamber of Records nearby. Find Balin’s Tomb. ATTACK - orcs and cave troll. Escape through east door of room.\', NULL, \'FitDistanceDailySummary\', 838, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(406, 326, \'Jan. 15 - Day 23 - 18 miles\', \'After descending 7 flights of stairs, REST.\', NULL, \'FitDistanceDailySummary\', 839, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(407, 326, \'Jan. 15 - Day 23 - 18 miles\', \'Reach the 1st Deep. Fire blocks them from Orcs. Cross Bridge over Durin’s Deep. Balrog attacks. Gandalf and Balrog fall.\', NULL, \'FitDistanceDailySummary\', 839.3, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(408, 326, \'Jan. 15 - Day 23 - 18 miles\', \'Rest escape up flight of steps, and out East Gate. Orcs flee. (ca.1 p.m.).\', NULL, \'FitDistanceDailySummary\', 839.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(409, 326, \'Continuing Jan. 15 - Outside Moria\', \'STOP to vent grief. Then continue down rough, winding trail.\', NULL, \'FitDistanceDailySummary\', 840, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(410, 326, \'Continuing Jan. 15 - Outside Moria\', \'Durin’s Stone and Mirrormere. Stop briefly, then continue south on road.\', NULL, \'FitDistanceDailySummary\', 841.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(411, 326, \'Continuing Jan. 15 - Outside Moria\', \'Pause at the spring of the Silverlode.\', NULL, \'FitDistanceDailySummary\', 842, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(412, 326, \'Continuing Jan. 15 - Outside Moria\', \'Frodo and Sam lag behind. Aragorn and Boromir carry them to a dell nearby. Eat and rest (ca. 3 to 4 p.m.).\', NULL, \'FitDistanceDailySummary\', 848, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(413, 326, \'Continuing Jan. 15 - Outside Moria\', \'Dusk (ca. 5 p.m.). \', NULL, \'FitDistanceDailySummary\', 851, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(414, 326, \'Continuing Jan. 15 - Outside Moria\', \'Frodo begins to hear Gollum again, and sees glowing eyes.\', NULL, \'FitDistanceDailySummary\', 854, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(415, 326, \'Continuing Jan. 15 - Outside Moria\', \'Enter woods of Lothlórien.\', NULL, \'FitDistanceDailySummary\', 855, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(416, 326, \'Continuing Jan. 15 - Outside Moria\', \'Cross the Nimrodel. Go west upstream a short distance. Meet elves. Sleep on flets in the trees. Orc company passes during the night. Gollum appears briefly.\', NULL, \'FitDistanceDailySummary\', 856, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(417, 326, \'Jan. 16 - Day 24: 32 miles\', \'Start about 8 a.m. Clear and cold “like a cool summer day.” Follow path south beside the Silverlode.\', NULL, \'FitDistanceDailySummary\', 856, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(418, 326, \'Jan. 16 - Day 24: 32 miles\', \'Cross the Silverlode on ropes. Fellowship is blindfolded. Frodo notices paths are smooth, and he smells the trees and grass.\', NULL, \'FitDistanceDailySummary\', 861, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(419, 326, \'Jan. 16 - Day 24: 32 miles\', \'Pass through an open glade.\', NULL, \'FitDistanceDailySummary\', 881, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(420, 326, \'Jan. 16 - Day 24: 32 miles\', \'CAMP - Sleep on the ground. Still blindfolded.\', NULL, \'FitDistanceDailySummary\', 888, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(421, 326, \'Jan. 17 - Day 26: 32 miles\', \'Continue on path.\', NULL, \'FitDistanceDailySummary\', 888, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(422, 326, \'Jan. 17 - Day 26: 32 miles\', \'Noon - In a clearing, meet an elf-company. Blindfolds are removed.Climb to the top of the hill of Cerin Amroth. Can see all around. Stay there ca. 2 hours.\', NULL, \'FitDistanceDailySummary\', 906, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(423, 326, \'Jan. 17 - Day 26: 32 miles\', \'Elves light lanterns (ca. 5:30 p.m.).\', NULL, \'FitDistanceDailySummary\', 914, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(424, 326, \'Jan. 17 - Day 26: 32 miles\', \'Reach the north side of Caras Galadan. Early stars are out (ca. 6:10 p.m.).\', NULL, \'FitDistanceDailySummary\', 916, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(425, 326, \'Jan. 17 - Day 26: 32 miles\', \'Reach Gates of Caras Galadan (south side) and climb to meet Celeborn and Galadriel. Stay in Lothlórien until February 16.\', NULL, \'FitDistanceDailySummary\', 920, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(426, 227, \'Lothlorien to Rauros Falls\', \'\', NULL, \'FitDistanceDailySummary\', NULL, \'flow\', NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(427, 426, \'Feb. 16 - Day 1: 31 miles (Hike + 7.5 hours on river)\', \'Leave Caras Galadon after breakfast. Lembas, cloaks and rope are provided. Haldir guides the Fellowship south and east through rolling woodlands, which fall away toward the rivers.\', NULL, \'FitDistanceDailySummary\', 920, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(428, 426, \'Feb. 16 - Day 1: 31 miles (Hike + 7.5 hours on river)\', \'Noon - Reach grassy lawn on the Silverlode just west of the Anduin. Practice paddling. Meet swan-ship of Celeborn and Galadriel. Lunch and gift-giving. Leave in 3 small boats (ca. 1 p.m.).\', NULL, \'FitDistanceDailySummary\', 930, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(429, 426, \'Feb. 16 - Day 1: 31 miles (Hike + 7.5 hours on river)\', \'DRIFT. Sweep around a bend, and high banks hide the light of Lórien.\', NULL, \'FitDistanceDailySummary\', 934, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(430, 426, \'Feb. 16 - Day 1: 31 miles (Hike + 7.5 hours on river)\', \'Bare woods on both banks. Land is silent. Misty. Dusk comes early.\', NULL, \'FitDistanceDailySummary\', 944, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(431, 426, \'Feb. 16 - Day 1: 31 miles (Hike + 7.5 hours on river)\', \'Camp in woods on west bank (ca. 8:30 p.m.). Dreary and cold.\', NULL, \'FitDistanceDailySummary\', 951, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(432, 426, \'Feb. 17 - Day 2: 36 miles (13 hours)\', \'Leave early (ca. 7:30 a.m.). Bare trees continue on both sides. DRIFT. No enemies.\', NULL, \'FitDistanceDailySummary\', 951, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(433, 426, \'Feb. 17 - Day 2: 36 miles (13 hours)\', \'Camp on west bank of the river.\', NULL, \'FitDistanceDailySummary\', 987, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(434, 426, \'Feb. 18 - Day 3: 36 miles (13 hours)\', \'Leave early. DRIFT. No enemies.\', NULL, \'FitDistanceDailySummary\', 987, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(435, 426, \'Feb. 18 - Day 3: 36 miles (13 hours)\', \'Trees thin. Gray and overcast.\', NULL, \'FitDistanceDailySummary\', 1008, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(436, 426, \'Feb. 18 - Day 3: 36 miles (13 hours)\', \'Trees disappear. Begin to see withered downs on east at the north edge of the Brown Lands. Tall reedy plains on west. Can see west to hills and mountains.\', NULL, \'FitDistanceDailySummary\', 1020, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(437, 426, \'Feb. 18 - Day 3: 36 miles (13 hours)\', \'Camp in flats north of the Field of Celebrant.\', NULL, \'FitDistanceDailySummary\', 1023, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(438, 426, \'Feb. 19 - Day 4: 60 miles (13 hours)\', \'Leave early. Feel urgency. Paddle all day.\', NULL, \'FitDistanceDailySummary\', 1023, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(439, 426, \'Feb. 19 - Day 4: 60 miles (13 hours)\', \'River broadens. Continues gray and overcast.\', NULL, \'FitDistanceDailySummary\', 1040, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(440, 426, \'Feb. 19 - Day 4: 60 miles (13 hours)\', \'Reach North Undeep with stony beaches on east - gravel shoals in the water: go carefully.\', NULL, \'FitDistanceDailySummary\', 1063, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(441, 426, \'Feb. 19 - Day 4: 60 miles (13 hours)\', \'River Limlight enters on west.\', NULL, \'FitDistanceDailySummary\', 1070, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(442, 426, \'Feb. 19 - Day 4: 60 miles (13 hours)\', \'High wolds of the Brown Lands on east. Downs seen on the west.\', NULL, \'FitDistanceDailySummary\', 1072, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(443, 426, \'Feb. 19 - Day 4: 60 miles (13 hours)\', \'Boromir mutters to himself. Just at dusk, Sam spots Gollum on a log.\', NULL, \'FitDistanceDailySummary\', 1075, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(444, 426, \'Feb. 19 - Day 4: 60 miles (13 hours)\', \'Camp on small eyot near western shore. Sam and Frodo watch. Gollum appears during Frodo’s watch. Aragorn wakes. Watches until morning.\', NULL, \'FitDistanceDailySummary\', 1083, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(445, 426, \'Feb. 20 - Day/Nt. 5: 72 miles - Continue through much of the night (18 hours)\', \'Leave early morning. Paddle long periods. Still overcast, east wind.\', NULL, \'FitDistanceDailySummary\', 1083, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(446, 426, \'Feb. 20 - Day/Nt. 5: 72 miles - Continue through much of the night (18 hours)\', \'River curves east. Wolds on both sides.\', NULL, \'FitDistanceDailySummary\', 1090, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(447, 426, \'Feb. 20 - Day/Nt. 5: 72 miles - Continue through much of the night (18 hours)\', \'River swings south. Still amid high hills.\', NULL, \'FitDistanceDailySummary\', 1110, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(448, 426, \'Feb. 20 - Day/Nt. 5: 72 miles - Continue through much of the night (18 hours)\', \'North edge of eastern South Undeep.\', NULL, \'FitDistanceDailySummary\', 1122, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(449, 426, \'Feb. 20 - Day/Nt. 5: 72 miles - Continue through much of the night (18 hours)\', \'Dusk. Continue through much of the night, paddling cautiously.\', NULL, \'FitDistanceDailySummary\', 1130, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(450, 426, \'Feb. 20 - Day/Nt. 5: 72 miles - Continue through much of the night (18 hours)\', \'Downs on far (east) bank. Hills of the Wold on near bank.\', NULL, \'FitDistanceDailySummary\', 1140, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(451, 426, \'Feb. 20 - Day/Nt. 5: 72 miles - Continue through much of the night (18 hours)\', \'Reach the north edge of western South Undeep.\', NULL, \'FitDistanceDailySummary\', 1142, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(452, 426, \'Feb. 20 - Day/Nt. 5: 72 miles - Continue through much of the night (18 hours)\', \'Reach steep north face of south downs, inner ridge - hidden in the dark.\', NULL, \'FitDistanceDailySummary\', 1150, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(453, 426, \'Feb. 20 - Day/Nt. 5: 72 miles - Continue through much of the night (18 hours)\', \'CAMP during DAY (Feb. 21). Downs on both sides of the river.\', NULL, \'FitDistanceDailySummary\', 1155, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(454, 426, \'Feb. 21 - Day/Nt. 6: 50 miles (13 hours)\', \'Leave at dusk. Paddle cautiously. Sky clears. Sam notices ‘rind’ of the new Moon. \', NULL, \'FitDistanceDailySummary\', 1155, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(455, 426, \'Feb. 21 - Day/Nt. 6: 50 miles (13 hours)\', \'North face of outer down ridge.\', NULL, \'FitDistanceDailySummary\', 1165, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(456, 426, \'Feb. 21 - Day/Nt. 6: 50 miles (13 hours)\', \'Reach lowlands between downs and the Emyn Muil.\', NULL, \'FitDistanceDailySummary\', 1180, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(457, 426, \'Feb. 21 - Day/Nt. 6: 50 miles (13 hours)\', \'CAMP during DAY (Feb. 22). \', NULL, \'FitDistanceDailySummary\', 1205, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(458, 426, \'Feb. 22 - Day/Nt. 7: 50 miles (13 hours)\', \'Leave at dusk. Paddle cautiously.\', NULL, \'FitDistanceDailySummary\', 1205, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(459, 426, \'Feb. 22 - Day/Nt. 7: 50 miles (13 hours)\', \'Banks grow stony. Hills north of the Emyn Muil rise on the east shore.\', NULL, \'FitDistanceDailySummary\', 1210, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(460, 426, \'Feb. 22 - Day/Nt. 7: 50 miles (13 hours)\', \'Hills also appear on the west. The river passes through “low crumbling cliffs, and chimneys with grey weathered stone dark with ivy.”\', NULL, \'FitDistanceDailySummary\', 1220, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(461, 426, \'Feb. 22 - Day/Nt. 7: 50 miles (13 hours)\', \'They reach the higher Emyn Muil. \', NULL, \'FitDistanceDailySummary\', 1234, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(462, 426, \'Feb. 22 - Day/Nt. 7: 50 miles (13 hours)\', \'Camp on west shore (Feb. 23). Many birds circle during the day.\', NULL, \'FitDistanceDailySummary\', 1255, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(463, 426, \'Feb. 23 - Day /Nt. 8: 12 miles (3.5 - 4 hours)\', \'Late in day Legolas sees eagle. Wait to full dark to leave (8:30 p.m.). Go slowly.\', NULL, \'FitDistanceDailySummary\', 1255, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(464, 426, \'Feb. 23 - Day /Nt. 8: 12 miles (3.5 - 4 hours)\', \'Midnight. Sam hears racing water. North edge of the rapids of Sarn Gebir. ORC ATTACK. Reach western shore. Legolas shoots a Nazgul’s flying beast. Move upstream to a small shallow bay. Huddle in boats rest of the night.\', NULL, \'FitDistanceDailySummary\', 1267, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(465, 426, \'Feb. 24 - Day 9: 2 miles\', \'Foggy. Carry boats and packs to foot of rapids - 2 trips. Camp by pool that night.\', NULL, \'FitDistanceDailySummary\', 1269, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(466, 426, \'Feb. 25 - Day 10: 40 miles (9+ hours)\', \'Leave at full light (ca. 7:30 a.m.).\', NULL, \'FitDistanceDailySummary\', 1269, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(467, 426, \'Feb. 25 - Day 10: 40 miles (9+ hours)\', \'Brief, heavy rain.\', NULL, \'FitDistanceDailySummary\', 1278, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(468, 426, \'Feb. 25 - Day 10: 40 miles (9+ hours)\', \'They are in a wide ravine, with great rocky sides, and a few trees.\', NULL, \'FitDistanceDailySummary\', 1280, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(469, 426, \'Feb. 25 - Day 10: 40 miles (9+ hours)\', \'Channel grows narrower and the River swifter.\', NULL, \'FitDistanceDailySummary\', 1284, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(470, 426, \'Feb. 25 - Day 10: 40 miles (9+ hours)\', \'The Argonath. Boats are swept through the narrow gap between.\', NULL, \'FitDistanceDailySummary\', 1288, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(471, 426, \'Feb. 25 - Day 10: 40 miles (9+ hours)\', \'Chasm of the Gates bends slightly to the west.\', NULL, \'FitDistanceDailySummary\', 1289, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(472, 426, \'Feb. 25 - Day 10: 40 miles (9+ hours)\', \'Pass out of the chasm into the lake: Nen Hithoel. (ca. 2 p.m.).\', NULL, \'FitDistanceDailySummary\', 1290, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(473, 426, \'Feb. 25 - Day 10: 40 miles (9+ hours)\', \'Rest in boats and eat. Then paddle on.\', NULL, \'FitDistanceDailySummary\', 1293, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(474, 426, \'Feb. 25 - Day 10: 40 miles (9+ hours)\', \'Aragorn leads them toward the west bank.\', NULL, \'FitDistanceDailySummary\', 1306, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(475, 426, \'Feb. 25 - Day 10: 40 miles (9+ hours)\', \'Reach the lawn of Parth Galen below Amon Hen. “Rauros was calling with a great voice.” Camp there.\', NULL, \'FitDistanceDailySummary\', 1309, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(476, 227, \'Rauros to Isengard: Merry and Pippin’s Path\', \'\', NULL, \'FitDistanceDailySummary\', NULL, \'flow\', NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(477, 476, \'Feb. 26 - Day 1: 27 miles \', \'Breaking of the Fellowship. Pippin and Merry run from Parth Galen searching for Frodo (shortly before noon).\', NULL, \'FitDistanceDailySummary\', 1309, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(478, 476, \'Feb. 26 - Day 1: 27 miles \', \'Boromir mortally wounded. Pippin and Merry captured by orcs (ca. 2 p.m.). \', NULL, \'FitDistanceDailySummary\', 1310, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(479, 476, \'Feb. 26 - Day 1: 27 miles \', \'Orcs carry hobbits. Pass along many gullies and ravines which dissect the backslope of the eastern ridge of the Emyn Muil.\', NULL, \'FitDistanceDailySummary\', 1315, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(480, 476, \'Feb. 26 - Day 1: 27 miles \', \'Descend the steep western cliff face.\', NULL, \'FitDistanceDailySummary\', 1319, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(481, 476, \'Feb. 26 - Day 1: 27 miles \', \'Reach a stony trough between ridged hills. They turn north alongside the trickling stream runs through the trough. \', NULL, \'FitDistanceDailySummary\', 1321, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(482, 476, \'Feb. 26 - Day 1: 27 miles \', \'Dusk. Pippin wakes, bound with ropes. Merry unconscious. Skirmish between Orcs of Mordor and Isengard. Pippin manages to cut the ropes on his wrists, then reties them.\', NULL, \'FitDistanceDailySummary\', 1323, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(483, 476, \'Feb. 26 - Day 1: 27 miles \', \'Orcs climb the western ridge where stream comes out of a ravine.\', NULL, \'FitDistanceDailySummary\', 1325, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(484, 476, \'Feb. 26 - Day 1: 27 miles \', \'Head of the stream. They continue up the ravine.\', NULL, \'FitDistanceDailySummary\', 1329, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(485, 476, \'Feb. 26 - Day 1: 27 miles \', \'Reach crest of western ridge.\', NULL, \'FitDistanceDailySummary\', 1332, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(486, 476, \'Feb. 26 - Day 1: 27 miles \', \'Go north along ridge.\', NULL, \'FitDistanceDailySummary\', 1333, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(487, 476, \'Feb. 26 - Day 1: 27 miles \', \'Reach a narrow ravine with a noisy stream running through it. Climb down the cliff ‘20 fathoms’ (120 feet) to a ‘wide and rugged shelf.’\', NULL, \'FitDistanceDailySummary\', 1334, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(488, 476, \'Feb. 26 - Day 1: 27 miles \', \'Early night. Reach the East Wall of Rohan - the sheer cliff which drops to the grassy plains on a path like a stony stair. Pippin awakes when he is thrown down. Scout reports seeing a Horseman. Uglúk smears ointment on Merry’s forehead and forces down an orc-draught to wake him. Both hobbits’ leg bindings are cut and they are forced to run.\', NULL, \'FitDistanceDailySummary\', 1336, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(489, 476, \'Feb. 27 - Nt./Day 2: 84 miles \', \'They descend the sheer cliff of the shelf on a path like a stony stair.\', NULL, \'FitDistanceDailySummary\', 1336, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(490, 476, \'Feb. 27 - Nt./Day 2: 84 miles \', \'In the grasslands orcs run with long, loping strides.\', NULL, \'FitDistanceDailySummary\', 1337, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(491, 476, \'Feb. 27 - Nt./Day 2: 84 miles \', \'When they reach a muddy depression, Pippin swerves away from the main trail. As he is recaptured, he drops his elven brooch.\', NULL, \'FitDistanceDailySummary\', 1339, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(492, 476, \'Feb. 27 - Nt./Day 2: 84 miles \', \'Merry and Pippin are carried again. They slip into dark dreams.\', NULL, \'FitDistanceDailySummary\', 1344, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(493, 476, \'Feb. 27 - Nt./Day 2: 84 miles \', \'Far behind, the company is visible to Legolas.\', NULL, \'FitDistanceDailySummary\', 1368, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(494, 476, \'Feb. 27 - Nt./Day 2: 84 miles \', \'Ground begins to rise toward the downs to the north.\', NULL, \'FitDistanceDailySummary\', 1399, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(495, 476, \'Feb. 27 - Nt./Day 2: 84 miles \', \'Turn more to the north, parallel to the river Entwash. Dryer ground.\', NULL, \'FitDistanceDailySummary\', 1403, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(496, 476, \'Feb. 27 - Nt./Day 2: 84 miles \', \'Reach the first slopes of the Downs. Many orcs demand a halt. Pippin and Merry are flung to the ground and sleep (ca.11 p.m).\', NULL, \'FitDistanceDailySummary\', 1420, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(497, 476, \'Feb. 28 - Nt./Day 3: 54 miles \', \'Soon the hobbits are carried again, tossed and shaken.\', NULL, \'FitDistanceDailySummary\', 1420, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(498, 476, \'Feb. 28 - Nt./Day 3: 54 miles \', \'North face of southern down ridge.\', NULL, \'FitDistanceDailySummary\', 1429, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(499, 476, \'Feb. 28 - Nt./Day 3: 54 miles \', \'Rising crest of second down ridge.\', NULL, \'FitDistanceDailySummary\', 1436, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(500, 476, \'Feb. 28 - Nt./Day 3: 54 miles \', \'Reach the most northerly hill of the Downs. Turn more toward the river.\', NULL, \'FitDistanceDailySummary\', 1444, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(501, 476, \'Feb. 28 - Nt./Day 3: 54 miles \', \'Morning. Orcs stop near the Entwash. Mountains and forest can be seen ahead. Pippin is thrown on the grass. Merry is not far away. Eat. Riders of Rohan are seen to the south. Over 100 northern orcs flee north. Grisnákh returns from the east with 40 Orcs of Mordor. Isengarders carry the hobbits, changing off carriers.\', NULL, \'FitDistanceDailySummary\', 1449, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(502, 476, \'Feb. 28 - Nt./Day 3: 54 miles \', \'Isengarders gradually pass through Orcs of Mordor. Hills of the Wold rise on the east.\', NULL, \'FitDistanceDailySummary\', 1454, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(503, 476, \'Feb. 28 - Nt./Day 3: 54 miles \', \'Isengarders overtake Northerners. Riders are sighted, still far, but gaining. Isengarders redouble pace.\', NULL, \'FitDistanceDailySummary\', 1459, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(504, 476, \'Feb. 28 - Nt./Day 3: 54 miles \', \'Land begins to slope upward. They are already passing a few trees. Pippin fears the Orcs will beat the Riders to the forest.\', NULL, \'FitDistanceDailySummary\', 1469, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(505, 476, \'Feb. 28 - Nt./Day 3: 54 miles \', \'Rohirrim start to hem them in and are shooting stragglers.\', NULL, \'FitDistanceDailySummary\', 1472, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(506, 476, \'Feb. 28 - Nt./Day 3: 54 miles \', \'Just short of the edge of Fangorn, the last 200 Orcs are encircled by the Rohirrim. Camp on a knoll. Night falls and clouds occasionally cover the moon.\', NULL, \'FitDistanceDailySummary\', 1474, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(507, 476, \'Feb. 29 - Nt./Day 4: 105 miles \', \'Grishnákh of Mordor secretly carries the hobbits away from camp.\', NULL, \'FitDistanceDailySummary\', 1474, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(508, 476, \'Feb. 29 - Nt./Day 4: 105 miles \', \'Rider kills Grishnákh. Hobbits cut their bonds, then eat lembas.\', NULL, \'FitDistanceDailySummary\', 1474.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(509, 476, \'Feb. 29 - Nt./Day 4: 105 miles \', \'Hobbits crawl to the river, but banks are too steep to drink. They hear noise from the camp as the Riders fight off the orc reinforcements.\', NULL, \'FitDistanceDailySummary\', 1475, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(510, 476, \'Feb. 29 - Nt./Day 4: 105 miles \', \'Sky is beginning to pale as the walk along the river to the edge of the forest. DAWN. Riders attack orcs. Hobbits watch a while, then follow the stream into Fangorn Forest as closely as the tangled woods allow.\', NULL, \'FitDistanceDailySummary\', 1475.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(511, 476, \'Feb. 29 - Nt./Day 4: 105 miles \', \'Stop for a drink, bathe their feet and talk. Dim and stuffy. See sun shining through some way ahead.\', NULL, \'FitDistanceDailySummary\', 1477, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(512, 476, \'Feb. 29 - Nt./Day 4: 105 miles \', \'Further than they thought. Ground rises steeply and is more stony.\', NULL, \'FitDistanceDailySummary\', 1478, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(513, 476, \'Feb. 29 - Nt./Day 4: 105 miles \', \'Reach a ‘rock-wall’ at the foot of a barren hill. Climb rough stair to the top of the hill.\', NULL, \'FitDistanceDailySummary\', 1478.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(514, 476, \'Feb. 29 - Nt./Day 4: 105 miles \', \'Treebeard’s Hill - Meet Treebeard.\', NULL, \'FitDistanceDailySummary\', 1479, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(515, 476, \'Feb. 29 - Nt./Day 4: 105 miles \', \'Treebeard carries them down the hill, then turns west. They go deeper into the woods, but are never far from the stream.\', NULL, \'FitDistanceDailySummary\', 1479.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(516, 476, \'Feb. 29 - Nt./Day 4: 105 miles \', \'Pippin asks why Celeborn warned them against Fangorn.\', NULL, \'FitDistanceDailySummary\', 1489, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(517, 476, \'Feb. 29 - Nt./Day 4: 105 miles \', \'Treebeard chants of the woods of Beleriand.\', NULL, \'FitDistanceDailySummary\', 1499, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(518, 476, \'Feb. 29 - Nt./Day 4: 105 miles \', \'Crest of a rise.\', NULL, \'FitDistanceDailySummary\', 1505, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(519, 476, \'Feb. 29 - Nt./Day 4: 105 miles \', \'Valley.\', NULL, \'FitDistanceDailySummary\', 1525, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(520, 476, \'Feb. 29 - Nt./Day 4: 105 miles \', \'Hillcrest.\', NULL, \'FitDistanceDailySummary\', 1549, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(521, 476, \'Feb. 29 - Nt./Day 4: 105 miles \', \'Valley.\', NULL, \'FitDistanceDailySummary\', 674, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(522, 476, \'Feb. 29 - Nt./Day 4: 105 miles \', \'Small rise.\', NULL, \'FitDistanceDailySummary\', 1531, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(523, 476, \'Feb. 29 - Nt./Day 4: 105 miles \', \'Ascend a ridge.\', NULL, \'FitDistanceDailySummary\', 1537, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(524, 476, \'Feb. 29 - Nt./Day 4: 105 miles \', \'Rise even higher.\', NULL, \'FitDistanceDailySummary\', 1543, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(525, 476, \'Feb. 29 - Nt./Day 4: 105 miles \', \'Hillcrest.\', NULL, \'FitDistanceDailySummary\', 698, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(526, 476, \'Feb. 29 - Nt./Day 4: 105 miles \', \'Depression.\', NULL, \'FitDistanceDailySummary\', 1551, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(527, 476, \'Feb. 29 - Nt./Day 4: 105 miles \', \'Foothill.\', NULL, \'FitDistanceDailySummary\', 1557, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(528, 476, \'Feb. 29 - Nt./Day 4: 105 miles \', \'A higher crest.\', NULL, \'FitDistanceDailySummary\', 1565, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(529, 476, \'Feb. 29 - Nt./Day 4: 105 miles \', \'Dusk. Reach the foot of the mountains. Treebeard climbs the slope.\', NULL, \'FitDistanceDailySummary\', 1569, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(530, 476, \'Feb. 29 - Nt./Day 4: 105 miles \', \'Slope climbs higher.\', NULL, \'FitDistanceDailySummary\', 1573, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(531, 476, \'Feb. 29 - Nt./Day 4: 105 miles \', \'Continue to climb.\', NULL, \'FitDistanceDailySummary\', 1575, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(532, 476, \'Feb. 29 - Nt./Day 4: 105 miles \', \'They reach Wellinghall, Treebeard’s home - a bay hidden behind a showering fall channeled from the spring of the Entwash. They have gone 70,000 Ent-strides.\', NULL, \'FitDistanceDailySummary\', 1579, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(533, 476, \'Feb. 30 - Day 5: 25 miles \', \'While the hobbits sleep, Treebeard walks far summoning other Ents. Leave Wellinghall about 9 a.m. Treebeard carries them again.\', NULL, \'FitDistanceDailySummary\', 1579, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(534, 476, \'Feb. 30 - Day 5: 25 miles \', \'Turn right, cross the young stream, and cross tumbled slopes with few trees. Birch, rowan and pines can be seen higher up.\', NULL, \'FitDistanceDailySummary\', 1580, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(535, 476, \'Feb. 30 - Day 5: 25 miles \', \'Pippin loses count of Ent-strides at about 3000.\', NULL, \'FitDistanceDailySummary\', 1583, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(536, 476, \'Feb. 30 - Day 5: 25 miles \', \'As he walks Treebeard chants. There are occasional responses.\', NULL, \'FitDistanceDailySummary\', 1589, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(537, 476, \'Feb. 30 - Day 5: 25 miles \', \'They descend a last slope into deep woods with huge trees.\', NULL, \'FitDistanceDailySummary\', 1595, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(538, 476, \'Feb. 30 - Day 5: 25 miles \', \'Treebeard sends out a summoning ‘Hoom.’ Others respond.\', NULL, \'FitDistanceDailySummary\', 1601, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(539, 476, \'Feb. 30 - Day 5: 25 miles \', \'Treebeard sends out a summoning ‘Hoom.’ Others respond.\', NULL, \'FitDistanceDailySummary\', 748, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(540, 476, \'Feb. 30 - Day 5: 25 miles \', \'Treebeard sends out a summoning ‘Hoom.’ Others respond.\', NULL, \'FitDistanceDailySummary\', 750, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(541, 476, \'Feb. 30 - Day 5: 25 miles \', \'They pass through a dense evergreen hedge into a bowl with 3 birches: Derndingle. Entmoot begins. Hobbits wander.\', NULL, \'FitDistanceDailySummary\', 1604, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(542, 476, \'Mar. 2 - Day 7: 60 miles \', \'Dawn: bleak and windy. Voices clamour, then Forest grows silent. Ent voices explode and the march begins. Quickbeam carries the hobbits to join the others (ca.4 p.m.). Treebeard takes hobbits to carry. \', NULL, \'FitDistanceDailySummary\', 1604, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(543, 476, \'Mar. 2 - Day 7: 60 miles \', \'Treebeard sings with the others.\', NULL, \'FitDistanceDailySummary\', 1605, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(544, 476, \'Mar. 2 - Day 7: 60 miles \', \'Treebeard speaks again to hobbits.\', NULL, \'FitDistanceDailySummary\', 1607, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(545, 476, \'Mar. 2 - Day 7: 60 miles \', \'Enter a long fold of land toward the south.\', NULL, \'FitDistanceDailySummary\', 1611, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(546, 476, \'Mar. 2 - Day 7: 60 miles \', \'Stop for evening drink.\', NULL, \'FitDistanceDailySummary\', 1619, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(547, 476, \'Mar. 2 - Day 7: 60 miles \', \'Climb up the western ridge. Woods change to scattered birch, then pines.\', NULL, \'FitDistanceDailySummary\', 1624, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(548, 476, \'Mar. 2 - Day 7: 60 miles \', \'Sun falls behind the ridge ahead. Behind them the Huorns gather and follow.\', NULL, \'FitDistanceDailySummary\', 1629, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(549, 476, \'Mar. 2 - Day 7: 60 miles \', \'Near the crest of the ridge, singing stops. Night falls.\', NULL, \'FitDistanceDailySummary\', 1633, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(550, 476, \'Mar. 2 - Day 7: 60 miles \', \'Summit of hill - see Isengard below.\', NULL, \'FitDistanceDailySummary\', 1635, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(551, 476, \'Mar. 2 - Day 7: 60 miles \', \'Creep down a long ravine\', NULL, \'FitDistanceDailySummary\', 1639, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(552, 476, \'Mar. 2 - Day 7: 60 miles \', \'Enter the upper end of the Wizard’s Vale. Dark & cloudy.\', NULL, \'FitDistanceDailySummary\', 1649, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(553, 476, \'Mar. 2 - Day 7: 60 miles \', \'Cross the upper waters of the Isen.\', NULL, \'FitDistanceDailySummary\', 1655, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(554, 476, \'Mar. 2 - Day 7: 60 miles \', \'Hourns gather along the north side of Isengard.\', NULL, \'FitDistanceDailySummary\', 1659, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(555, 476, \'Mar. 2 - Day 7: 60 miles \', \'Reach Isengard - Treebeard, hobbits and a few other ents hide near the gate of Isengard. Shortly after midnight, Saruman’s army marches forth: at least 10,000. Took over an hour. Many Huorns follow. Ents attack walls of Isengard. Quickbeam almost catches Saruman. After burning of one ent, Treebeard halts the attack.\', NULL, \'FitDistanceDailySummary\', 1664, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(556, 227, \'Rauros to Isengard: Aragorn\\\'s Path\', \'\', NULL, \'FitDistanceDailySummary\', NULL, \'flow\', NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(557, 556, \'Feb. 26 - Day 1: 12 miles \', \'Breaking of the Fellowship. Boromir slain. Pippin and Merry captured by orcs. Aragorn, Legolas and Gimli return to Parth Galen. Lay Boromir in one of the boats and send it over Rauros Falls. Seeing that Sam and Frodo have gone east, Aragorn chooses to rescue Merry and Pippin. \', NULL, \'FitDistanceDailySummary\', 1664, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(558, 556, \'Feb. 26 - Day 1: 12 miles \', \'The ‘Three Hunters’ return to the glade where Boromir fell and pick up the orcs’ trail (ca. 4:30 p.m.).\', NULL, \'FitDistanceDailySummary\', 1665, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(559, 556, \'Feb. 26 - Day 1: 12 miles \', \'Trail passes along many gullies and ravines which dissect the backslope of the eastern ridge of the Emyn Muil.\', NULL, \'FitDistanceDailySummary\', 1670, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(560, 556, \'Feb. 26 - Day 1: 12 miles \', \'Descend the steep western cliff face.\', NULL, \'FitDistanceDailySummary\', 1674, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(561, 556, \'Feb. 26 - Day 1: 12 miles \', \'Rest briefly about an hour before dawn (ca. 5 a.m.). No Camp.\', NULL, \'FitDistanceDailySummary\', 1676, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(562, 556, \'Feb. 27 - Day 2: 51 miles \', \'They are in a stony trough between ridged hills. A trickling stream runs through the trough. Aragorn cannot see the trail in the stony land, but decides to look north.\', NULL, \'FitDistanceDailySummary\', 1676, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(563, 556, \'Feb. 27 - Day 2: 51 miles \', \'Legolas finds 5 dead orcs. They search area.\', NULL, \'FitDistanceDailySummary\', 1678, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(564, 556, \'Feb. 27 - Day 2: 51 miles \', \'Aragorn finds orcs’ pathway going up a ravine in the western ridge. The upper stream runs in the ravine.\', NULL, \'FitDistanceDailySummary\', 1680, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(565, 556, \'Feb. 27 - Day 2: 51 miles \', \'Head of the stream. They continue up the ravine.\', NULL, \'FitDistanceDailySummary\', 1684, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(566, 556, \'Feb. 27 - Day 2: 51 miles \', \'Reach crest of western ridge. Dawn. Chill wind. Legolas sees eagle. Also sees the orc company far ahead (ca. 36 miles).\', NULL, \'FitDistanceDailySummary\', 1687, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(567, 556, \'Feb. 27 - Day 2: 51 miles \', \'Trail goes north along ridge.\', NULL, \'FitDistanceDailySummary\', 1688, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(568, 556, \'Feb. 27 - Day 2: 51 miles \', \'Reach a narrow ravine where orcs climbed down. A noisy stream runs through it. The cliff drops ‘20 fathoms’ (120 feet) to a ‘wide and rugged shelf’ - the East Wall of Rohan.\', NULL, \'FitDistanceDailySummary\', 1689, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(569, 556, \'Feb. 27 - Day 2: 51 miles \', \'The sheer cliff drops to the grassy plains on a path like a stony stair.\', NULL, \'FitDistanceDailySummary\', 1691, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(570, 556, \'Feb. 27 - Day 2: 51 miles \', \'Stream disappears amid watercress. Air is warm and fragrant. They run faster.\', NULL, \'FitDistanceDailySummary\', 1692, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(571, 556, \'Feb. 27 - Day 2: 51 miles \', \'Aragorn sees Pippin’s trail to the side and finds the Elven brooch.\', NULL, \'FitDistanceDailySummary\', 1694, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(572, 556, \'Feb. 27 - Day 2: 51 miles \', \'Brief rest.\', NULL, \'FitDistanceDailySummary\', 1711, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(573, 556, \'Feb. 27 - Day 2: 51 miles \', \'Brief rest.\', NULL, \'FitDistanceDailySummary\', 505, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(574, 556, \'Feb. 27 - Day 2: 51 miles \', \'Night falls. Camp (ca. 5:30 p.m.).\', NULL, \'FitDistanceDailySummary\', 1727, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(575, 556, \'Feb. 28 - Day 3: 36 miles \', \'Aragorn listens to ground and hears horses galloping away from them. They leave at dawn.\', NULL, \'FitDistanceDailySummary\', 1727, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(576, 556, \'Feb. 28 - Day 3: 36 miles \', \'Ground begins to rise toward the downs to the north (ca. 3 p.m.).\', NULL, \'FitDistanceDailySummary\', 1754, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(577, 556, \'Feb. 28 - Day 3: 36 miles \', \'Trail bends north. Tracks become more faint on the dryer ground. Land seems empty.\', NULL, \'FitDistanceDailySummary\', 1758, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(578, 556, \'Feb. 28 - Day 3: 36 miles \', \'Camp. Legolas fears orcs have reached Fangorn. Gathering clouds hide sliver of moon.\', NULL, \'FitDistanceDailySummary\', 1763, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(579, 556, \'Feb. 29 - Day 4: 36 miles \', \'A red dawn. East wind. \', NULL, \'FitDistanceDailySummary\', 1763, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(580, 556, \'Feb. 29 - Day 4: 36 miles \', \'11 a.m. Reach the first slopes of the Downs. See trampled grass from the orc camp just west of the slope. Aragorn estimates 36 hours old.\', NULL, \'FitDistanceDailySummary\', 1775, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(581, 556, \'Feb. 29 - Day 4: 36 miles \', \'North face of southern down ridge.\', NULL, \'FitDistanceDailySummary\', 1784, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(582, 556, \'Feb. 29 - Day 4: 36 miles \', \'Rising crest of second down ridge.\', NULL, \'FitDistanceDailySummary\', 1791, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(583, 556, \'Feb. 29 - Day 4: 36 miles \', \'Reach most northerly hill of the Downs. Camp on hill. Cold and starry.\', NULL, \'FitDistanceDailySummary\', 1799, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(584, 556, \'Feb. 30 - Day 5: 30 miles \', \'Dawn - east wind. Can see the Wold ahead and to the east. 15 miles away they see the Riders of Rohan. Decide to wait there. Meeting with the Riders. Éomer lends them two horses. Aragorn rides Hasufel; Legolas and Gimli: Arod. Leave ca. 11 a.m.\', NULL, \'FitDistanceDailySummary\', 1799, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(585, 556, \'Feb. 30 - Day 5: 30 miles \', \'Find the orc trail from the East. Aragorn searches. Ride more slowly.\', NULL, \'FitDistanceDailySummary\', 1804, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(586, 556, \'Feb. 30 - Day 5: 30 miles \', \'Overcast. Begin to find dead orcs.\', NULL, \'FitDistanceDailySummary\', 1827, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(587, 556, \'Feb. 30 - Day 5: 30 miles \', \'Reach Fangorn and find pyre of orcs (ca. 4 p.m.). Search area. Camp by trees. Build a fire. See Saruman. Horses flee, but meet Shadowfax.\', NULL, \'FitDistanceDailySummary\', 1829, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(588, 556, \'Mar. 1 - Day 6: 105 miles \', \'Eat at dawn. Search again.\', NULL, \'FitDistanceDailySummary\', 1829, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(589, 556, \'Mar. 1 - Day 6: 105 miles \', \'Find mallorn leaf near knife and ropes.\', NULL, \'FitDistanceDailySummary\', 1829.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(590, 556, \'Mar. 1 - Day 6: 105 miles \', \'See faint hobbit prints near river.\', NULL, \'FitDistanceDailySummary\', 1830, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(591, 556, \'Mar. 1 - Day 6: 105 miles \', \'See prints of 1 hobbit at edge of trees. Enter Fangorn Forest.\', NULL, \'FitDistanceDailySummary\', 1830.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(592, 556, \'Mar. 1 - Day 6: 105 miles \', \'Clear prints by river of both Merry and Pippin (2 days old).\', NULL, \'FitDistanceDailySummary\', 1832, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(593, 556, \'Mar. 1 - Day 6: 105 miles \', \'Follow hobbits’ trail to foot of Treebeard’s Hill.\', NULL, \'FitDistanceDailySummary\', 1833.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(594, 556, \'Mar. 1 - Day 6: 105 miles \', \'Climb Treebeard’s Hill. See old man below. Legolas realizes it is Gandalf!\', NULL, \'FitDistanceDailySummary\', 1834, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(595, 556, \'Mar. 1 - Day 6: 105 miles \', \'Leave Treebeard’s Hill.\', NULL, \'FitDistanceDailySummary\', 1834.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(596, 556, \'Mar. 1 - Day 6: 105 miles \', \'Follow the Entwash back out of the forest. Gandalf whistles for Shadowfax. Arod and Hasufel also return.\', NULL, \'FitDistanceDailySummary\', 1837.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(597, 556, \'Mar. 1 - Day 6: 105 miles \', \'Go along bank of the Entwash.\', NULL, \'FitDistanceDailySummary\', 1840, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(598, 556, \'Mar. 1 - Day 6: 105 miles \', \'Wade across the river at a shallow place.\', NULL, \'FitDistanceDailySummary\', 1843, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(599, 556, \'Mar. 1 - Day 6: 105 miles \', \'Flat land, treeless and wide. Ride through meads and riverlands.\', NULL, \'FitDistanceDailySummary\', 1850, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(600, 556, \'Mar. 1 - Day 6: 105 miles \', \'Hidden pool.\', NULL, \'FitDistanceDailySummary\', 1858, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(601, 556, \'Mar. 1 - Day 6: 105 miles \', \'Sedge in treacherous bogs.\', NULL, \'FitDistanceDailySummary\', 1868, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(602, 556, \'Mar. 1 - Day 6: 105 miles \', \'As sun settles toward the west, see smoke from Isengard.\', NULL, \'FitDistanceDailySummary\', 1888, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(603, 556, \'Mar. 1 - Day 6: 105 miles \', \'Sunset.\', NULL, \'FitDistanceDailySummary\', 1890, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(604, 556, \'Mar. 1 - Day 6: 105 miles \', \'Dusk.\', NULL, \'FitDistanceDailySummary\', 1893, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(605, 556, \'Mar. 1 - Day 6: 105 miles \', \'Full night.\', NULL, \'FitDistanceDailySummary\', 1896, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(606, 556, \'Mar. 1 - Day 6: 105 miles \', \'Shadowfax leads as quickly as by daylight.\', NULL, \'FitDistanceDailySummary\', 1914, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(607, 556, \'Mar. 1 - Day 6: 105 miles \', \'Stop at last (ca. midnight). Camp only a few hours.\', NULL, \'FitDistanceDailySummary\', 1934, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(608, 556, \'Mar. 2 - Day 7: 62 miles \', \'Continue under the moon (ca. 3 a.m.). Long clouds and chill wind.\', NULL, \'FitDistanceDailySummary\', 1934, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(609, 556, \'Mar. 2 - Day 7: 62 miles \', \'Moon sets into clouds of the west.\', NULL, \'FitDistanceDailySummary\', 1944, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(610, 556, \'Mar. 2 - Day 7: 62 miles \', \'Bitter chill. Dark slowly fades.\', NULL, \'FitDistanceDailySummary\', 1949, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(611, 556, \'Mar. 2 - Day 7: 62 miles \', \'Dawn. Clear and bright. Legolas can see Meduseld.\', NULL, \'FitDistanceDailySummary\', 1954, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(612, 556, \'Mar. 2 - Day 7: 62 miles \', \'Ford the Snowbourne. Reach a wide track. Follow it to the uplands.\', NULL, \'FitDistanceDailySummary\', 1958, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(613, 556, \'Mar. 2 - Day 7: 62 miles \', \'Pass the burial mounds at the foot of the hill and climb to Edoras. Stopped from entering until permission is received.\', NULL, \'FitDistanceDailySummary\', 1958.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(614, 556, \'Mar. 2 - Day 7: 62 miles \', \'Climb to Meduseld, the Golden Hall of Edoras. Gandalf heals Théoden. Rainy and windy as they exit the hall, but a shaft of sunlight shines through. Éomer is freed. Grima departs. King orders Riders to prepare to ride. Eat. Leave ca. 1 p.m.\', NULL, \'FitDistanceDailySummary\', 1959, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(615, 556, \'Mar. 2 - Day 7: 62 miles \', \'Recross the Snowbourne.\', NULL, \'FitDistanceDailySummary\', 1960, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(616, 556, \'Mar. 2 - Day 7: 62 miles \', \'Follow a beaten way across the foothills.\', NULL, \'FitDistanceDailySummary\', 1961, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(617, 556, \'Mar. 2 - Day 7: 62 miles \', \'Cross a small stream.\', NULL, \'FitDistanceDailySummary\', 1983, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(618, 556, \'Mar. 2 - Day 7: 62 miles \', \'Dusk. Camp (ca. 6 p.m.).\', NULL, \'FitDistanceDailySummary\', 1996, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(619, 556, \'Mar. 3 - Day 8: 82 miles \', \'Rise at dawn. Depart ca. 7 a.m.\', NULL, \'FitDistanceDailySummary\', 1996, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(620, 556, \'Mar. 3 - Day 8: 82 miles \', \'Cross a small stream.\', NULL, \'FitDistanceDailySummary\', 2046, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(621, 556, \'Mar. 3 - Day 8: 82 miles \', \'No clouds, but hot and hazy. Dark in the east.\', NULL, \'FitDistanceDailySummary\', 2014, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(622, 556, \'Mar. 3 - Day 8: 82 miles \', \'Cross a small stream.\', NULL, \'FitDistanceDailySummary\', 810, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(623, 556, \'Mar. 3 - Day 8: 82 miles \', \'Legolas can see darkness with shapes in it near the River Isen: Huorns.\', NULL, \'FitDistanceDailySummary\', 2023, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(624, 556, \'Mar. 3 - Day 8: 82 miles \', \'Cross a small stream. \', NULL, \'FitDistanceDailySummary\', 818, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(625, 556, \'Mar. 3 - Day 8: 82 miles \', \'Cross a small stream.\', NULL, \'FitDistanceDailySummary\', 830, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(626, 556, \'Mar. 3 - Day 8: 82 miles \', \'Cross a small stream.\', NULL, \'FitDistanceDailySummary\', 840, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(627, 556, \'Mar. 3 - Day 8: 82 miles \', \'Dark clouds from east begin to overtake them.\', NULL, \'FitDistanceDailySummary\', 2064, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(628, 556, \'Mar. 3 - Day 8: 82 miles \', \'Sunset. Near the mouth of the Westfold Vale. See a ride in the west.\', NULL, \'FitDistanceDailySummary\', 2066, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(629, 556, \'Mar. 3 - Day 8: 82 miles \', \'Rider arrives. Tells them of the fall of Erkenbrand. Gandalf advises Théoden to ride for Helm’s Deep. Gandalf leaves on Shadowfax.\', NULL, \'FitDistanceDailySummary\', 2067, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(630, 556, \'Mar. 3 - Day 8: 82 miles \', \'Host reaches the road into the Deeping Coomb. They turn south.\', NULL, \'FitDistanceDailySummary\', 2068, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(631, 556, \'Mar. 3 - Day 8: 82 miles \', \'Night falls.\', NULL, \'FitDistanceDailySummary\', 2070, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(632, 556, \'Mar. 3 - Day 8: 82 miles \', \'As climb upwards in the Deeping Coomb, scout reports wolf-riders.\', NULL, \'FitDistanceDailySummary\', 2072, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(633, 556, \'Mar. 3 - Day 8: 82 miles \', \'Orc bands flee the advancing Riders.\', NULL, \'FitDistanceDailySummary\', 2074, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(634, 556, \'Mar. 3 - Day 8: 82 miles \', \'Looking back, see torches of Saruman’s army.\', NULL, \'FitDistanceDailySummary\', 2076, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(635, 556, \'Mar. 3 - Day 8: 82 miles \', \'Reach Helm’s Dike. It is overcast and dark.\', NULL, \'FitDistanceDailySummary\', 2077.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(636, 556, \'Mar. 3 - Day 8: 82 miles \', \'Reach the Hornburg: the fortress of Helm’s Deep.\', NULL, \'FitDistanceDailySummary\', 2078, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(637, 556, \'Mar. 4 - Day 9: 40 miles \', \'Past midnight. Lightning shows all the vale is filled with Saruman’s army - 10,000 strong at least. Rain begins. Battle of Helm’s Deep. Weather clears (ca. 4:30 a.m.). Uruk-hai blast an opening through the Deeping Wall. Defenders retreat to the Hornburg and the caves.\nDAWN. Defenders counterattack. Gandalf arrives with Erkenbrand’s riders. Orcs flee into Huorns and are destroyed. Dunlendings surrender. King’s company rests. Departs for Isengard in afternoon (ca. 3 p.m.).\', NULL, \'FitDistanceDailySummary\', 2078, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(638, 556, \'Mar. 4 - Day 9: 40 miles \', \'Company stops at burial mounds, then passes through Helm’s Dike.\', NULL, \'FitDistanceDailySummary\', 2078.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(639, 556, \'Mar. 4 - Day 9: 40 miles \', \'Reach Huorns. Road continues among the ‘trees.’\', NULL, \'FitDistanceDailySummary\', 2079, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(640, 556, \'Mar. 4 - Day 9: 40 miles \', \'Reach the end of the Huorns. \', NULL, \'FitDistanceDailySummary\', 2087.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(641, 556, \'Mar. 4 - Day 9: 40 miles \', \'Turn west to Fords of Isen. Red after-sunset. See carrion fowl ahead.\', NULL, \'FitDistanceDailySummary\', 2088, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(642, 556, \'Mar. 4 - Day 9: 40 miles \', \'Waxing moon rises.\', NULL, \'FitDistanceDailySummary\', 2096, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(643, 556, \'Mar. 4 - Day 9: 40 miles \', \'Reach Fords (ca. 9:30 p.m.). The Isen is almost dry. Pass the burial mound of Erkenbrand’s riders on an islet in the riverbed.\', NULL, \'FitDistanceDailySummary\', 2103, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(644, 556, \'Mar. 4 - Day 9: 40 miles \', \'Turn north on the highway to Isengard.\', NULL, \'FitDistanceDailySummary\', 2104, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(645, 556, \'Mar. 4 - Day 9: 40 miles \', \'Midnight. 15 miles north of the Fords. Camp beside the river. During the night Huorns pass by. Company wakes. Later the water returns.\', NULL, \'FitDistanceDailySummary\', 2118, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(646, 556, \'Mar. 5 - Day 10: 16 miles \', \'Dawn. Make ready to continue. Ride slowly.\', NULL, \'FitDistanceDailySummary\', 2118, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(647, 556, \'Mar. 5 - Day 10: 16 miles \', \'Enter the south end of the Wizard’s Vale.\', NULL, \'FitDistanceDailySummary\', 2120, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(648, 556, \'Mar. 5 - Day 10: 16 miles \', \'Pass through a wilderness of weeds and thorns. All trees cut to stumps.\', NULL, \'FitDistanceDailySummary\', 2124, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(649, 556, \'Mar. 5 - Day 10: 16 miles \', \'Highway becomes a wide street, paved with stones.\', NULL, \'FitDistanceDailySummary\', 2128, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(650, 556, \'Mar. 5 - Day 10: 16 miles \', \'Pass a tall pillar: the White Hand. Evidence of a flood beyond.\', NULL, \'FitDistanceDailySummary\', 2130, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(651, 556, \'Mar. 5 - Day 10: 16 miles \', \'Reach the gates of Isengard (past noon). Meet Merry and Pippin. Aragorn, Legolas and Gimli stay at gatehouse to eat and talk.\', NULL, \'FitDistanceDailySummary\', 2133.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(652, 556, \'Mar. 5 - Day 10: 16 miles \', \'Reach Orthanc. Confrontation with Saruman.\', NULL, \'FitDistanceDailySummary\', 2134, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(653, 227, \'Rauros to Mt. Doom: The Journey of Frodo and Sam\', \'\', NULL, \'FitDistanceDailySummary\', NULL, \'flow\', NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(654, 653, \'Feb. 26 - Day 1: 10 miles\', \'Breaking of the Fellowship. Noon. Frodo decides to go to Mordor alone, but Sam guesses. Reaches lake as Frodo is leaving. They go together.\', NULL, \'FitDistanceDailySummary\', 2134, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(655, 653, \'Feb. 26 - Day 1: 10 miles\', \'Paddle past the south end of Tol Brandir.\', NULL, \'FitDistanceDailySummary\', 2134.25, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(656, 653, \'Feb. 26 - Day 1: 10 miles\', \'Reach shelving shore on the south slopes of Amon Lhaw. Hide boat.\', NULL, \'FitDistanceDailySummary\', 2134.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(657, 653, \'Feb. 26 - Day 1: 10 miles\', \'Head SE into the “strange twisted knot of hills” - the eastern Emyn Muil.\', NULL, \'FitDistanceDailySummary\', 2135, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(658, 653, \'Feb. 26 - Day 1: 10 miles\', \'Reach south edge of the hills: “a sheer, high, impassible cliff overlooking the marshland of Nindalf ‘the Wetwang’, which lies East of the Anduin all along the delta of the Entwash.\', NULL, \'FitDistanceDailySummary\', 2136, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(659, 653, \'Feb. 26 - Day 1: 10 miles\', \'Turn north away from the cliff.\', NULL, \'FitDistanceDailySummary\', 2137, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(660, 653, \'Feb. 26 - Day 1: 10 miles\', \'Wind around a ravine.\', NULL, \'FitDistanceDailySummary\', 2139, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(661, 653, \'Feb. 26 - Day 1: 10 miles\', \'Reach steep east face of inner hills. Climb down.\', NULL, \'FitDistanceDailySummary\', 2142, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(662, 653, \'Feb. 26 - Day 1: 10 miles\', \'Camp about dusk. Hide behind boulders just back from the south-facing cliff. See glow of Gollum’s eyes.\', NULL, \'FitDistanceDailySummary\', 2144, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(663, 653, \'Feb. 27 - Day 2: 20 miles\', \'Leave at dawn.\', NULL, \'FitDistanceDailySummary\', 2144, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(664, 653, \'Feb. 27 - Day 2: 20 miles\', \'Climb into a gully and out. Forced to turn more to the north.\', NULL, \'FitDistanceDailySummary\', 2148, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(665, 653, \'Feb. 27 - Day 2: 20 miles\', \'Keep as close to the cliff as can, angling southeast. Stop to eat.\', NULL, \'FitDistanceDailySummary\', 2154, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(666, 653, \'Feb. 27 - Day 2: 20 miles\', \'Cliff curves more to the east.\', NULL, \'FitDistanceDailySummary\', 2158, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(667, 653, \'Feb. 27 - Day 2: 20 miles\', \'Enter another ravine. Cliff still too high to descend.\', NULL, \'FitDistanceDailySummary\', 2160, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(668, 653, \'Feb. 27 - Day 2: 20 miles\', \'Climb into another ravine. Camp at dusk.\', NULL, \'FitDistanceDailySummary\', 2164, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(669, 653, \'Feb. 28 - Day 3: 20 miles\', \'Leave at dawn.\', NULL, \'FitDistanceDailySummary\', 2164, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(670, 653, \'Feb. 28 - Day 3: 20 miles\', \'Cliff begins to curve much more to the north. The Wetwang curves south.\', NULL, \'FitDistanceDailySummary\', 2166, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(671, 653, \'Feb. 28 - Day 3: 20 miles\', \'Another ravine.\', NULL, \'FitDistanceDailySummary\', 2169, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(672, 653, \'Feb. 28 - Day 3: 20 miles\', \'Wind around rough area, forced back, away from cliff.\', NULL, \'FitDistanceDailySummary\', 2171, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(673, 653, \'Feb. 28 - Day 3: 20 miles\', \'Continue in barren, rugged hills - not even grass. Stop to eat.\', NULL, \'FitDistanceDailySummary\', 2174, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(674, 653, \'Feb. 28 - Day 3: 20 miles\', \'Zig-zag into ravine. The south edge of the Dead Marshes appear east of the tumbled lands below.\', NULL, \'FitDistanceDailySummary\', 2177, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(675, 653, \'Feb. 28 - Day 3: 20 miles\', \'Get lost in ravine. Realize they are “going in circles.” Runoff from the ravine goes to the marshes.\', NULL, \'FitDistanceDailySummary\', 2181, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(676, 653, \'Feb. 28 - Day 3: 20 miles\', \'Climb down to the bottom of another ravine. Cliff still too steep and high. Look out toward Mordor. Can smell the Dead Marshes. Go further back. Camp in a stony hollow surrounded by “great jagged pinnacles of weathered rock.” Cold.\', NULL, \'FitDistanceDailySummary\', 2184, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(677, 653, \'Feb. 29/30 - Day/Nt. 4: 34 miles\', \'Leave at dawn. Cliff has now turned almost due north.\', NULL, \'FitDistanceDailySummary\', 2184, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(678, 653, \'Feb. 29/30 - Day/Nt. 4: 34 miles\', \'Go close to the cliff, in hopes of seeing a way down.\', NULL, \'FitDistanceDailySummary\', 2186, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(679, 653, \'Feb. 29/30 - Day/Nt. 4: 34 miles\', \'Must swing far back, then east again. Stop to listen for signs of Gollum.\', NULL, \'FitDistanceDailySummary\', 2187, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(680, 653, \'Feb. 29/30 - Day/Nt. 4: 34 miles\', \'Return to cliff-top, but rough “scored and weathered rock” forces them away.\', NULL, \'FitDistanceDailySummary\', 2188, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(681, 653, \'Feb. 29/30 - Day/Nt. 4: 34 miles\', \'Cliff face is now lower, but they do not notice as they are not by the edge. Scramble into a deep cleft and out again.\', NULL, \'FitDistanceDailySummary\', 2192, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(682, 653, \'Feb. 29/30 - Day/Nt. 4: 34 miles\', \'Stop briefly. Eat.\', NULL, \'FitDistanceDailySummary\', 2195, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(683, 653, \'Feb. 29/30 - Day/Nt. 4: 34 miles\', \'Another cleft.\', NULL, \'FitDistanceDailySummary\', 2197, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(684, 653, \'Feb. 29/30 - Day/Nt. 4: 34 miles\', \'Still scrambling along back from the ridge.\', NULL, \'FitDistanceDailySummary\', 2201, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(685, 653, \'Feb. 29/30 - Day/Nt. 4: 34 miles\', \'Reach the deepest ravine thus far - a rock fault. Far wall is “many fathoms high.” Frodo climbs down. Finds a few gnarled trees, mainly firs, but only for about 50 yards. Stumps continue to cliff edge. As cliff is lower, Frodo decides they should descend: the rock has “slipped and cracked.” Storm arrives just as Frodo starts down. He slithers down to a rock ledge below. Sam remembers his rope and pulls Frodo up. After the storm they use the rope to descend. Dusk falls.\', NULL, \'FitDistanceDailySummary\', 2204, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(686, 653, \'Feb. 29/30 - Day/Nt. 4: 34 miles\', \'Head east from base of cliff, picking their way through wet boulders.\', NULL, \'FitDistanceDailySummary\', 2205, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(687, 653, \'Feb. 29/30 - Day/Nt. 4: 34 miles\', \'Reach a great fissure with a stream inside. It curves north: bars way.\', NULL, \'FitDistanceDailySummary\', 2207, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(688, 653, \'Feb. 29/30 - Day/Nt. 4: 34 miles\', \'Head back toward cliff, angling south. Too difficult to go far. No spot to hide. Stop next to a boulder. See Gollum crawling down cliff. Capture Gollum (ca. 8 p.m.). STOP, but have no rest while they watch Gollum. Late night, Frodo extracts pledge, then releases Gollum.\', NULL, \'FitDistanceDailySummary\', 2208, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(689, 653, \'Feb. 29/30 - Day/Nt. 4: 34 miles\', \'Start again ca. 2 a.m. Gollum leads them back north.\', NULL, \'FitDistanceDailySummary\', 2209, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(690, 653, \'Feb. 29/30 - Day/Nt. 4: 34 miles\', \'Reach the rift they had seen before, but farther north where sides are lower. Climb down into it (15 feet deep). Follow it south beside a “shallow stony stream.” Gollum recites ‘Fish’ riddle.\', NULL, \'FitDistanceDailySummary\', 2212, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(691, 653, \'Feb. 29/30 - Day/Nt. 4: 34 miles\', \'Gully turns east, broadens and grows more shallow.\', NULL, \'FitDistanceDailySummary\', 2217, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(692, 653, \'Feb. 29/30 - Day/Nt. 4: 34 miles\', \'Dawn. Camp in gully (day of Feb. 30) on a wide flat shelf of stone. Gully now only 6 feet deep. Frodo and Sam plan to watch, but both sleep.\', NULL, \'FitDistanceDailySummary\', 2218, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(693, 653, \'Feb. 30/M. 1 - Day/Nt. 5: 25 miles\', \'Set out when dark.\', NULL, \'FitDistanceDailySummary\', 2218, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(694, 653, \'Feb. 30/M. 1 - Day/Nt. 5: 25 miles\', \'Gully more shallow and less sloping.\', NULL, \'FitDistanceDailySummary\', 2222, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(695, 653, \'Feb. 30/M. 1 - Day/Nt. 5: 25 miles\', \'Gully bottom less rocky.\', NULL, \'FitDistanceDailySummary\', 2226, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(696, 653, \'Feb. 30/M. 1 - Day/Nt. 5: 25 miles\', \'Creek enters from north. Eat.\', NULL, \'FitDistanceDailySummary\', 2228, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(697, 653, \'Feb. 30/M. 1 - Day/Nt. 5: 25 miles\', \'Floor still more muddy. Sides dwindle to mere banks.\', NULL, \'FitDistanceDailySummary\', 2230, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(698, 653, \'Feb. 30/M. 1 - Day/Nt. 5: 25 miles\', \'Stream begins to wind. Sky grows cloudy.\', NULL, \'FitDistanceDailySummary\', 2232, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(699, 653, \'Feb. 30/M. 1 - Day/Nt. 5: 25 miles\', \'Banks reduced to mossy mounds.\', NULL, \'FitDistanceDailySummary\', 2234, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(700, 653, \'Feb. 30/M. 1 - Day/Nt. 5: 25 miles\', \'Stream gurgles over a stone shelf into the bog. Dry reeds all around. Mists rise above the Dead Marshes just ahead and on both sides. See Mountains of Mordor far ahead: wreathed in fog, lit by dawn. Rest briefly.\', NULL, \'FitDistanceDailySummary\', 2236, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(701, 653, \'Feb. 30/M. 1 - Day/Nt. 5: 25 miles\', \'Gollum’s path winds through the mists, turning to find the way between “pools, and soft mires.” No birds.\', NULL, \'FitDistanceDailySummary\', 2238, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(702, 653, \'Feb. 30/M. 1 - Day/Nt. 5: 25 miles\', \'As mists rise (ca. 10 a.m.), they stop for day in a reed-thicket (M. 1).\', NULL, \'FitDistanceDailySummary\', 2243, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(703, 653, \'March ½ - Day/Nt. 6: 15 miles\', \'Late afternoon. Continue on.\', NULL, \'FitDistanceDailySummary\', 2243, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(704, 653, \'March ½ - Day/Nt. 6: 15 miles\', \'Enter the heart of the Dead Marshes.\', NULL, \'FitDistanceDailySummary\', 2246, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(705, 653, \'March ½ - Day/Nt. 6: 15 miles\', \'Round the west end of a wide stagnant mere. Air is “black and heavy to breathe.”\', NULL, \'FitDistanceDailySummary\', 2249, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(706, 653, \'March ½ - Day/Nt. 6: 15 miles\', \'Wisps of lights begin to appear: “candles of corpses.” Another wide mere extends west from there.\', NULL, \'FitDistanceDailySummary\', 2251, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(707, 653, \'March ½ - Day/Nt. 6: 15 miles\', \'Sam falls, sees dead faces in the water (from Battle of the Last Alliance).\', NULL, \'FitDistanceDailySummary\', 2252, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(708, 653, \'March ½ - Day/Nt. 6: 15 miles\', \'They almost crawl as they founder through the treacherous mire.\', NULL, \'FitDistanceDailySummary\', 2253, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(709, 653, \'March ½ - Day/Nt. 6: 15 miles\', \'Reach firmer ground (ca. 4 a.m.). Gollum trots down “a long lane between high reeds,” then stops and sniffs.\', NULL, \'FitDistanceDailySummary\', 2254, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(710, 653, \'March ½ - Day/Nt. 6: 15 miles\', \'Gollum’s uneasiness grows. Hear cry of Nazgûl. Rush of wind: lights go out. Moon peaks through clouds. See Nazgûl. Gollum cowers and refuses to go on until moon is low.\', NULL, \'FitDistanceDailySummary\', 2255, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(711, 653, \'March ½ - Day/Nt. 6: 15 miles\', \'Dawn. End of the marshes. Clear and cold. Mountains tower ahead across wastelands. Hide “under a black stone” during gray day (M. 2).\', NULL, \'FitDistanceDailySummary\', 2258, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(712, 653, \'March 2/3 - Day/Nt. 7: 15 miles\', \'Leave when full dark.\', NULL, \'FitDistanceDailySummary\', 2258, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(713, 653, \'March 2/3 - Day/Nt. 7: 15 miles\', \'Cross area of dry peat, broken by flats of cracked, dry mud. Land slopes slowly east. Ring grows heavier. Sam’s mood darkens.\', NULL, \'FitDistanceDailySummary\', 2259, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(714, 653, \'March 2/3 - Day/Nt. 7: 15 miles\', \'Climb a long shallow slope.\', NULL, \'FitDistanceDailySummary\', 2263, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(715, 653, \'March 2/3 - Day/Nt. 7: 15 miles\', \'Gully curves away north, then west back to the marshes.\', NULL, \'FitDistanceDailySummary\', 2268, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(716, 653, \'March 2/3 - Day/Nt. 7: 15 miles\', \'Hide again during day (March 3).\', NULL, \'FitDistanceDailySummary\', 2273, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(717, 653, \'March 3/4 - Day/Nt. 8: 14 miles\', \'Creep forward as dark falls. Bitter, parched air. Unknown to them, Battle of Helm’s Deep rages far to the west.\', NULL, \'FitDistanceDailySummary\', 2273, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(718, 653, \'March 3/4 - Day/Nt. 8: 14 miles\', \'Land rises in a long slope: arid moors of the Noman-lands.\', NULL, \'FitDistanceDailySummary\', 2275, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(719, 653, \'March 3/4 - Day/Nt. 8: 14 miles\', \'Descend a steeper hill face.\', NULL, \'FitDistanceDailySummary\', 2277, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(720, 653, \'March 3/4 - Day/Nt. 8: 14 miles\', \'Land rises in another long slow climbing slope.\', NULL, \'FitDistanceDailySummary\', 2281, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(721, 653, \'March 3/4 - Day/Nt. 8: 14 miles\', \'Still on the moors.\', NULL, \'FitDistanceDailySummary\', 2284, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(722, 653, \'March 3/4 - Day/Nt. 8: 14 miles\', \'Descend a last hill face. Reach the Desolation of the Morannon: gasping pools, mounds of slag. Stop at first slag-heap, but fumes drive them away. Crawl into a “wide, almost circular pit, high-banked on the west.” An oily ooze fills bottom. Stay there (M. 4).\', NULL, \'FitDistanceDailySummary\', 2288, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(723, 653, \'March 4/5 - Day/Nt. 9: 12 miles\', \'On waking, Sam hears Smeagol/Gollum’s debate. Sam wonders who ‘she’ is (=Shelob). At dusk, creep slowly forward.\', NULL, \'FitDistanceDailySummary\', 2288, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(724, 653, \'March 4/5 - Day/Nt. 9: 12 miles\', \'Nazgûl passes over. Pause for a while.\', NULL, \'FitDistanceDailySummary\', 2290, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(725, 653, \'March 4/5 - Day/Nt. 9: 12 miles\', \'Midnight. Nazgûl flies over again, but high up (on way to Isengard). Terrified, Gollum refuses to go on until ordered by Frodo.\', NULL, \'FitDistanceDailySummary\', 2294, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(726, 653, \'March 4/5 - Day/Nt. 9: 12 miles\', \'Dawn. Can see guards on the wall above the Black Gate. Hide in a hollow “delved in the side of a low hill.” See Army of Easterlings arrive, then later, an army of Southrons. Sam recites “Oliphaunt” poem. Gollum tells of ‘secret’ way. Frodo decides to follow Gollum south. Rest during day (M. 5).\', NULL, \'FitDistanceDailySummary\', 2300, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(727, 653, \'March 5/6 - Day/Nt. 10: 24 miles\', \'Dusk. Creep out west side of hollow.\', NULL, \'FitDistanceDailySummary\', 2300, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(728, 653, \'March 5/6 - Day/Nt. 10: 24 miles\', \'Walk SW, west of the road. Road runs in a trenchlike valley between the mountains and the moors. It is newly repaired for many miles.\', NULL, \'FitDistanceDailySummary\', 2302, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(729, 653, \'March 5/6 - Day/Nt. 10: 24 miles\', \'End of the slag heaps. Brief rest. Midnight: Moon rises, almost full.\', NULL, \'FitDistanceDailySummary\', 2309, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(730, 653, \'March 5/6 - Day/Nt. 10: 24 miles\', \'Can still see the red light in one of the Towers of the Teeth.\', NULL, \'FitDistanceDailySummary\', 2316, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(731, 653, \'March 5/6 - Day/Nt. 10: 24 miles\', \'Finally turn south enough to hide the light from the Tower.\', NULL, \'FitDistanceDailySummary\', 2322, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(732, 653, \'March 5/6 - Day/Nt. 10: 24 miles\', \'Dawn. Reach northern edge of Ithilien. East across road are dark trees. Closer ‘a tumbled heathland’ with ‘knots of pine-trees.’ Air is fresh and fragrant. Hide in heather during day (M. 6).\', NULL, \'FitDistanceDailySummary\', 2324, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(733, 653, \'March 6/7 - Day/Nt. 11: 24 miles\', \'Leave during twilight.\', NULL, \'FitDistanceDailySummary\', 2324, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(734, 653, \'March 6/7 - Day/Nt. 11: 24 miles\', \'Gollum leads them onto the road: straight and level. Go more quickly.\', NULL, \'FitDistanceDailySummary\', 2325, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(735, 653, \'March 6/7 - Day/Nt. 11: 24 miles\', \'In valley between mountains on east and steep slopes on west.\', NULL, \'FitDistanceDailySummary\', 2327, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(736, 653, \'March 6/7 - Day/Nt. 11: 24 miles\', \'Woods appear to the west. Some growth begins along the road edges.\', NULL, \'FitDistanceDailySummary\', 2330, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(737, 653, \'March 6/7 - Day/Nt. 11: 24 miles\', \'Road crosses stream on an arched masonry bridge.\', NULL, \'FitDistanceDailySummary\', 2333, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(738, 653, \'March 6/7 - Day/Nt. 11: 24 miles\', \'Road becomes more overgrown.\', NULL, \'FitDistanceDailySummary\', 2338, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(739, 653, \'March 6/7 - Day/Nt. 11: 24 miles\', \'Another stream is bridged.\', NULL, \'FitDistanceDailySummary\', 2342, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(740, 653, \'March 6/7 - Day/Nt. 11: 24 miles\', \'Reach north end of a long straight cutting through a stony ridge.\', NULL, \'FitDistanceDailySummary\', 2344, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(741, 653, \'March 6/7 - Day/Nt. 11: 24 miles\', \'Climb the west bank and go downhill. Follow a stream to a small clear pool. Bathe. Sam finds orc fire-ring.\', NULL, \'FitDistanceDailySummary\', 2347, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(742, 653, \'March 6/7 - Day/Nt. 11: 24 miles\', \'Camp back toward road. Gollum brings coneys. Sam cooks stew. Eat (8:30 a.m.). Found by Southern Rangers with Faramir. Gollum hides.\', NULL, \'FitDistanceDailySummary\', 2348, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(743, 653, \'Continue March 7 - Day 12: 10 miles\', \'Noon. Rangers battle the Haradrim. Sam sees an oliphaunt. Sleep to late afternoon. Faramir questions Frodo, then leads them west.\', NULL, \'FitDistanceDailySummary\', 2348, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(744, 653, \'Continue March 7 - Day 12: 10 miles\', \'Cross stream below the pool.\', NULL, \'FitDistanceDailySummary\', 2349, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(745, 653, \'Continue March 7 - Day 12: 10 miles\', \'Descend steep slope. Faramir and Frodo talk as they go.\', NULL, \'FitDistanceDailySummary\', 2352, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(746, 653, \'Continue March 7 - Day 12: 10 miles\', \'Thread their way through woodland.\', NULL, \'FitDistanceDailySummary\', 2354, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(747, 653, \'Continue March 7 - Day 12: 10 miles\', \'Trees grow thinner. Turn right and “come to a small river in a narrow gorge” - the same as that from the pool.\', NULL, \'FitDistanceDailySummary\', 2357, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(748, 653, \'Continue March 7 - Day 12: 10 miles\', \'Frodo and Sam are blindfolded and led down a steep path, then up to Henneth Annûn. Sunset gleams through the waterfall.\', NULL, \'FitDistanceDailySummary\', 2358, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(749, 653, \'March 8 - Day 13: 22 miles\', \'Moonset. Gollum fishes in waterfall pool. With Frodo’s help, Faramir captures and questions Gollum. Rest a short time more while supplies are prepared. Leave ca. 8 a.m. Rangers lead them south, blindfolded. \', NULL, \'FitDistanceDailySummary\', 2358, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(750, 653, \'March 8 - Day 13: 22 miles\', \'Faramir removes blindfolds. Advises them to follow upper edge of steep-falling lands to west.\', NULL, \'FitDistanceDailySummary\', 2359, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(751, 653, \'March 8 - Day 13: 22 miles\', \'Cross a fast stream. Brief rest. Eat.\', NULL, \'FitDistanceDailySummary\', 2365, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(752, 653, \'March 8 - Day 13: 22 miles\', \'Brief rest.\', NULL, \'FitDistanceDailySummary\', 2372, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(753, 653, \'March 8 - Day 13: 22 miles\', \'Cross a tumbling stream.\', NULL, \'FitDistanceDailySummary\', 2376, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(754, 653, \'March 8 - Day 13: 22 miles\', \'Nightfall. Sleep beneath an ancient tree. Sam restless.\', NULL, \'FitDistanceDailySummary\', 2380, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(755, 653, \'March 9 - Day 14: 22 miles\', \'Leave at first light.\', NULL, \'FitDistanceDailySummary\', 2380, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(756, 653, \'March 9 - Day 14: 22 miles\', \'Thicker trees. Brief rest. Air growing heavy. Gollum urges more speed.\', NULL, \'FitDistanceDailySummary\', 2388, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(757, 653, \'March 9 - Day 14: 22 miles\', \'Cross a small stream.\', NULL, \'FitDistanceDailySummary\', 2394, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(758, 653, \'March 9 - Day 14: 22 miles\', \'Reach area of large trees - more open: ash and oak. Gollum fearful.\', NULL, \'FitDistanceDailySummary\', 2396, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(759, 653, \'March 9 - Day 14: 22 miles\', \'Dusk. End of the forest. Can see White Mountains to the west and dark peaks of the Ephel Dúath to the east. A vale falls away before them - the Morgul. Gollum wants to continue, but they stop until midnight. Perched in an oak, the hobbits cannot sleep.\', NULL, \'FitDistanceDailySummary\', 2402, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(760, 653, \'March 10/11 - Nt./Day 15-16: 10 miles\', \'Just past midnight, head east. Land slopes up steeply. Thickets and brambles.\', NULL, \'FitDistanceDailySummary\', 2402, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(761, 653, \'March 10/11 - Nt./Day 15-16: 10 miles\', \'Cross a deep cleft.\', NULL, \'FitDistanceDailySummary\', 2404, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(762, 653, \'March 10/11 - Nt./Day 15-16: 10 miles\', \'Go around a dark pit.\', NULL, \'FitDistanceDailySummary\', 2406, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(763, 653, \'March 10/11 - Nt./Day 15-16: 10 miles\', \'Go down a bit, but then up on a longer, steeper slope.\', NULL, \'FitDistanceDailySummary\', 2408, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(764, 653, \'March 10/11 - Nt./Day 15-16: 10 miles\', \'Halt briefly. Can see tops of trees behind. Darkness begins to spread.\', NULL, \'FitDistanceDailySummary\', 2410, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(765, 653, \'March 10/11 - Nt./Day 15-16: 10 miles\', \'Climb a great ‘hogback’ - climb the steep backslope, covered with spiny thickets. Descend the even steeper cliff face. Part way down, crawl into a ‘hollow hall’ formed by a “tangled knot of thorns.” Sleep.\', NULL, \'FitDistanceDailySummary\', 2412, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(766, 653, \'Continue March 10/11 - Nt./Day 15-16: 12 miles THE DAWNLESS DAY\', \'No dawn. Day grows even darker as time passes. Gollum wakes them (ca. 4 p.m.): “No time to lose.” Leads them down the hillside.\', NULL, \'FitDistanceDailySummary\', 2412, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(767, 653, \'Continue March 10/11 - Nt./Day 15-16: 12 miles THE DAWNLESS DAY\', \'Turn south across a long broken slope.\', NULL, \'FitDistanceDailySummary\', 2414, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(768, 653, \'Continue March 10/11 - Nt./Day 15-16: 12 miles THE DAWNLESS DAY\', \'Turn east and reach the Southward Road. Follow the road into a great ring of trees to the Cross-roads. The setting sun lights the fallen head of the statue of a King of Gondor.\', NULL, \'FitDistanceDailySummary\', 2415, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(769, 653, \'Continue March 10/11 - Nt./Day 15-16: 12 miles THE DAWNLESS DAY\', \'Pass east out of the trees, following the Morgul-road. Road climbs steeply, but is straight.\', NULL, \'FitDistanceDailySummary\', 2416, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(770, 653, \'Continue March 10/11 - Nt./Day 15-16: 12 miles THE DAWNLESS DAY\', \'At the top of a ‘flatiron’ the road cuts through the steep-faced drop and curves sharply south around a “great shoulder of rock.”\', NULL, \'FitDistanceDailySummary\', 2417, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(771, 653, \'Continue March 10/11 - Nt./Day 15-16: 12 miles THE DAWNLESS DAY\', \'Road curves east again, next to the ravine of the Morgulduin. Way slants up steeply. Frodo glances across the vale and sees Minas Morgul.\', NULL, \'FitDistanceDailySummary\', 2418, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(772, 653, \'Continue March 10/11 - Nt./Day 15-16: 12 miles THE DAWNLESS DAY\', \'Come to the white bridge. The road crosses it and winds up to the city gates. All is rotten, cold. Frodo totters forward as if to cross the bridge, but Sam stops him. Gollum leads them back across the road to a gap in the stone wall - a path along the slopes north of the river.\', NULL, \'FitDistanceDailySummary\', 2418.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(773, 653, \'Continue March 10/11 - Nt./Day 15-16: 12 miles THE DAWNLESS DAY\', \'On a high shelf overlooking the city Frodo stops. The Morgul-host marches forth.\', NULL, \'FitDistanceDailySummary\', 2419.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(774, 653, \'Continue March 10/11 - Nt./Day 15-16: 12 miles THE DAWNLESS DAY\', \'Continue up path a short way. Reach bottom of the Straight Stair. Stair is cut into the cliff with walls on each side, steps narrow, uneven, and steep as a ladder.\', NULL, \'FitDistanceDailySummary\', 2420, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(775, 653, \'Continue March 10/11 - Nt./Day 15-16: 12 miles THE DAWNLESS DAY\', \'Above the stair, the cutting continues with a winding path - still climbing, but needs no steps: “seemed to go on for miles.”\', NULL, \'FitDistanceDailySummary\', 2420.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(776, 653, \'Continue March 10/11 - Nt./Day 15-16: 12 miles THE DAWNLESS DAY\', \'Reach a wide shelf - cliff on left, chasm on right. No longer climbing. Ground is broken.\', NULL, \'FitDistanceDailySummary\', 2422, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(777, 653, \'Continue March 10/11 - Nt./Day 15-16: 12 miles THE DAWNLESS DAY\', \'Reach bottom of the Winding Stair. Stair zig-zigs up the sloping cliff. Even looks down on wraith-road at one point.\', NULL, \'FitDistanceDailySummary\', 2423.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(778, 653, \'Continue March 10/11 - Nt./Day 15-16: 12 miles THE DAWNLESS DAY\', \'Reach the top of the stairs. See red light through window in top of the Tower “a long way off.” Sleep there between two great piers of rock. All around are “jagged pinnacles...crevices and fissures.”\', NULL, \'FitDistanceDailySummary\', 2424, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(779, 653, \'March 12/13 - Day/Nt./Day 17-18: 14 miles Here, too, the time is extremely long (ca. 30 hours): “One hour, two hours...how many had they passed in this lightless hole? Hours - days, weeks, rather.”\', \'“Day.” Sam wakes and sees Gollum ‘pawing at’ Frodo. ‘Sneak’ conversation. Gollum leads them “up a long ravine between piers and columns of torn and weathered rocks.”\', NULL, \'FitDistanceDailySummary\', 2424, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(780, 653, \'March 12/13 - Day/Nt./Day 17-18: 14 miles Here, too, the time is extremely long (ca. 30 hours): “One hour, two hours...how many had they passed in this lightless hole? Hours - days, weeks, rather.”\', \'Opening to Shelob’s Lair. Tunnel is so high and wide that Frodo and Sam can’t touch hands as they feel their way along each wall. Tunnel climbs slowly.\', NULL, \'FitDistanceDailySummary\', 2425, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(781, 653, \'March 12/13 - Day/Nt./Day 17-18: 14 miles Here, too, the time is extremely long (ca. 30 hours): “One hour, two hours...how many had they passed in this lightless hole? Hours - days, weeks, rather.”\', \'Sam feels an opening on the right.\', NULL, \'FitDistanceDailySummary\', 2427, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(782, 653, \'March 12/13 - Day/Nt./Day 17-18: 14 miles Here, too, the time is extremely long (ca. 30 hours): “One hour, two hours...how many had they passed in this lightless hole? Hours - days, weeks, rather.”\', \'Sam feels an opening on the right.\', NULL, \'FitDistanceDailySummary\', 751, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(783, 653, \'March 12/13 - Day/Nt./Day 17-18: 14 miles Here, too, the time is extremely long (ca. 30 hours): “One hour, two hours...how many had they passed in this lightless hole? Hours - days, weeks, rather.”\', \'Frodo feels an opening on the left.\', NULL, \'FitDistanceDailySummary\', 2428, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(784, 653, \'March 12/13 - Day/Nt./Day 17-18: 14 miles Here, too, the time is extremely long (ca. 30 hours): “One hour, two hours...how many had they passed in this lightless hole? Hours - days, weeks, rather.”\', \'Frodo and Sam’s senses become numb, but feel things hanging down.\', NULL, \'FitDistanceDailySummary\', 2429, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(785, 653, \'March 12/13 - Day/Nt./Day 17-18: 14 miles Here, too, the time is extremely long (ca. 30 hours): “One hour, two hours...how many had they passed in this lightless hole? Hours - days, weeks, rather.”\', \'Sam leaves right wall and holds on to Frodo.\', NULL, \'FitDistanceDailySummary\', 2430, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(786, 653, \'March 12/13 - Day/Nt./Day 17-18: 14 miles Here, too, the time is extremely long (ca. 30 hours): “One hour, two hours...how many had they passed in this lightless hole? Hours - days, weeks, rather.”\', \'Frodo finds opening to main pit on left.\', NULL, \'FitDistanceDailySummary\', 2436.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(787, 653, \'March 12/13 - Day/Nt./Day 17-18: 14 miles Here, too, the time is extremely long (ca. 30 hours): “One hour, two hours...how many had they passed in this lightless hole? Hours - days, weeks, rather.”\', \'Tunnel forks. Left tunnel closed with a door. Realize Gollum is gone. Shelob appears. Use the Phial of Galadriel to drive off Shelob. Tunnel rises steeply to exit. Use Sting to cut webs.\', NULL, \'FitDistanceDailySummary\', 2436.75, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(788, 653, \'March 12/13 - Day/Nt./Day 17-18: 14 miles Here, too, the time is extremely long (ca. 30 hours): “One hour, two hours...how many had they passed in this lightless hole? Hours - days, weeks, rather.”\', \'Frodo runs ahead and is stung by Shelob. Sam fights off Gollum and reaches Frodo and drives off Shelob, but is too late. Thinking Frodo dead, Sam reluctantly takes the Ring and continues on.\', NULL, \'FitDistanceDailySummary\', 2437, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(789, 653, \'March 12/13 - Day/Nt./Day 17-18: 14 miles Here, too, the time is extremely long (ca. 30 hours): “One hour, two hours...how many had they passed in this lightless hole? Hours - days, weeks, rather.”\', \'Sam reaches base of a flight of shallow steps to the cleft.\', NULL, \'FitDistanceDailySummary\', 2437.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(790, 653, \'March 12/13 - Day/Nt./Day 17-18: 14 miles Here, too, the time is extremely long (ca. 30 hours): “One hour, two hours...how many had they passed in this lightless hole? Hours - days, weeks, rather.”\', \'From the cleft of the Pass, Sam looks back. Hearing orcs, he puts on the Ring. When orcs reach Frodo, Sam rushes back.\', NULL, \'FitDistanceDailySummary\', 2438, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(791, 653, \'March 15 - Day 20: 15 miles\', \'Frodo and Sam reach gate of the Tower ca. 5 a.m. Watchers send up signal of their escape. Run. Road curves out of sight from the gate.\', NULL, \'FitDistanceDailySummary\', 2438, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(792, 653, \'March 15 - Day 20: 15 miles\', \'Road curves down sharply to meet the Morgul-road. At the bridge just beyond the road meeting, they jump. Land just a few feet below in a thorn thicket. Dawn - but dark in the valley.\', NULL, \'FitDistanceDailySummary\', 2439, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(793, 653, \'March 15 - Day 20: 15 miles\', \'Climb down to bottom of north-running valley.\', NULL, \'FitDistanceDailySummary\', 2440, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(794, 653, \'March 15 - Day 20: 15 miles\', \'Halt briefly. Sam falls asleep. Turn north in the ravine. Frodo discards chain mail. Sam wishes for light and water.\', NULL, \'FitDistanceDailySummary\', 2441, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(795, 653, \'March 15 - Day 20: 15 miles\', \'Frodo senses Black Rider. Halt again. Sky brightens. See flight of fallen Witch King - ill news for Barad-dûr. Eat a bit. \', NULL, \'FitDistanceDailySummary\', 2442, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(796, 653, \'March 15 - Day 20: 15 miles\', \'Cross over to path west of a dry stream bed. Valley rises slowly to north.\', NULL, \'FitDistanceDailySummary\', 2443, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(797, 653, \'March 15 - Day 20: 15 miles\', \'Hear water trickling from gully on left. \', NULL, \'FitDistanceDailySummary\', 2446, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(798, 653, \'March 15 - Day 20: 15 miles\', \'Road broadens and a rough wall begins: nearing an orc hold. Cross river-bed (a few pools in the bottom). Low scrubby trees. Midges.\', NULL, \'FitDistanceDailySummary\', 2452, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(799, 653, \'March 15 - Day 20: 15 miles\', \'Climb up into a ravine. Hide in brambles. Frodo sleeps. Sam sees star and also sleeps.\', NULL, \'FitDistanceDailySummary\', 2453, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(800, 653, \'March 16 - Day 21: 27 miles\', \'Continue up ravine until it disappears, then climb last 100 feet to the ridge.\', NULL, \'FitDistanceDailySummary\', 2453, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(801, 653, \'March 16 - Day 21: 27 miles\', \'Ridge stands 1500 feet above the plain. Plain is crawling with enemies. See Mount Doom 40 miles away.\', NULL, \'FitDistanceDailySummary\', 2455, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(802, 653, \'March 16 - Day 21: 27 miles\', \'Try to go north along ridge, but cannot. Retrace path back to valley floor. Stay east of water-course.\', NULL, \'FitDistanceDailySummary\', 2457, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(803, 653, \'March 16 - Day 21: 27 miles\', \'See orc hold by path on west.\', NULL, \'FitDistanceDailySummary\', 2458, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(804, 653, \'March 16 - Day 21: 27 miles\', \'Hear orc scouts. Hide behind bush. Learn news of Gollum. Light fades as they hide.\', NULL, \'FitDistanceDailySummary\', 2460, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(805, 653, \'March 16 - Day 21: 27 miles\', \'Continue in the dark along eastern edge of the valley.\', NULL, \'FitDistanceDailySummary\', 2464, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(806, 653, \'March 16 - Day 21: 27 miles\', \'Stagnant pool of water. Do not see it in the dark.\', NULL, \'FitDistanceDailySummary\', 2476, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(807, 653, \'March 16 - Day 21: 27 miles\', \'Grey light - Hide and sleep (March 17 day).\', NULL, \'FitDistanceDailySummary\', 2480, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(808, 653, \'March 17/18 - Day/Nt. 22: 25 miles\', \'Eat. Finish Faramir’s food. When quite dark, begin again.\', NULL, \'FitDistanceDailySummary\', 2480, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(809, 653, \'March 17/18 - Day/Nt. 22: 25 miles\', \'Brief halt.\', NULL, \'FitDistanceDailySummary\', 2498, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(810, 653, \'March 17/18 - Day/Nt. 22: 25 miles\', \'Brief halt.\', NULL, \'FitDistanceDailySummary\', 816, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(811, 653, \'March 17/18 - Day/Nt. 22: 25 miles\', \'Brief halt.\', NULL, \'FitDistanceDailySummary\', 822, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(812, 653, \'March 17/18 - Day/Nt. 22: 25 miles\', \'At first light, hide in a hollow under an overhanging stone. Strong wind from west. Ahead the valley has climbed nearly to top of the inner ridge. Water course ends in broken steps of rock. Can see road from old castle of Durthang. Frodo sleeps. Sam finds water. Returns and sees Gollum. Wakes Frodo to watch. Sam sleeps (Day, M. 18).\', NULL, \'FitDistanceDailySummary\', 2505, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(813, 653, \'March 18/19 - Day/Nt. 23: 20 miles\', \'Light fading when wake. See watch fires on heights. Return to spring. Fill water bottle.\', NULL, \'FitDistanceDailySummary\', 2505, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(814, 653, \'March 18/19 - Day/Nt. 23: 20 miles\', \'Climb warily up to the road when it swings east.\', NULL, \'FitDistanceDailySummary\', 2505.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(815, 653, \'March 18/19 - Day/Nt. 23: 20 miles\', \'A side path runs south into Gorgoroth toward main road. Sheer drop from road becomes increasingly deep.\', NULL, \'FitDistanceDailySummary\', 2514, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(816, 653, \'March 18/19 - Day/Nt. 23: 20 miles\', \'Road bends a little north and hides view from west. Rest. Orc company sees them, assumes they are deserters. Frodo and Sam are forced to join march.\', NULL, \'FitDistanceDailySummary\', 2517, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(817, 653, \'March 18/19 - Day/Nt. 23: 20 miles\', \'Road runs down a long slope into the plain. Frodo starts to stumble.\', NULL, \'FitDistanceDailySummary\', 2521, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(818, 653, \'March 18/19 - Day/Nt. 23: 20 miles\', \'Out on the plain, drawing near Isenmouthe: Road-meeting.\', NULL, \'FitDistanceDailySummary\', 2523, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(819, 653, \'March 18/19 - Day/Nt. 23: 20 miles\', \'In confusion of several companies meeting, Sam pulls Frodo with him, crawling across the road and over the curb. Crawl 20 yards to a shallow pit and sleep (late night to early morning of M. 19). Cold. \', NULL, \'FitDistanceDailySummary\', 2525, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(820, 653, \'March 19 - Day 24: 10 miles\', \'Morning. Sam sees Gorgoroth is pitted with great holes. Roads are empty. Crawl from hollow to hollow slanting toward the foothills to north.\', NULL, \'FitDistanceDailySummary\', 2525, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(821, 653, \'March 19 - Day 24: 10 miles\', \'Halt. Sam decides they should go back to road.\', NULL, \'FitDistanceDailySummary\', 2529, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(822, 653, \'March 19 - Day 24: 10 miles\', \'Climb onto the causeway.\', NULL, \'FitDistanceDailySummary\', 2530, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(823, 653, \'March 19 - Day 24: 10 miles\', \'Walk east along the road as it skirts the Ash Mountains. See no one.\', NULL, \'FitDistanceDailySummary\', 2532, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(824, 653, \'March 19 - Day 24: 10 miles\', \'Camp just off the road.\', NULL, \'FitDistanceDailySummary\', 2535, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(825, 653, \'March 20 - Day 25: 15 miles\', \'Return to road. Trudge east.\', NULL, \'FitDistanceDailySummary\', 2535, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(826, 653, \'March 20 - Day 25: 15 miles\', \'Rest.\', NULL, \'FitDistanceDailySummary\', 2547, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(827, 653, \'March 20 - Day 25: 15 miles\', \'Find cistern, but it is empty. Eat and rest.\', NULL, \'FitDistanceDailySummary\', 2543, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(828, 653, \'March 20 - Day 25: 15 miles\', \'Rest.\', NULL, \'FitDistanceDailySummary\', 871, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(829, 653, \'March 20 - Day 25: 15 miles\', \'Camp just off road. Hear troops at night.\', NULL, \'FitDistanceDailySummary\', 2550, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(830, 653, \'March 21 - Day 26: 15 miles\', \'Return to road. More and more Frodo is bowed down by the Ring.\', NULL, \'FitDistanceDailySummary\', 2550, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(831, 653, \'March 21 - Day 26: 15 miles\', \'Rest.\', NULL, \'FitDistanceDailySummary\', 2562, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(832, 653, \'March 21 - Day 26: 15 miles\', \'Find cistern with muddied water in bottom. Drink and fill bottle. Eat.\', NULL, \'FitDistanceDailySummary\', 2558, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(833, 653, \'March 21 - Day 26: 15 miles\', \'Rest.\', NULL, \'FitDistanceDailySummary\', 886, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(834, 653, \'March 21 - Day 26: 15 miles\', \'Camp just off road. Hear horse-messenger gallop by during night.\', NULL, \'FitDistanceDailySummary\', 2565, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(835, 653, \'March 22 - Day 27: 15 miles\', \'Return to road. Frodo ceases to speak. Stumbles as he fights Ring.\', NULL, \'FitDistanceDailySummary\', 2565, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(836, 653, \'March 22 - Day 27: 15 miles\', \'Rest.\', NULL, \'FitDistanceDailySummary\', 2576, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(837, 653, \'March 22 - Day 27: 15 miles\', \'Stop to eat. Mount Doom is due south. Leave road and turn toward it.\', NULL, \'FitDistanceDailySummary\', 2572, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(838, 653, \'March 22 - Day 27: 15 miles\', \'Rest.\', NULL, \'FitDistanceDailySummary\', 900, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(839, 653, \'March 22 - Day 27: 15 miles\', \'The Dreadful Nightfall. Only half bottle of water left. Frodo sleeps fitfully, and Sam, very little. He sees gleam of Gollum’s eyes.\', NULL, \'FitDistanceDailySummary\', 2580, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(840, 653, \'March 23 - Day 28: 10 miles\', \'Wake in dim light of dawn. Discard everything they do not need.\', NULL, \'FitDistanceDailySummary\', 2580, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(841, 653, \'March 23 - Day 28: 10 miles\', \'Rest. No attempt at concealment. Frodo goes faster than Sam hoped.\', NULL, \'FitDistanceDailySummary\', 2584, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(842, 653, \'March 23 - Day 28: 10 miles\', \'Rest.\', NULL, \'FitDistanceDailySummary\', 2587, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(843, 653, \'March 23 - Day 28: 10 miles\', \'Extra effort squanders Frodo’s last strength. Sam cannot sleep. Argues with self. Ground trembles.\', NULL, \'FitDistanceDailySummary\', 2590, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(844, 653, \'March 24 - Day 29: 10 miles\', \'Continue on in dark light. No water. Sam’s mouth too parched to eat.\', NULL, \'FitDistanceDailySummary\', 2590, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(845, 653, \'March 24 - Day 29: 10 miles\', \'Rest.\', NULL, \'FitDistanceDailySummary\', 2597, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(846, 653, \'March 24 - Day 29: 10 miles\', \'Rest. Fumes grow worse. Some wind from the west.\', NULL, \'FitDistanceDailySummary\', 2595, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(847, 653, \'March 24 - Day 29: 10 miles\', \'Rest.\', NULL, \'FitDistanceDailySummary\', 921, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(848, 653, \'March 24 - Day 29: 10 miles\', \'Continue to foot of Mount Doom. Sam tries to warm Frodo as he sleeps.\', NULL, \'FitDistanceDailySummary\', 2600, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(849, 653, \'March 25 - Day 30: 4 miles The Day of Doom\', \'As attempt to start, Frodo falls and begins to crawl. Sam carries him.\', NULL, \'FitDistanceDailySummary\', 2600, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(850, 653, \'March 25 - Day 30: 4 miles The Day of Doom\', \'Stop more than half way up base of the mountain. Rest.\', NULL, \'FitDistanceDailySummary\', 2601, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(851, 653, \'March 25 - Day 30: 4 miles The Day of Doom\', \'Sam and Frodo both crawl up slope to Sauron’s Road. Frodo turns east and see the Eye: falls. Sam carries him again.\', NULL, \'FitDistanceDailySummary\', 2602, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(852, 653, \'March 25 - Day 30: 4 miles The Day of Doom\', \'Gollum attacks! Sam fights Gollum. Frodo goes ahead.\', NULL, \'FitDistanceDailySummary\', 2603, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(853, 653, \'March 25 - Day 30: 4 miles The Day of Doom\', \'Frodo enters the Door to the Sammath Naur.\', NULL, \'FitDistanceDailySummary\', 2603.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(854, 653, \'March 25 - Day 30: 4 miles The Day of Doom\', \'Frodo claims the Ring just as Sam finds him. Gollum attacks again, bites Ring from Frodo’s finger and falls into lava. Ring Destroyed. Barad-dûr and Morannon collapse.\', NULL, \'FitDistanceDailySummary\', 2604, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(855, 227, \'Isengard to Minas Tirith: Gandalf and Pippin’s Path\', \'\', NULL, \'FitDistanceDailySummary\', NULL, \'flow\', NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(856, 855, \'Mar. 5 - Day 1: 17 miles\', \'Isengard. Confrontation with Saruman. Gandalf breaks Saruman’s staff. Grima Wormtongue casts down the palantír of Orthanc. Pippin retrieves it, but Gandalf quickly takes it. Leave Isengard (ca. 4 p.m.).\', NULL, \'FitDistanceDailySummary\', 2604, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(857, 855, \'Mar. 5 - Day 1: 17 miles\', \'Pass through the gates of Isengard. Follow the stone-paved road south.\', NULL, \'FitDistanceDailySummary\', 2604.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(858, 855, \'Mar. 5 - Day 1: 17 miles\', \'Flooded spots gradually are disappearing.\', NULL, \'FitDistanceDailySummary\', 2606, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(859, 855, \'Mar. 5 - Day 1: 17 miles\', \'Pass the pillar of the White Hand. Ents have broken the hand apart.\', NULL, \'FitDistanceDailySummary\', 2608, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(860, 855, \'Mar. 5 - Day 1: 17 miles\', \'Stone pavement ends. Highway continues.\', NULL, \'FitDistanceDailySummary\', 2610, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(861, 855, \'Mar. 5 - Day 1: 17 miles\', \'Night falls. Waxing moon rises.\', NULL, \'FitDistanceDailySummary\', 2612, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(862, 855, \'Mar. 5 - Day 1: 17 miles\', \'All around are tree stumps, weeds and thorns.\', NULL, \'FitDistanceDailySummary\', 2614, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(863, 855, \'Mar. 5 - Day 1: 17 miles\', \'Leave the Wizard’s Vale. Highway goes SSE toward the Fords.\', NULL, \'FitDistanceDailySummary\', 2618, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(864, 855, \'Mar. 5 - Day 1: 17 miles\', \'Reach the campsite of the night before. Turn west.\', NULL, \'FitDistanceDailySummary\', 2620, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(865, 855, \'Mar. 5 - Day 1: 17 miles\', \'Camp (ca. 10 p.m.). In a dale next to the south-facing slope of Dol Baran, the last hill of the northern ranges. Heather and bracken fern are turning green. While Gandalf sleeps, Pippin takes the palantír and is seen by Sauron. Gandalf plans to ride out at once with Pippin. When a Nazgûl rides over, he warns Théoden to not wait for the dawn to leave.\', NULL, \'FitDistanceDailySummary\', 2621, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(866, 855, \'Mar. 5/6 - Nt./Day 2: 140 miles (6 hours)\', \'Gandalf and Pippin return to the highway and turn south (ca. 11 p.m.).\', NULL, \'FitDistanceDailySummary\', 2622, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(867, 855, \'Mar. 5/6 - Nt./Day 2: 140 miles (6 hours)\', \'Shadowfax reaches the west bank by the Fords of Isen.\', NULL, \'FitDistanceDailySummary\', 2636, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(868, 855, \'Mar. 5/6 - Nt./Day 2: 140 miles (6 hours)\', \'Midnight. Shadowfax crosses the Fords of Isen.\', NULL, \'FitDistanceDailySummary\', 2637, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(869, 855, \'Mar. 5/6 - Nt./Day 2: 140 miles (6 hours)\', \'Gandalf points out the peaks of the Thrihyrne to the south. He tells Pippin the history of the palantíri - the Seeing Stones of Gondor.\', NULL, \'FitDistanceDailySummary\', 2646, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(870, 855, \'Mar. 5/6 - Nt./Day 2: 140 miles (6 hours)\', \'Reach the road to the Deeping Coomb and Helm’s Deep. Gandalf tells Pippin to ask Gimli about the Glittering Caves of Aglarond. Gandalf urges Shadowfax to even greater speed.\', NULL, \'FitDistanceDailySummary\', 2652, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(871, 855, \'Mar. 5/6 - Nt./Day 2: 140 miles (6 hours)\', \'Cross a small stream. Brief stop. Eat.\', NULL, \'FitDistanceDailySummary\', 2674, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(872, 855, \'Mar. 5/6 - Nt./Day 2: 140 miles (6 hours)\', \'Cross a small stream.\', NULL, \'FitDistanceDailySummary\', 2737, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(873, 855, \'Mar. 5/6 - Nt./Day 2: 140 miles (6 hours)\', \'Cross a small stream.\', NULL, \'FitDistanceDailySummary\', 551, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(874, 855, \'Mar. 5/6 - Nt./Day 2: 140 miles (6 hours)\', \'Cross a small stream.\', NULL, \'FitDistanceDailySummary\', 558, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(875, 855, \'Mar. 5/6 - Nt./Day 2: 140 miles (6 hours)\', \'Cross a small stream.\', NULL, \'FitDistanceDailySummary\', 567, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(876, 855, \'Mar. 5/6 - Nt./Day 2: 140 miles (6 hours)\', \'Cross a small stream.\', NULL, \'FitDistanceDailySummary\', 578, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(877, 855, \'Mar. 5/6 - Nt./Day 2: 140 miles (6 hours)\', \'Cross a small stream.\', NULL, \'FitDistanceDailySummary\', 591, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(878, 855, \'Mar. 5/6 - Nt./Day 2: 140 miles (6 hours)\', \'Dawn. Ford the Snowbourne. Turn left on the road to Edoras.\', NULL, \'FitDistanceDailySummary\', 2760, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(879, 855, \'Mar. 5/6 - Nt./Day 2: 140 miles (6 hours)\', \'Climb to Meduseld. Nazgûl flies over. Pippin sleeps during the day (Mar. 6). Gandalf begins organizing the Muster of Rohan.\', NULL, \'FitDistanceDailySummary\', 2761, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(880, 855, \'Mar. 6/7 - Nt./Day 3: 120 miles (12 hours)\', \'Dusk. Return to the road. Ride east at great speed.\', NULL, \'FitDistanceDailySummary\', 2762, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(881, 855, \'Mar. 6/7 - Nt./Day 3: 120 miles (12 hours)\', \'The road curves easterly around the mountain spur behind Edoras.\', NULL, \'FitDistanceDailySummary\', 2764, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(882, 855, \'Mar. 6/7 - Nt./Day 3: 120 miles (12 hours)\', \'The Snowbourne meanders through willow trees left of the road.\', NULL, \'FitDistanceDailySummary\', 2766, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(883, 855, \'Mar. 6/7 - Nt./Day 3: 120 miles (12 hours)\', \'The road curves southeast, hugging the eastern foothills of Irensaga.\', NULL, \'FitDistanceDailySummary\', 2776, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(884, 855, \'Mar. 6/7 - Nt./Day 3: 120 miles (12 hours)\', \'Hills draw away to the south. Road continues through willows.\', NULL, \'FitDistanceDailySummary\', 2784, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(885, 855, \'Mar. 6/7 - Nt./Day 3: 120 miles (12 hours)\', \'Scattered trees broaden into a wide willow thicket where the Snowbourne meets the Entwash.\', NULL, \'FitDistanceDailySummary\', 2794, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(886, 855, \'Mar. 6/7 - Nt./Day 3: 120 miles (12 hours)\', \'Willow woods end. Road turns more south, parallels the Entwash.\', NULL, \'FitDistanceDailySummary\', 2802, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(887, 855, \'Mar. 6/7 - Nt./Day 3: 120 miles (12 hours)\', \'Reach the area called the ‘Folde’, tucked against the hills, sheltered from the west and the south. A snowcapped peak rises on the south. North across the river the wide grassy Plains of Rohan are moonlit.\', NULL, \'FitDistanceDailySummary\', 2814, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(888, 855, \'Mar. 6/7 - Nt./Day 3: 120 miles (12 hours)\', \'Road turns more to the east. Brief stop. Eat.\', NULL, \'FitDistanceDailySummary\', 2824, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(889, 855, \'Mar. 6/7 - Nt./Day 3: 120 miles (12 hours)\', \'Cross a small stream.\', NULL, \'FitDistanceDailySummary\', 2878, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(890, 855, \'Mar. 6/7 - Nt./Day 3: 120 miles (12 hours)\', \'Cross a small stream.\', NULL, \'FitDistanceDailySummary\', 695, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(891, 855, \'Mar. 6/7 - Nt./Day 3: 120 miles (12 hours)\', \'North of the road, the Entwash, flowing more slowly in the level plains is choked with vegetation and splits into multiple braided channels.\', NULL, \'FitDistanceDailySummary\', 2854, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(892, 855, \'Mar. 6/7 - Nt./Day 3: 120 miles (12 hours)\', \'Cross a small stream. Enter the area called the ‘Fenmarch’ - a wetter area, especially north of the road where the Entwash becomes sluggish and starts to expand outward into a delta.\', NULL, \'FitDistanceDailySummary\', 2861, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(893, 855, \'Mar. 6/7 - Nt./Day 3: 120 miles (12 hours)\', \'Cross a small stream.\', NULL, \'FitDistanceDailySummary\', 732, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(894, 855, \'Mar. 6/7 - Nt./Day 3: 120 miles (12 hours)\', \'South of the road great oak trees begin to appear - outliers of Firien Wood. Camp during day (Mar. 7).\', NULL, \'FitDistanceDailySummary\', 2881, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(895, 855, \'Mar. 7/8 - Nt./Day 4: 120 miles (12 hours)\', \'Leave at dusk.\', NULL, \'FitDistanceDailySummary\', 2881, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(896, 855, \'Mar. 7/8 - Nt./Day 4: 120 miles (12 hours)\', \'Northeast across the plain (80 miles away) the East Wall of Rohan and the Western Emyn Muil could be seen if it were daylight.\', NULL, \'FitDistanceDailySummary\', 2894, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(897, 855, \'Mar. 7/8 - Nt./Day 4: 120 miles (12 hours)\', \'Cross the Mering Stream: Gondor. Enter the heart of the Firien Wood. \', NULL, \'FitDistanceDailySummary\', 2897, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(898, 855, \'Mar. 7/8 - Nt./Day 4: 120 miles (12 hours)\', \'The Beacon of Halifirien lies right of the road on a hill which rises above the trees.\', NULL, \'FitDistanceDailySummary\', 2908, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(899, 855, \'Mar. 7/8 - Nt./Day 4: 120 miles (12 hours)\', \'Leave Firien Wood.\', NULL, \'FitDistanceDailySummary\', 2919, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(900, 855, \'Mar. 7/8 - Nt./Day 4: 120 miles (12 hours)\', \'Cross a small stream. The Beacons are Lit: far to the east Pippin spots the beacon of Amon Dîn as it is lit. Almost immediately the beacon fires to the west are ignited. Gandalf explains the beacons to Pippin.\', NULL, \'FitDistanceDailySummary\', 2921, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(901, 855, \'Mar. 7/8 - Nt./Day 4: 120 miles (12 hours)\', \'The snowcapped peak above Calenhad rises to the right, lit by the nearly full moon.\', NULL, \'FitDistanceDailySummary\', 2929, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(902, 855, \'Mar. 7/8 - Nt./Day 4: 120 miles (12 hours)\', \'The beacon tower of Calenhad stands on a foothill of Canlenhad peak. The beacon fires are now extinguished. Brief stop. Eat.\', NULL, \'FitDistanceDailySummary\', 2940, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(903, 855, \'Mar. 7/8 - Nt./Day 4: 120 miles (12 hours)\', \'Cross a small stream.\', NULL, \'FitDistanceDailySummary\', 2958, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(904, 855, \'Mar. 7/8 - Nt./Day 4: 120 miles (12 hours)\', \'Cross a small stream. The beacon hill of Minrimmon is on the right.\', NULL, \'FitDistanceDailySummary\', 2969, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(905, 855, \'Mar. 7/8 - Nt./Day 4: 120 miles (12 hours)\', \'To the north the delta of the Entwash has broadened to over 50 miles. Rauros lies beyond, 100 miles away. Setting moon lights mists over the fens.\', NULL, \'FitDistanceDailySummary\', 2974, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(906, 855, \'Mar. 7/8 - Nt./Day 4: 120 miles (12 hours)\', \'High above to the south rise the sawtoothed tips of Rimmon - the highest peak in the eastern White Mountains.\', NULL, \'FitDistanceDailySummary\', 2984, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(907, 855, \'Mar. 7/8 - Nt./Day 4: 120 miles (12 hours)\', \'Dawn. Camp near the beacon hill of Erelas (day of Mar. 8).\', NULL, \'FitDistanceDailySummary\', 3001, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(908, 855, \'Mar. 8/9 - Nt./Day 5: 120 miles (12 hours)\', \'Leave at dusk.\', NULL, \'FitDistanceDailySummary\', 3001, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(909, 855, \'Mar. 8/9 - Nt./Day 5: 120 miles (12 hours)\', \'Cross a small stream.\', NULL, \'FitDistanceDailySummary\', 3015, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(910, 855, \'Mar. 8/9 - Nt./Day 5: 120 miles (12 hours)\', \'Pass the beacon on Nardol, the ‘Fire Hill.’\', NULL, \'FitDistanceDailySummary\', 3020, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(911, 855, \'Mar. 8/9 - Nt./Day 5: 120 miles (12 hours)\', \'Cross a small stream - the last which empties into the delta of the Entwash. West edge of Drúadan Forest south of the road.\', NULL, \'FitDistanceDailySummary\', 3032, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(912, 855, \'Mar. 8/9 - Nt./Day 5: 120 miles (12 hours)\', \'Eilenach beacon stands on a steep hill to the south, rising above the trees of Drúadan Forest.\', NULL, \'FitDistanceDailySummary\', 3048, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(913, 855, \'Mar. 8/9 - Nt./Day 5: 120 miles (12 hours)\', \'Brief stop. Eat.\', NULL, \'FitDistanceDailySummary\', 3061, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(914, 855, \'Mar. 8/9 - Nt./Day 5: 120 miles (12 hours)\', \'Road curves slightly to the south. Due east across the Anduin the peaks of the Ephel Dùath stand dark against the moonlit sky.\', NULL, \'FitDistanceDailySummary\', 3068, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(915, 855, \'Mar. 8/9 - Nt./Day 5: 120 miles (12 hours)\', \'The beacon hill Amon Dîn is 5 miles due south.\', NULL, \'FitDistanceDailySummary\', 3076, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(916, 855, \'Mar. 8/9 - Nt./Day 5: 120 miles (12 hours)\', \'Road curves still more south around Amon Dîn.\', NULL, \'FitDistanceDailySummary\', 3082, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(917, 855, \'Mar. 8/9 - Nt./Day 5: 120 miles (12 hours)\', \'Road runs SE. The thickets of the Grey Wood begin right of the road.\', NULL, \'FitDistanceDailySummary\', 3086, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(918, 855, \'Mar. 8/9 - Nt./Day 5: 120 miles (12 hours)\', \'The Morgul Vale lies 35 miles due east.\', NULL, \'FitDistanceDailySummary\', 3094, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(919, 855, \'Mar. 8/9 - Nt./Day 5: 120 miles (12 hours)\', \'The Grey Wood ends.\', NULL, \'FitDistanceDailySummary\', 3100, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(920, 855, \'Mar. 8/9 - Nt./Day 5: 120 miles (12 hours)\', \'Mt. Mindolluin is visible to the southwest, lit by the predawn glow.\', NULL, \'FitDistanceDailySummary\', 3104, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(921, 855, \'Mar. 8/9 - Nt./Day 5: 120 miles (12 hours)\', \'Dawn. Gandalf is challenged by the guards at the gate of the Rammas Echor: the wall surrounding the Pelennor Fields. Repairs are underway. \', NULL, \'FitDistanceDailySummary\', 3111, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(922, 855, \'Mar. 8/9 - Nt./Day 5: 120 miles (12 hours)\', \'Reach the Gates of Minas Tirith.\', NULL, \'FitDistanceDailySummary\', 3121, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(923, 227, \'Isengard to Minas Tirith: Aragorn\\\'s Path\', \'\', NULL, \'FitDistanceDailySummary\', NULL, \'flow\', NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(924, 923, \'Mar. 5 - Day 1: 17 miles\', \'Isengard. Confrontation with Saruman. Gandalf breaks Saruman’s staff. Grima Wormtongue casts down the palantír of Orthanc. Pippin retrieves it, but Gandalf quickly takes it. Leave Isengard (ca. 4 p.m.)\', NULL, \'FitDistanceDailySummary\', 3121, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(925, 923, \'Mar. 5 - Day 1: 17 miles\', \'Pass through the gates of Isengard. Follow the stone-paved road south.\', NULL, \'FitDistanceDailySummary\', 3121.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(926, 923, \'Mar. 5 - Day 1: 17 miles\', \'Flooded spots gradually are disappearing.\', NULL, \'FitDistanceDailySummary\', 3123, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(927, 923, \'Mar. 5 - Day 1: 17 miles\', \'Pass the pillar of the White Hand. Ents have broken the hand apart.\', NULL, \'FitDistanceDailySummary\', 3125, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(928, 923, \'Mar. 5 - Day 1: 17 miles\', \'Stone pavement ends. Highway continues.\', NULL, \'FitDistanceDailySummary\', 3127, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(929, 923, \'Mar. 5 - Day 1: 17 miles\', \'Night falls. Waxing moon rises.\', NULL, \'FitDistanceDailySummary\', 3129, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(930, 923, \'Mar. 5 - Day 1: 17 miles\', \'All around are tree stumps, weeds and thorns.\', NULL, \'FitDistanceDailySummary\', 3131, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(931, 923, \'Mar. 5 - Day 1: 17 miles\', \'Leave the Wizard’s Vale. Highway goes SSE toward the Fords.\', NULL, \'FitDistanceDailySummary\', 3135, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(932, 923, \'Mar. 5 - Day 1: 17 miles\', \'Reach the campsite of the night before. Turn west.\', NULL, \'FitDistanceDailySummary\', 3137, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(933, 923, \'Mar. 5 - Day 1: 17 miles\', \'Camp (ca. 10 p.m.). In a dale next to the south-facing slope of Dol Baran, the last hill of the northern ranges. Heather and bracken fern are turning green. While Gandalf sleeps, Pippin takes the palantír and is seen by Sauron. Gandalf prepares to ride out at once with Pippin. When a Nazgûl rides over, he warns Théoden not to wait for dawn to leave.\', NULL, \'FitDistanceDailySummary\', 3138, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(934, 923, \'Mar. 6 - Nt./Day/Nt. 2: 96 miles\', \'Aragorn and Merry, Legolas and Gimli ride out with Théoden, Éomer and 20 Riders (ca. midnight).\', NULL, \'FitDistanceDailySummary\', 3138, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(935, 923, \'Mar. 6 - Nt./Day/Nt. 2: 96 miles\', \'Return to the highway and turn south.\', NULL, \'FitDistanceDailySummary\', 3139, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(936, 923, \'Mar. 6 - Nt./Day/Nt. 2: 96 miles\', \'Company crosses the Fords of Isen.\', NULL, \'FitDistanceDailySummary\', 3154, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(937, 923, \'Mar. 6 - Nt./Day/Nt. 2: 96 miles\', \'They are overtaken by the Grey Company: Halbarad Dúnadan and 30 rangers of the North (summoned by Galadriel), plus Elrond’s sons: Elladan and Elrohir. Moon is westering, but shines out through clouds.\', NULL, \'FitDistanceDailySummary\', 3156, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(938, 923, \'Mar. 6 - Nt./Day/Nt. 2: 96 miles\', \'Reach the road to the Deeping Coomb and turn south to Helm’s Deep.\', NULL, \'FitDistanceDailySummary\', 3169, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(939, 923, \'Mar. 6 - Nt./Day/Nt. 2: 96 miles\', \'Climb upward through the Coomb.\', NULL, \'FitDistanceDailySummary\', 3175, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(940, 923, \'Mar. 6 - Nt./Day/Nt. 2: 96 miles\', \'Pass through Helm’s Dike.\', NULL, \'FitDistanceDailySummary\', 3178.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(941, 923, \'Mar. 6 - Nt./Day/Nt. 2: 96 miles\', \'Reach Helm’s Deep (ca. 6 a.m.). Enter the Hornburg. REST. Late morning Legolas and Gimli show Merry around the Deep. They lunch with Théoden and Riders. Aragorn confronts Sauron in the palantír and learns of the Black Fleet of Umbar. After consulting with Théoden, he decides to take the open road and ride for the Paths of the Dead. Merry rides with Rohirrim (1 p.m.). Aragorn eats, then departs (1:30 p.m.).\', NULL, \'FitDistanceDailySummary\', 3179, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(942, 923, \'Mar. 6 - Nt./Day/Nt. 2: 96 miles\', \'Pass through Helm’s Dike. Ride swiftly down the Deeping Coomb.\', NULL, \'FitDistanceDailySummary\', 3179.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(943, 923, \'Mar. 6 - Nt./Day/Nt. 2: 96 miles\', \'Reach the beaten road from the Ford of Isen and turn east to Edoras.\', NULL, \'FitDistanceDailySummary\', 3189, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(944, 923, \'Mar. 6 - Nt./Day/Nt. 2: 96 miles\', \'Cross a small stream. Dusk.\', NULL, \'FitDistanceDailySummary\', 3211, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(945, 923, \'Mar. 6 - Nt./Day/Nt. 2: 96 miles\', \'Cross a small stream.\', NULL, \'FitDistanceDailySummary\', 3221, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(946, 923, \'Mar. 6 - Nt./Day/Nt. 2: 96 miles\', \'Cross a small stream. Camp (ca. 9:30 p.m.).\', NULL, \'FitDistanceDailySummary\', 3234, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(947, 923, \'Mar. 7 - Day 3: 85 miles\', \'Leave at dawn.\', NULL, \'FitDistanceDailySummary\', 3234, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(948, 923, \'Mar. 7 - Day 3: 85 miles\', \'Cross a small stream.\', NULL, \'FitDistanceDailySummary\', 3261, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(949, 923, \'Mar. 7 - Day 3: 85 miles\', \'Cross a small stream.\', NULL, \'FitDistanceDailySummary\', 587, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(950, 923, \'Mar. 7 - Day 3: 85 miles\', \'Cross a small stream.\', NULL, \'FitDistanceDailySummary\', 598, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(951, 923, \'Mar. 7 - Day 3: 85 miles\', \'Cross a small stream. Brief stop. Eat.\', NULL, \'FitDistanceDailySummary\', 3274, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(952, 923, \'Mar. 7 - Day 3: 85 miles\', \'Ford the Snowbourne. Turn left on the road to Edoras.\', NULL, \'FitDistanceDailySummary\', 3297, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(953, 923, \'Mar. 7 - Day 3: 85 miles\', \'Climb to Meduseld in Edoras. Brief stop.\', NULL, \'FitDistanceDailySummary\', 3298, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(954, 923, \'Mar. 7 - Day 3: 85 miles\', \'Return to the Ford. Turn south into Harrowdale.\', NULL, \'FitDistanceDailySummary\', 3299, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(955, 923, \'Mar. 7 - Day 3: 85 miles\', \'Hamlet of Upbourn.\', NULL, \'FitDistanceDailySummary\', 3307, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(956, 923, \'Mar. 7 - Day 3: 85 miles\', \'Hamlet of Underharrow. Peaks of Irensaga are high above.\', NULL, \'FitDistanceDailySummary\', 3313, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(957, 923, \'Mar. 7 - Day 3: 85 miles\', \'Opposite the waterfalls from the western ravine.\', NULL, \'FitDistanceDailySummary\', 3317, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(958, 923, \'Mar. 7 - Day 3: 85 miles\', \'Reach the trail from the western ravine. Road turns east to the Hold.\', NULL, \'FitDistanceDailySummary\', 3317.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(959, 923, \'Mar. 7 - Day 3: 85 miles\', \'Climb the switchback road ‘Stair of the Hold’ some hundreds of feet up the mountain face. Ancient statues mark each turn of the road: the Púkel-men. A last cutting climbs a short slope. Dusk.\', NULL, \'FitDistanceDailySummary\', 3318, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(960, 923, \'Mar. 7 - Day 3: 85 miles\', \'Reach the Firienfeld of Dunharrow. Aragorn tells Éowyn of his plans.\', NULL, \'FitDistanceDailySummary\', 3319, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(961, 923, \'Mar. 8 - Day 4: 60 miles\', \'Aragorn and company head east to the Dwimorberg, following the path lined with standing stones (ca. 6 a.m.).\', NULL, \'FitDistanceDailySummary\', 3319, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(962, 923, \'Mar. 8 - Day 4: 60 miles\', \'They pass into the gloom of the dark woods of the Dimholt. See a last mighty standing stone. Horses refuse to pass and must be led.\', NULL, \'FitDistanceDailySummary\', 3321, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(963, 923, \'Mar. 8 - Day 4: 60 miles\', \'They pass the Dark Door into the Haunted Mountain, still leading the horses: the Paths of the Dead.\', NULL, \'FitDistanceDailySummary\', 3321.7, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(964, 923, \'Mar. 8 - Day 4: 60 miles\', \'In a cavern they see Baldor’s skeleton by a closed stone door. Aragorn summons the Dead. The torches are blown out.\', NULL, \'FitDistanceDailySummary\', 3323, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(965, 923, \'Mar. 8 - Day 4: 60 miles\', \'Gimli is the last of the Living. He goes in fear. The Dead follow.\', NULL, \'FitDistanceDailySummary\', 3325, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(966, 923, \'Mar. 8 - Day 4: 60 miles\', \'Gimli stumbles and falls. Crawls.\', NULL, \'FitDistanceDailySummary\', 3346, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(967, 923, \'Mar. 8 - Day 4: 60 miles\', \'The sound of water begins to be heard - the springs of the River Morthond: the Blackroot.\', NULL, \'FitDistanceDailySummary\', 3348, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(968, 923, \'Mar. 8 - Day 4: 60 miles\', \'Exit the Paths of the Dead through a high-arched broad opening. Remount horses (ca. 4 p.m.).\', NULL, \'FitDistanceDailySummary\', 3349, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(969, 923, \'Mar. 8 - Day 4: 60 miles\', \'A steep road descends through the deep ravine. The river is on the left.\', NULL, \'FitDistanceDailySummary\', 3351, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(970, 923, \'Mar. 8 - Day 4: 60 miles\', \'Evening falls.\', NULL, \'FitDistanceDailySummary\', 3353, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(971, 923, \'Mar. 8 - Day 4: 60 miles\', \'Ravine ends like “a crack in a wall.” The river pours over many falls. Reach the wide Morthond Vale (ca. 7 p.m.). See lights in houses below.\', NULL, \'FitDistanceDailySummary\', 3355, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(972, 923, \'Mar. 8 - Day 4: 60 miles\', \'Cross a bridge over the torrent and follow a road east into the Vale.\', NULL, \'FitDistanceDailySummary\', 3357, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(973, 923, \'Mar. 8 - Day 4: 60 miles\', \'As reach houses, all lights are put out. Bells are ringing in warning.\', NULL, \'FitDistanceDailySummary\', 3365, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(974, 923, \'Mar. 8 - Day 4: 60 miles\', \'River turns southwest, further away from the road.\', NULL, \'FitDistanceDailySummary\', 3369, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(975, 923, \'Mar. 8 - Day 4: 60 miles\', \'Reach the foot of the Hill of Erech.\', NULL, \'FitDistanceDailySummary\', 3378, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(976, 923, \'Mar. 8 - Day 4: 60 miles\', \'Aragorn climbs to the Stone of Erech. Arrives just before midnight. The stone is a great globe half buried in the ground, but the height of a man. Aragorn’s great banner is unfurled and he speaks with the Dead. Camp.\', NULL, \'FitDistanceDailySummary\', 3379, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(977, 923, \'Mar. 9 - Day 5: 110 miles (Ride swiftly: 7 mph)\', \'Dawn. Ride from Erech in great haste, southeast down the road.\', NULL, \'FitDistanceDailySummary\', 3379, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(978, 923, \'Mar. 9 - Day 5: 110 miles (Ride swiftly: 7 mph)\', \'Pass through the most northeasterly lands of Morthond - home of 500 bowmen who have gone to Minas Tirith with Duinhir and his sons.\', NULL, \'FitDistanceDailySummary\', 3395, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(979, 923, \'Mar. 9 - Day 5: 110 miles (Ride swiftly: 7 mph)\', \'Road runs between hills on both sides: Tarlang’s Neck.\', NULL, \'FitDistanceDailySummary\', 3411, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(980, 923, \'Mar. 9 - Day 5: 110 miles (Ride swiftly: 7 mph)\', \'Enter Lamedon - home of a few grim hillmen who have gone to Minas Tirith without a captain. As they reach the uplands, the Dead sweep past, but Aragorn orders them back. Stop to eat: Noon.\', NULL, \'FitDistanceDailySummary\', 3421, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(981, 923, \'Mar. 9 - Day 5: 110 miles (Ride swiftly: 7 mph)\', \'Road drops slowly into the lowlands.\', NULL, \'FitDistanceDailySummary\', 3431, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(982, 923, \'Mar. 9 - Day 5: 110 miles (Ride swiftly: 7 mph)\', \'The road continues to curve through a lowland between the Hills of Tarlang on the west and an outlying spur of the White Mountains on the north.\', NULL, \'FitDistanceDailySummary\', 3441, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(983, 923, \'Mar. 9 - Day 5: 110 miles (Ride swiftly: 7 mph)\', \'Hills of Tarlang curve east and thrust closer to the road.\', NULL, \'FitDistanceDailySummary\', 3451, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(984, 923, \'Mar. 9 - Day 5: 110 miles (Ride swiftly: 7 mph)\', \'To the east the River Ciril meanders through the meads.\', NULL, \'FitDistanceDailySummary\', 3461, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(985, 923, \'Mar. 9 - Day 5: 110 miles (Ride swiftly: 7 mph)\', \'Dusk. Eat, then ride on.\', NULL, \'FitDistanceDailySummary\', 3465, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(986, 923, \'Mar. 9 - Day 5: 110 miles (Ride swiftly: 7 mph)\', \'The Hills of Tarlang end and the vale of the River Ringló opens to the southwest. The Hills of Tarnost rise ahead in the southeast.\', NULL, \'FitDistanceDailySummary\', 3471, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(987, 923, \'Mar. 9 - Day 5: 110 miles (Ride swiftly: 7 mph)\', \'The road turns more east toward the River Ciril.\', NULL, \'FitDistanceDailySummary\', 3481, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(988, 923, \'Mar. 9 - Day 5: 110 miles (Ride swiftly: 7 mph)\', \'The fords of Ciril. A red sunset can be seen far in the west lighting the tops of the Pinnath Gelin (Green Hills).\', NULL, \'FitDistanceDailySummary\', 3488, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(989, 923, \'Mar. 9 - Day 5: 110 miles (Ride swiftly: 7 mph)\', \'Camp just past the ford (ca. 9:30 p.m.). Farms of the Township of Calembel are deserted - many gone to war; the rest, fled.\', NULL, \'FitDistanceDailySummary\', 3489, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(990, 923, \'Mar. 10 - Day 6 THE DAWNLESS DAY: 90 miles (Ride swiftly: 7 mph)\', \'No dawn. Leave when gloom first lightens.\', NULL, \'FitDistanceDailySummary\', 3489, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(991, 923, \'Mar. 10 - Day 6 THE DAWNLESS DAY: 90 miles (Ride swiftly: 7 mph)\', \'Pass the village of Calembel.\', NULL, \'FitDistanceDailySummary\', 3491, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(992, 923, \'Mar. 10 - Day 6 THE DAWNLESS DAY: 90 miles (Ride swiftly: 7 mph)\', \'Towering hills rise on the north. To the south the Ciril joins the Ringló.\', NULL, \'FitDistanceDailySummary\', 3501, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(993, 923, \'Mar. 10 - Day 6 THE DAWNLESS DAY: 90 miles (Ride swiftly: 7 mph)\', \'A valley opens on the north stretching to the foot of Halifirien mount.\', NULL, \'FitDistanceDailySummary\', 3511, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(994, 923, \'Mar. 10 - Day 6 THE DAWNLESS DAY: 90 miles (Ride swiftly: 7 mph)\', \'A great southern spur of the White Mountains rises just ten miles north. To the south are the Hills of Tarnost.\', NULL, \'FitDistanceDailySummary\', 3521, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(995, 923, \'Mar. 10 - Day 6 THE DAWNLESS DAY: 90 miles (Ride swiftly: 7 mph)\', \'Noon.\', NULL, \'FitDistanceDailySummary\', 3531, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(996, 923, \'Mar. 10 - Day 6 THE DAWNLESS DAY: 90 miles (Ride swiftly: 7 mph)\', \'They ford the Ringló at Ethring. Stop briefly to eat.\', NULL, \'FitDistanceDailySummary\', 3535, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(997, 923, \'Mar. 10 - Day 6 THE DAWNLESS DAY: 90 miles (Ride swiftly: 7 mph)\', \'Road rises slightly and curves due south as it is barred on the east by a great arm of the mountains, jutting down from the mount of Rimmon.\', NULL, \'FitDistanceDailySummary\', 3541, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(998, 923, \'Mar. 10 - Day 6 THE DAWNLESS DAY: 90 miles (Ride swiftly: 7 mph)\', \'Road climbs a slope at the very end of the mountain arm.\', NULL, \'FitDistanceDailySummary\', 3551, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(999, 923, \'Mar. 10 - Day 6 THE DAWNLESS DAY: 90 miles (Ride swiftly: 7 mph)\', \'Beyond the rise of the crest, they descend into some of the richest lands thus far: Dor-en-Ernil (Land of the Prince) - the most eastern lands under Prince Imrahil.\', NULL, \'FitDistanceDailySummary\', 3561, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1000, 923, \'Mar. 10 - Day 6 THE DAWNLESS DAY: 90 miles (Ride swiftly: 7 mph)\', \'Past dusk. Camp in the midst of the open valley.\', NULL, \'FitDistanceDailySummary\', 3579, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1001, 923, \'Mar. 11 - Day 7: 70 miles (Ride swiftly: 7 mph)\', \'No dawn. Leave at first light.\', NULL, \'FitDistanceDailySummary\', 3579, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1002, 923, \'Mar. 11 - Day 7: 70 miles (Ride swiftly: 7 mph)\', \'The lands open out, almost flat all the way to the Great River Anduin.\', NULL, \'FitDistanceDailySummary\', 3601, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1003, 923, \'Mar. 11 - Day 7: 70 miles (Ride swiftly: 7 mph)\', \'Noon. Eat.\', NULL, \'FitDistanceDailySummary\', 3621, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1004, 923, \'Mar. 11 - Day 7: 70 miles (Ride swiftly: 7 mph)\', \'They drop into coastal lowlands as they near the estuary of the Gilrain.\', NULL, \'FitDistanceDailySummary\', 3631, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1005, 923, \'Mar. 11 - Day 7: 70 miles (Ride swiftly: 7 mph)\', \'A low terrace appears east of the road, damming a small lake above.\', NULL, \'FitDistanceDailySummary\', 3639, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1006, 923, \'Mar. 11 - Day 7: 70 miles (Ride swiftly: 7 mph)\', \'Reach the outskirts of the town of Linhir.\', NULL, \'FitDistanceDailySummary\', 3643, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1007, 923, \'Mar. 11 - Day 7: 70 miles (Ride swiftly: 7 mph)\', \'At the fords where the Gilrain and the Serni join, they find Men of Lamedon fighting off ships of Umbar and Harad (ca. 3:30 p.m.). All flee from the Dead except Angbor of Lamedon, whom Aragorn bids follow.\', NULL, \'FitDistanceDailySummary\', 3645, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1008, 923, \'Mar. 11 - Day 7: 70 miles (Ride swiftly: 7 mph)\', \'Camp east of the fords.\', NULL, \'FitDistanceDailySummary\', 3649, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1009, 923, \'Mar. 12 - Day 8: 70 miles Drive the enemy ahead\', \'No dawn. Road now curves east. The terrace face rises on the north as the company rides forth.\', NULL, \'FitDistanceDailySummary\', 3649, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1010, 923, \'Mar. 12 - Day 8: 70 miles Drive the enemy ahead\', \'The River Serni cuts through the terrace face and flows west.\', NULL, \'FitDistanceDailySummary\', 3653, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1011, 923, \'Mar. 12 - Day 8: 70 miles Drive the enemy ahead\', \'All this area is already contested. The enemy flies east before them.\', NULL, \'FitDistanceDailySummary\', 3665, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1012, 923, \'Mar. 12 - Day 8: 70 miles Drive the enemy ahead\', \'Road swings more to the northeast.\', NULL, \'FitDistanceDailySummary\', 3681, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1013, 923, \'Mar. 12 - Day 8: 70 miles Drive the enemy ahead\', \'The fabled ‘green fields of Lebennin’ appear grey and trampled.\', NULL, \'FitDistanceDailySummary\', 3691, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1014, 923, \'Mar. 12 - Day 8: 70 miles Drive the enemy ahead\', \'Road parallels the course of the Anduin, 15 miles away.\', NULL, \'FitDistanceDailySummary\', 3701, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1015, 923, \'Mar. 12 - Day 8: 70 miles Drive the enemy ahead\', \'Camp again.\', NULL, \'FitDistanceDailySummary\', 3719, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1016, 923, \'Mar. 13 - Day 9: 35 miles \', \'Leave at first light.\', NULL, \'FitDistanceDailySummary\', 3719, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1017, 923, \'Mar. 13 - Day 9: 35 miles \', \'Road begins to swing toward the Great River.\', NULL, \'FitDistanceDailySummary\', 3731, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1018, 923, \'Mar. 13 - Day 9: 35 miles \', \'The enemy are still being driven ahead, but are getting desperate as they near the river.\', NULL, \'FitDistanceDailySummary\', 3741, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1019, 923, \'Mar. 13 - Day 9: 35 miles \', \'Cross the River Sirith. Reach the Pelargir. Legolas hears the cries of gulls.\', NULL, \'FitDistanceDailySummary\', 3751, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1020, 923, \'Mar. 13 - Day 9: 35 miles \', \'Noon. At the Havens of Pelargir is the Fleet of Umbar: 50 great ships and numerous smaller vessels. The Haradrim turn to fight. Aragorn calls forth the Dead. The Battle of Pelargir. The mariners cast themselves overboard in fear. Aragorn drives through the enemies on shore. The Dead depart after Aragorn declares their oaths fulfilled. Freed captives and the host from that part of Gondor gather and prepare the ships.\', NULL, \'FitDistanceDailySummary\', 3754, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1021, 923, \'Mar. 14 - Day 10: 85 miles (Row: 4.7 mph)\', \'Fleet goes north at first light. No wind. Row against the current.\', NULL, \'FitDistanceDailySummary\', 3754, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1022, 923, \'Mar. 14 - Day 10: 85 miles (Row: 4.7 mph)\', \'Pass between the fields of Lebennin on the west and South Ithilien on east.\', NULL, \'FitDistanceDailySummary\', 3777, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1023, 923, \'Mar. 14 - Day 10: 85 miles (Row: 4.7 mph)\', \'Legolas senses the change in the wind.\', NULL, \'FitDistanceDailySummary\', 3797, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1024, 923, \'Mar. 14 - Day 10: 85 miles (Row: 4.7 mph)\', \'Night falls. Due north a red glow can be seen under the cloud - Minas Tirith is burning.\', NULL, \'FitDistanceDailySummary\', 3810, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1025, 923, \'Mar. 14 - Day 10: 85 miles (Row: 4.7 mph)\', \'River Erui enters on the west.\', NULL, \'FitDistanceDailySummary\', 3829, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1026, 923, \'Mar. 14 - Day 10: 85 miles (Row: 4.7 mph)\', \'Midnight. Continue upriver. Sea-crafty men sense wind from the sea.\', NULL, \'FitDistanceDailySummary\', 3839, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1027, 923, \'Mar. 15 - Day 11: 68 miles (Sail: 7.2 mph)\', \'Hoist sail. Speed grows.\', NULL, \'FitDistanceDailySummary\', 3851, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1028, 923, \'Mar. 15 - Day 11: 68 miles (Sail: 7.2 mph)\', \'River curves west toward Minas Tirith.\', NULL, \'FitDistanceDailySummary\', 3861, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1029, 923, \'Mar. 15 - Day 11: 68 miles (Sail: 7.2 mph)\', \'The lands of Lossarnach are on the west. Many folk live there under the kindly rule of Furlong the Fat.\', NULL, \'FitDistanceDailySummary\', 3871, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1030, 923, \'Mar. 15 - Day 11: 68 miles (Sail: 7.2 mph)\', \'Dawn. Clouds lighten.\', NULL, \'FitDistanceDailySummary\', 3881, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1031, 923, \'Mar. 15 - Day 11: 68 miles (Sail: 7.2 mph)\', \'The southern slopes of the Emyn Arnen appear on the eastern shore.\', NULL, \'FitDistanceDailySummary\', 3885, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1032, 923, \'Mar. 15 - Day 11: 68 miles (Sail: 7.2 mph)\', \'River swings northeast as it rounds the ‘knee’ of the Emyn Arnen.\', NULL, \'FitDistanceDailySummary\', 3901, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1033, 923, \'Mar. 15 - Day 11: 68 miles (Sail: 7.2 mph)\', \'The Battle of the Pelennor Fields has been raging since dawn and Éomer sees the black ships arriving at Harlond: the havens southeast of the city (9 a.m.). On the lead ship Aragorn’s banner is unfurled: the White Tree, seven stars, and golden crown - signs of Elendil. Aragorn leads his forces onto the field of battle. Winds blow away the darkness.\', NULL, \'FitDistanceDailySummary\', 3904, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1034, 923, \'Mar. 15 - Day 11: 68 miles (Sail: 7.2 mph)\', \'Aragorn and Éomer meet in the midst of battle.\', NULL, \'FitDistanceDailySummary\', 3905.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1035, 227, \'Isengard to Minas Tirith: Merry’s Path\', \'\', NULL, \'FitDistanceDailySummary\', NULL, \'flow\', NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1036, 1035, \'Mar. 5 - Day 1: 17 miles\', \'Isengard. Confrontation with Saruman. Gandalf breaks Saruman’s staff. Grima Wormtongue casts down the palantír of Orthanc. Pippin retrieves it, but Gandalf quickly takes it. Leave Isengard (ca. 4 p.m.)\', NULL, \'FitDistanceDailySummary\', 3905.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1037, 1035, \'Mar. 5 - Day 1: 17 miles\', \'Pass through the gates of Isengard. Follow the stone-paved road south.\', NULL, \'FitDistanceDailySummary\', 3906, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1038, 1035, \'Mar. 5 - Day 1: 17 miles\', \'Flooded spots gradually are disappearing.\', NULL, \'FitDistanceDailySummary\', 3907.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1039, 1035, \'Mar. 5 - Day 1: 17 miles\', \'Pass the pillar of the White Hand. Ents have broken the hand apart.\', NULL, \'FitDistanceDailySummary\', 3909.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1040, 1035, \'Mar. 5 - Day 1: 17 miles\', \'Stone pavement ends. Highway continues.\', NULL, \'FitDistanceDailySummary\', 3911.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1041, 1035, \'Mar. 5 - Day 1: 17 miles\', \'Night falls. Waxing moon rises.\', NULL, \'FitDistanceDailySummary\', 3913.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1042, 1035, \'Mar. 5 - Day 1: 17 miles\', \'All around are tree stumps, weeds and thorns.\', NULL, \'FitDistanceDailySummary\', 3915.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1043, 1035, \'Mar. 5 - Day 1: 17 miles\', \'Leave the Wizard’s Vale. Highway goes SSE toward the Fords.\', NULL, \'FitDistanceDailySummary\', 3919.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1044, 1035, \'Mar. 5 - Day 1: 17 miles\', \'Reach the campsite of the night before. Turn west.\', NULL, \'FitDistanceDailySummary\', 3921.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1045, 1035, \'Mar. 5 - Day 1: 17 miles\', \'Camp (ca. 10 p.m.). In a dale next to the south-facing slope of Dol Baran, the last hill of the northern ranges. Heather and bracken fern are turning green. While Gandalf sleeps, Pippin takes the palantír and is seen by Sauron. Gandalf plans to ride out at once with Pippin. When a Nazgûl rides over, he warns Théoden not to wait for the dawn to leave.\', NULL, \'FitDistanceDailySummary\', 3922.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1046, 1035, \'Mar. 6 - Nt./Day 2: 61 miles\', \'Aragorn and Merry, Legolas and Gimli ride out with Théoden, Éomer and 20 Riders (ca. midnight).\', NULL, \'FitDistanceDailySummary\', 3922.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1047, 1035, \'Mar. 6 - Nt./Day 2: 61 miles\', \'Return to the highway and turn south.\', NULL, \'FitDistanceDailySummary\', 3923.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1048, 1035, \'Mar. 6 - Nt./Day 2: 61 miles\', \'Company crosses the Fords of Isen.\', NULL, \'FitDistanceDailySummary\', 3938.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1049, 1035, \'Mar. 6 - Nt./Day 2: 61 miles\', \'They are overtaken by the Grey Company: Halbarad Dúnadan and 30 rangers of the North (summoned by Galadriel), plus Elrond’s sons: Elladan and Elrohir. Moon is westering, but shines out through clouds.\', NULL, \'FitDistanceDailySummary\', 3940.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1050, 1035, \'Mar. 6 - Nt./Day 2: 61 miles\', \'Reach the road to the Deeping Coomb and turn south to Helm’s Deep.\', NULL, \'FitDistanceDailySummary\', 3953.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1051, 1035, \'Mar. 6 - Nt./Day 2: 61 miles\', \'Climb upward through the Coomb.\', NULL, \'FitDistanceDailySummary\', 3959.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1052, 1035, \'Mar. 6 - Nt./Day 2: 61 miles\', \'Pass through Helm’s Dike.\', NULL, \'FitDistanceDailySummary\', 3963, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1053, 1035, \'Mar. 6 - Nt./Day 2: 61 miles\', \'Reach Helm’s Deep (ca. 6 a.m.). Enter the Hornburg. REST. Late morning Legolas and Gimli show Merry around the Deep. Lunch with Théoden and Riders. Aragorn confronts Sauron in the palantír and learns of the Black Fleet of Umbar. After consulting with Théoden, he decides to take the open road and ride for the Paths of the Dead. Merry rides out with Rohirrim (1 p.m.).\', NULL, \'FitDistanceDailySummary\', 3963.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1054, 1035, \'Mar. 6 - Nt./Day 2: 61 miles\', \'Riders pass through Helm’s Dike. Aragorn, Legolas and Gimli watch.\', NULL, \'FitDistanceDailySummary\', 3964, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1055, 1035, \'Mar. 6 - Nt./Day 2: 61 miles\', \'Ride down through the Deeping Coomb.\', NULL, \'FitDistanceDailySummary\', 3964.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1056, 1035, \'Mar. 6 - Nt./Day 2: 61 miles\', \'Turn east on a path that skirts the foothills.\', NULL, \'FitDistanceDailySummary\', 3965.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1057, 1035, \'Mar. 6 - Nt./Day 2: 61 miles\', \'Path turns south among the hills.\', NULL, \'FitDistanceDailySummary\', 3966.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1058, 1035, \'Mar. 6 - Nt./Day 2: 61 miles\', \'Reach crest of a ridge.\', NULL, \'FitDistanceDailySummary\', 3967.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1059, 1035, \'Mar. 6 - Nt./Day 2: 61 miles\', \'Valley.\', NULL, \'FitDistanceDailySummary\', 3969.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1060, 1035, \'Mar. 6 - Nt./Day 2: 61 miles\', \'Ridge. Far above rise some of the highest peaks of the White Mountains.\', NULL, \'FitDistanceDailySummary\', 3971.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1061, 1035, \'Mar. 6 - Nt./Day 2: 61 miles\', \'Reach a small stream. Turn north. Merry rides with Théoden.\', NULL, \'FitDistanceDailySummary\', 3977.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1062, 1035, \'Mar. 6 - Nt./Day 2: 61 miles\', \'Cross stream. Continue east.\', NULL, \'FitDistanceDailySummary\', 3979.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1063, 1035, \'Mar. 6 - Nt./Day 2: 61 miles\', \'Camp by a stream in a shallow valley.\', NULL, \'FitDistanceDailySummary\', 3983.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1064, 1035, \'Mar. 7 - Day 3: 40 miles\', \'Leave just after dawn. Cross stream and climb hill.\', NULL, \'FitDistanceDailySummary\', 3983.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1065, 1035, \'Mar. 7 - Day 3: 40 miles\', \'Reach hillcrest. Turn SW along the crest.\', NULL, \'FitDistanceDailySummary\', 3985.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1066, 1035, \'Mar. 7 - Day 3: 40 miles\', \'Leave hillcrest and descend hillslope.\', NULL, \'FitDistanceDailySummary\', 3989.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1067, 1035, \'Mar. 7 - Day 3: 40 miles\', \'Reach a small stream. Turn north. Merry rides with Théoden.\', NULL, \'FitDistanceDailySummary\', 3991.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1068, 1035, \'Mar. 7 - Day 3: 40 miles\', \'Cross stream. Continue east.\', NULL, \'FitDistanceDailySummary\', 3993.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1069, 1035, \'Mar. 7 - Day 3: 40 miles\', \'Ridge. Turn south, climbing onto higher mountainsides now.\', NULL, \'FitDistanceDailySummary\', 3996.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1070, 1035, \'Mar. 7 - Day 3: 40 miles\', \'Cross a small stream. Brief stop. Eat.\', NULL, \'FitDistanceDailySummary\', 4002.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1071, 1035, \'Mar. 7 - Day 3: 40 miles\', \'Climb a still higher ridge. Reach crest. Turn south along crest.\', NULL, \'FitDistanceDailySummary\', 4005.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1072, 1035, \'Mar. 7 - Day 3: 40 miles\', \'Descend steep hillside from the crest. Zig-zag path.\', NULL, \'FitDistanceDailySummary\', 4007.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1073, 1035, \'Mar. 7 - Day 3: 40 miles\', \'Reach stream. Cross stream and turn north. Merry rides with Théoden.\', NULL, \'FitDistanceDailySummary\', 4012.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1074, 1035, \'Mar. 7 - Day 3: 40 miles\', \'Turn east from valley. Angle ENE up a high mountain ridge.\', NULL, \'FitDistanceDailySummary\', 4013.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1075, 1035, \'Mar. 7 - Day 3: 40 miles\', \'Reach crest.\', NULL, \'FitDistanceDailySummary\', 4016.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1076, 1035, \'Mar. 7 - Day 3: 40 miles\', \'Angle south down steep slope.\', NULL, \'FitDistanceDailySummary\', 4019.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1077, 1035, \'Mar. 7 - Day 3: 40 miles\', \'Dusk. Reach valley. Camp by small stream. Snow on peak above camp.\', NULL, \'FitDistanceDailySummary\', 4023.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1078, 1035, \'Mar. 8 - Day 4: 40 miles\', \'Leave just after dawn. Cross stream and climb a slight rise.\', NULL, \'FitDistanceDailySummary\', 4023.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1079, 1035, \'Mar. 8 - Day 4: 40 miles\', \'Reach a swift-flowing mountain stream. Turn NE beside it. Merry rides with Théoden.\', NULL, \'FitDistanceDailySummary\', 4027.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1080, 1035, \'Mar. 8 - Day 4: 40 miles\', \'Cross stream. Continue alongside it. Merry rides with Théoden.\', NULL, \'FitDistanceDailySummary\', 4033.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1081, 1035, \'Mar. 8 - Day 4: 40 miles\', \'Turn east from stream. Climb a steep mountainside. Trees more scarce.\', NULL, \'FitDistanceDailySummary\', 4035.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1082, 1035, \'Mar. 8 - Day 4: 40 miles\', \'Reach the highest crest thus far. No trees. Merry rides with Théoden.\', NULL, \'FitDistanceDailySummary\', 4040.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1083, 1035, \'Mar. 8 - Day 4: 40 miles\', \'Snake down steep slope, pitted by bowl-shaped hollows: old cirques. Eat.\', NULL, \'FitDistanceDailySummary\', 4045.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1084, 1035, \'Mar. 8 - Day 4: 40 miles\', \'Cross a rushing stream just below where three mountain rills join, cascading down from glaciers above on the mountain peak.\', NULL, \'FitDistanceDailySummary\', 4051.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1085, 1035, \'Mar. 8 - Day 4: 40 miles\', \'Zig-zag up an open mountainside to a steep-cut ridge crest.\', NULL, \'FitDistanceDailySummary\', 4055.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1086, 1035, \'Mar. 8 - Day 4: 40 miles\', \'CAMP on the crest of the High Pass. COLD. No water source.\', NULL, \'FitDistanceDailySummary\', 4063.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1087, 1035, \'Mar. 9 - Day 5: 40 miles\', \'Angle SE down the steep-falling slope of the ridge.\', NULL, \'FitDistanceDailySummary\', 4063.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1088, 1035, \'Mar. 9 - Day 5: 40 miles\', \'Reach a small stream tumbling down from the peak. Follow valley east. Pines begin to appear.\', NULL, \'FitDistanceDailySummary\', 4075.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1089, 1035, \'Mar. 9 - Day 5: 40 miles\', \'A second stream joins the first. Valley deepens and has pine-clad walls. Eat.\', NULL, \'FitDistanceDailySummary\', 4085.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1090, 1035, \'Mar. 9 - Day 5: 40 miles\', \'Cross the upland stream and follow the right bank.\', NULL, \'FitDistanceDailySummary\', 4091.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1091, 1035, \'Mar. 9 - Day 5: 40 miles\', \'The stream begins to cut a ravine on the left. In places the path climbs away along the valleyside.\', NULL, \'FitDistanceDailySummary\', 4097.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1092, 1035, \'Mar. 9 - Day 5: 40 miles\', \'Reach the valley mouth above Harrowdale. Valley is already in shadow and one light shines out. Stream plunges down a waterfall. Path turns SE from the western ravine and descends the steepsided wall of the valley. Fir-woods cloak the valley walls. Starkhorn looms over them on the south, its peak shining red in the sunset (ca. 5:30 p.m.).\', NULL, \'FitDistanceDailySummary\', 4101.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1093, 1035, \'Mar. 9 - Day 5: 40 miles\', \'Ford the Snowbourne. Cross to the valley floor and reach the road from Edoras. Most riders camp in the valley, joining the thousands already waiting there. Théoden’s company continues east to the Hold. \', NULL, \'FitDistanceDailySummary\', 4102, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1094, 1035, \'Mar. 9 - Day 5: 40 miles\', \'They climb the switchback road ‘Stair of the Hold’ some hundreds of feet up the mountain face. Ancient statues mark each turn of the road: the Púkel-men. A last cutting climbs a short slope.\', NULL, \'FitDistanceDailySummary\', 4102.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1095, 1035, \'Mar. 9 - Day 5: 40 miles\', \'Reach the Firienfeld of Dunharrow. Éowyn greets them there. Camp. Theoden’s Pavilion is set north of the standing stone-lined path. Merry has a small tent nearby. As Merry and others eat with the king, a errand-rider of Gondor arrives with ‘The Red Arrow’ - a plea to come to the aid of Minas Tirith. \', NULL, \'FitDistanceDailySummary\', 4103.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1096, 1035, \'Mar. 10 - Day 6 - The Dawnless Day: 56 miles\', \'The dark has already reached Dunharrow when Merry is awakened in the morning (ca. 7 a.m.). Éowyn arms Merry. Théoden’s company leaves the Hold (ca. 9 a.m.). Merry rides Stybba.\', NULL, \'FitDistanceDailySummary\', 4103.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1097, 1035, \'Mar. 10 - Day 6 - The Dawnless Day: 56 miles\', \'Ride down the ‘Stair of the Hold’ and reach the valley.\', NULL, \'FitDistanceDailySummary\', 4104.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1098, 1035, \'Mar. 10 - Day 6 - The Dawnless Day: 56 miles\', \'Road turns north to Edoras. Théoden’s company is joined by 5500 riders fully armed, and many hundreds of other men with horses. Merry notices Dernhelm among the host.\', NULL, \'FitDistanceDailySummary\', 4105, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1099, 1035, \'Mar. 10 - Day 6 - The Dawnless Day: 56 miles\', \'Opposite the waterfalls from the western ravine.\', NULL, \'FitDistanceDailySummary\', 4105.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1100, 1035, \'Mar. 10 - Day 6 - The Dawnless Day: 56 miles\', \'Hamlet of Underharrow. Peaks of Irensaga are high above.\', NULL, \'FitDistanceDailySummary\', 4109.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1101, 1035, \'Mar. 10 - Day 6 - The Dawnless Day: 56 miles\', \'Hamlet of Upbourn.\', NULL, \'FitDistanceDailySummary\', 4115.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1102, 1035, \'Mar. 10 - Day 6 - The Dawnless Day: 56 miles\', \'Leave Harrowdale. Reach the road from the ford of the Snowbourne. Noon. Halt a short while on the road below Edoras. Eat. The Muster of Rohan - 60 more riders arrive, making the muster complete: “6000 spears to Sunlending.” Théoden refuses for Merry to ride with the Rohirrim. Éowyn (disguised as Dernhelm) takes Merry in secret.\', NULL, \'FitDistanceDailySummary\', 4123.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1103, 1035, \'Mar. 10 - Day 6 - The Dawnless Day: 56 miles\', \'The road curves easterly around the mountain spur behind Edoras.\', NULL, \'FitDistanceDailySummary\', 4125.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1104, 1035, \'Mar. 10 - Day 6 - The Dawnless Day: 56 miles\', \'The Snowbourne meanders through willow trees left of the road.\', NULL, \'FitDistanceDailySummary\', 4127.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1105, 1035, \'Mar. 10 - Day 6 - The Dawnless Day: 56 miles\', \'The road curves southeast, hugging the eastern foothills of Irensaga.\', NULL, \'FitDistanceDailySummary\', 4137.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1106, 1035, \'Mar. 10 - Day 6 - The Dawnless Day: 56 miles\', \'Hills draw away to the south. Road continues through willows.\', NULL, \'FitDistanceDailySummary\', 4145.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1107, 1035, \'Mar. 10 - Day 6 - The Dawnless Day: 56 miles\', \'Scattered trees broaden into a wide willow thicket where the Snowbourne meets the Entwash.\', NULL, \'FitDistanceDailySummary\', 4155.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1108, 1035, \'Mar. 10 - Day 6 - The Dawnless Day: 56 miles\', \'Camp in the Willow thicket (ca. 7 p.m.).\', NULL, \'FitDistanceDailySummary\', 4159.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1109, 1035, \'Mar. 11 - Day 7: 80 miles (2nd Day from Dunharrow)\', \'Leave at first ‘light’ in the gray gloom.\', NULL, \'FitDistanceDailySummary\', 4159.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1110, 1035, \'Mar. 11 - Day 7: 80 miles (2nd Day from Dunharrow)\', \'Willow woods end. Road turns more south, parallels the Entwash.\', NULL, \'FitDistanceDailySummary\', 4163.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1111, 1035, \'Mar. 11 - Day 7: 80 miles (2nd Day from Dunharrow)\', \'Reach the area called the ‘Folde’, tucked against the hills, sheltered from the west and the south. A snowcapped peak rises on the south. North across the river the wide grassy Plains of Rohan can be seen.\', NULL, \'FitDistanceDailySummary\', 4175.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1112, 1035, \'Mar. 11 - Day 7: 80 miles (2nd Day from Dunharrow)\', \'Road turns more to the east.\', NULL, \'FitDistanceDailySummary\', 4185.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1113, 1035, \'Mar. 11 - Day 7: 80 miles (2nd Day from Dunharrow)\', \'Cross a small stream.\', NULL, \'FitDistanceDailySummary\', 4191.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1114, 1035, \'Mar. 11 - Day 7: 80 miles (2nd Day from Dunharrow)\', \'Cross a small stream. Brief stop to eat.\', NULL, \'FitDistanceDailySummary\', 4202.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1115, 1035, \'Mar. 11 - Day 7: 80 miles (2nd Day from Dunharrow)\', \'30 miles north of the road the Entwash, flowing more slowly in the level plains, is choked with vegetation and splits into multiple braided channels.\', NULL, \'FitDistanceDailySummary\', 4215.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1116, 1035, \'Mar. 11 - Day 7: 80 miles (2nd Day from Dunharrow)\', \'Cross a small stream. Enter the area called the ‘Fenmarch’ - a wetter area, especially north of the road where the Entwash becomes sluggish and starts to expand outward into a delta.\', NULL, \'FitDistanceDailySummary\', 4222.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1117, 1035, \'Mar. 11 - Day 7: 80 miles (2nd Day from Dunharrow)\', \'Dusk. Cross a small stream. Camp.\', NULL, \'FitDistanceDailySummary\', 4239.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1118, 1035, \'Mar. 12 - Day 8: 80 miles (3rd Day from Dunharrow)\', \'Leave at first light. Still dark and gloomy.\', NULL, \'FitDistanceDailySummary\', 4239.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1119, 1035, \'Mar. 12 - Day 8: 80 miles (3rd Day from Dunharrow)\', \'South of the road great oak trees begin to appear - outliers of Firien Wood. On the north mists rise above the fens of the Entwash.\', NULL, \'FitDistanceDailySummary\', 4242.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1120, 1035, \'Mar. 12 - Day 8: 80 miles (3rd Day from Dunharrow)\', \'Lone man, fleeing west, tells of war on the plains and the Wold.\', NULL, \'FitDistanceDailySummary\', 4247.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1121, 1035, \'Mar. 12 - Day 8: 80 miles (3rd Day from Dunharrow)\', \'Northeast across the plain (80 miles away) the East Wall of Rohan and the Western Emyn Muil could be seen if it were clear.\', NULL, \'FitDistanceDailySummary\', 4255.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1122, 1035, \'Mar. 12 - Day 8: 80 miles (3rd Day from Dunharrow)\', \'Cross the Mering Stream: Gondor. Enter the heart of the Firien Wood. \', NULL, \'FitDistanceDailySummary\', 4258.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1123, 1035, \'Mar. 12 - Day 8: 80 miles (3rd Day from Dunharrow)\', \'The beacon of Halifirien lies right of the road on a hill which rises above the trees. Its fires are now extinguished.\', NULL, \'FitDistanceDailySummary\', 4269.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1124, 1035, \'Mar. 12 - Day 8: 80 miles (3rd Day from Dunharrow)\', \'Leave Firien Wood.\', NULL, \'FitDistanceDailySummary\', 4280.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1125, 1035, \'Mar. 12 - Day 8: 80 miles (3rd Day from Dunharrow)\', \'Cross a small stream. Brief stop to eat.\', NULL, \'FitDistanceDailySummary\', 4282.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1126, 1035, \'Mar. 12 - Day 8: 80 miles (3rd Day from Dunharrow)\', \'The snowcapped peak above Calenhad rises to the right.\', NULL, \'FitDistanceDailySummary\', 4290.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1127, 1035, \'Mar. 12 - Day 8: 80 miles (3rd Day from Dunharrow)\', \'The beacon tower of Calenhad stands on a foothill of Calenhad peak.\', NULL, \'FitDistanceDailySummary\', 4301.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1128, 1035, \'Mar. 12 - Day 8: 80 miles (3rd Day from Dunharrow)\', \'Cross a small stream. Camp.\', NULL, \'FitDistanceDailySummary\', 4319.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1129, 1035, \'Mar. 13 - Day 9: 80 miles (4th Day from Dunharrow)\', \'Leave at first light.\', NULL, \'FitDistanceDailySummary\', 4319.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1130, 1035, \'Mar. 13 - Day 9: 80 miles (4th Day from Dunharrow)\', \'Cross a small stream. The beacon hill of Minrimmon is on the right.\', NULL, \'FitDistanceDailySummary\', 4330.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1131, 1035, \'Mar. 13 - Day 9: 80 miles (4th Day from Dunharrow)\', \'To the north the delta of the Entwash has broadened to over 50 miles. Rauros lies beyond, 100 miles due north of the road.\', NULL, \'FitDistanceDailySummary\', 4335.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1132, 1035, \'Mar. 13 - Day 9: 80 miles (4th Day from Dunharrow)\', \'High above to the south rise the sawtoothed tips of Rimmon - the highest peak in the eastern White Mountains.\', NULL, \'FitDistanceDailySummary\', 4345.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1133, 1035, \'Mar. 13 - Day 9: 80 miles (4th Day from Dunharrow)\', \'Pass the beacon hill of Erelas. Brief pause to eat.\', NULL, \'FitDistanceDailySummary\', 4362.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1134, 1035, \'Mar. 13 - Day 9: 80 miles (4th Day from Dunharrow)\', \'Cross a small stream.\', NULL, \'FitDistanceDailySummary\', 4376.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1135, 1035, \'Mar. 13 - Day 9: 80 miles (4th Day from Dunharrow)\', \'Pass the beacon on Nardol, the ‘Fire Hill.’\', NULL, \'FitDistanceDailySummary\', 4387.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1136, 1035, \'Mar. 13 - Day 9: 80 miles (4th Day from Dunharrow)\', \'Cross a small stream - the last which empties into the delta of the Entwash. West edge of Druadan Forest south of the road.\', NULL, \'FitDistanceDailySummary\', 4393.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1137, 1035, \'Mar. 13 - Day 9: 80 miles (4th Day from Dunharrow)\', \'Turn south into Druadan Forest to camp out of sight of the road. Scouts report that trenches and stakes block the road 6 miles east.\', NULL, \'FitDistanceDailySummary\', 4398.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1138, 1035, \'Mar. 13 - Day 9: 80 miles (4th Day from Dunharrow)\', \'Camp in the pine-woods near the hill of Eilenach Beacon.\', NULL, \'FitDistanceDailySummary\', 4399.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1139, 1035, \'Mar. 14 - Day 10: 50 miles (5th Day from Dunharrow)\', \'Late in the night Merry is wakeful and hears drums. Follows Elfhelm to Théoden. Ghân-buri-Ghân, chief of the Wild Men, offers to guide the Riders through a hidden way. They depart as quickly as possible.\', NULL, \'FitDistanceDailySummary\', 4399.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1140, 1035, \'Mar. 14 - Day 10: 50 miles (5th Day from Dunharrow)\', \'The passage south through the woods is slow and pathless.\', NULL, \'FitDistanceDailySummary\', 4401.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1141, 1035, \'Mar. 14 - Day 10: 50 miles (5th Day from Dunharrow)\', \'kirt the western foot of the hill of Eilenach.\', NULL, \'FitDistanceDailySummary\', 4405.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1142, 1035, \'Mar. 14 - Day 10: 50 miles (5th Day from Dunharrow)\', \'Reach the west end of Stonewain Valley: the remains of a vast quarry, mined into both sides of an east-running valley. Though overgrown, the road still allows four horses to ride abreast. Move more quickly.\', NULL, \'FitDistanceDailySummary\', 4414.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1143, 1035, \'Mar. 14 - Day 10: 50 miles (5th Day from Dunharrow)\', \'The valley road descends from west to east. Light more dim than ever.\', NULL, \'FitDistanceDailySummary\', 4420.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1144, 1035, \'Mar. 14 - Day 10: 50 miles (5th Day from Dunharrow)\', \'East end of Stonewain Valley. Road continues through trees.\', NULL, \'FitDistanceDailySummary\', 4435.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1145, 1035, \'Mar. 14 - Day 10: 50 miles (5th Day from Dunharrow)\', \'Northeast through openings they can see the beacon hill of Amon Dîn.\', NULL, \'FitDistanceDailySummary\', 4441.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1146, 1035, \'Mar. 14 - Day 10: 50 miles (5th Day from Dunharrow)\', \'Mindolluin rises to the south. Thickets of the Grey Wood hide road.\', NULL, \'FitDistanceDailySummary\', 4445.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1147, 1035, \'Mar. 14 - Day 10: 50 miles (5th Day from Dunharrow)\', \'Camp (ca. 4:30 p.m.) in the heart of the Grey Wood. Scouts report.\', NULL, \'FitDistanceDailySummary\', 4449.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1148, 1035, \'Mar. 15 - Day 11: 34 miles (6th Day from Dunharrow)\', \'Riders move east toward the main road during the night (ca. 3 a.m.).\', NULL, \'FitDistanceDailySummary\', 4449.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1149, 1035, \'Mar. 15 - Day 11: 34 miles (6th Day from Dunharrow)\', \'Reach the east edge of the Grey Wood.\', NULL, \'FitDistanceDailySummary\', 4451.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1150, 1035, \'Mar. 15 - Day 11: 34 miles (6th Day from Dunharrow)\', \'Meet the Great West Road. Turn toward the city. Ride quickly.\', NULL, \'FitDistanceDailySummary\', 4452.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1151, 1035, \'Mar. 15 - Day 11: 34 miles (6th Day from Dunharrow)\', \'Road turns more south nearing the skirts of Mt. Mindolluin. See a red glow on clouds ahead: fires of Minas Tirith.\', NULL, \'FitDistanceDailySummary\', 4465.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1152, 1035, \'Mar. 15 - Day 11: 34 miles (6th Day from Dunharrow)\', \'Riders spread out on each side of the road. Ride very fast.\', NULL, \'FitDistanceDailySummary\', 4468.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1153, 1035, \'Mar. 15 - Day 11: 34 miles (6th Day from Dunharrow)\', \'Théoden briefs his three captains and calls out to encourage his Riders.\', NULL, \'FitDistanceDailySummary\', 4470.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1154, 1035, \'Mar. 15 - Day 11: 34 miles (6th Day from Dunharrow)\', \'Dawn (above the reek). Reach the Rammas Echor: the outwalls of the Pelennor Fields. The enemy has thrown down the walls and the Riders pass through the breaches, killing the few orcs.\', NULL, \'FitDistanceDailySummary\', 4473.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1155, 1035, \'Mar. 15 - Day 11: 34 miles (6th Day from Dunharrow)\', \'Théoden leads the Riders slightly to the east, moving quietly.\', NULL, \'FitDistanceDailySummary\', 4475.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1156, 1035, \'Mar. 15 - Day 11: 34 miles (6th Day from Dunharrow)\', \'Stop. Can smell the burning of the city. Merry feels a south wind and can see the clouds breaking far in the south. They see the flash and hear the BOOM from the breaking of the Gates. Théoden cries out to the Rohirrim and blows a great blast on a horn: “Great horns of the North, wildly blowing. Rohan had come at last.” Riders surge forth, with Théoden in the center. The Battle of the Pelennor Fields.\', NULL, \'FitDistanceDailySummary\', 4478.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1157, 1035, \'Mar. 15 - Day 11: 34 miles (6th Day from Dunharrow)\', \'Théoden is crushed, pinned beneath his steed when the Lord of the Nazgul descends. Éowyn (aided by Merry) slays the Witch King. Éowyn falls. \', NULL, \'FitDistanceDailySummary\', 4482.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1158, 1035, \'Mar. 15 - Day 11: 34 miles (6th Day from Dunharrow)\', \'Merry follows the litter bearers into the city of Minas Tirith.\', NULL, \'FitDistanceDailySummary\', 4483.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1159, 227, \'Minas Tirith to the Morannon\', \'\', NULL, \'FitDistanceDailySummary\', NULL, \'flow\', NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1160, 1159, \'March 18 - Day 1: 33 miles\', \'Host assembles before Gates of Minas Tirith. Go ENE through the Pelennor.\', NULL, \'FitDistanceDailySummary\', 4483.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1161, 1159, \'March 18 - Day 1: 33 miles\', \'Pass between Causeway Forts on the Rammas Echor. Follow Causeway east across the flatlands of the Anduin valley.\', NULL, \'FitDistanceDailySummary\', 4494.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1162, 1159, \'March 18 - Day 1: 33 miles\', \'Reach the western walls of Osgiliath. Pass through “ruins of Old Gondor.”\', NULL, \'FitDistanceDailySummary\', 4495.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1163, 1159, \'March 18 - Day 1: 33 miles\', \'Use ferries and boat-bridges of the enemy to cross the Anduin.\', NULL, \'FitDistanceDailySummary\', 4496.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1164, 1159, \'March 18 - Day 1: 33 miles\', \'Continue through ruins of east Osgiliath. Pass new defense works.\', NULL, \'FitDistanceDailySummary\', 4497.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1165, 1159, \'March 18 - Day 1: 33 miles\', \'Infantry halts 5 miles east of the Anduin. Camps by the River Morgul.\', NULL, \'FitDistanceDailySummary\', 4501.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1166, 1159, \'March 18 - Day 1: 33 miles\', \'Horsemen continue up the Morgul-road east. It is straight, but climbing.\', NULL, \'FitDistanceDailySummary\', 4508.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1167, 1159, \'March 18 - Day 1: 33 miles\', \'Reach the Cross-roads by evening. Heralds proclaim the coming of the Lords of Gondor. No other sounds. Repair statue of the King. Camp.\', NULL, \'FitDistanceDailySummary\', 4516.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1168, 1159, \'March 20 - Day 3: 25 miles\', \'Leave a strong guard at Cross-roads: archers of Ithilien. Rest of Host moves north on the road. Send scouts ahead and on each side.\', NULL, \'FitDistanceDailySummary\', 4516.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1169, 1159, \'March 20 - Day 3: 25 miles\', \' Heralds proclaim the coming of the Lords of Gondor. Prince Imrahil suggests they say “King Elessar.” Weather fair, with west wind.\', NULL, \'FitDistanceDailySummary\', 4521.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1170, 1159, \'March 20 - Day 3: 25 miles\', \'Dark thickets rise from the tumbled land below the Ephel Dúath.\', NULL, \'FitDistanceDailySummary\', 4524.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1171, 1159, \'March 20 - Day 3: 25 miles\', \'Cross stream on a masonry bridge. Heralds proclaim the coming of King Elessar. Rest.\', NULL, \'FitDistanceDailySummary\', 4527.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1172, 1159, \'March 20 - Day 3: 25 miles\', \'Cross stream on bridge. Rest.\', NULL, \'FitDistanceDailySummary\', 4534.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1173, 1159, \'March 20 - Day 3: 25 miles\', \' Heralds proclaim the coming of King Elessar. Camp by stream.\', NULL, \'FitDistanceDailySummary\', 4541.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1174, 1159, \'March 21 - Day 4: 20 miles\', \'Cross stream on bridge. Continue north on road.\', NULL, \'FitDistanceDailySummary\', 4541.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1175, 1159, \'March 21 - Day 4: 20 miles\', \'Heralds proclaim the coming of King Elessar. Cross stream on bridge.\', NULL, \'FitDistanceDailySummary\', 4547.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1176, 1159, \'March 21 - Day 4: 20 miles\', \'Heralds proclaim the coming of King Elessar. Weather still fair.\', NULL, \'FitDistanceDailySummary\', 4551.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1177, 1159, \'March 21 - Day 4: 20 miles\', \'Reach south end of long cut through out-thrust arm of the mountains.\', NULL, \'FitDistanceDailySummary\', 4555.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1178, 1159, \'March 21 - Day 4: 20 miles\', \'Heralds proclaim the coming of King Elessar. \', NULL, \'FitDistanceDailySummary\', 4557.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1179, 1159, \'March 21 - Day 4: 20 miles\', \'Host is attacked by Orcs and Easterlings (same place as Faramir had defeated the Haradrim). Well warned by scouts, they easily defeat the attack. Camp there by stream. Nazgûl overfly camp.\', NULL, \'FitDistanceDailySummary\', 4561.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1180, 1159, \'March 22 - Day 5: 22 miles \', \'Cross stream on bridge. Nazgûl continue to overfly.\', NULL, \'FitDistanceDailySummary\', 4561.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1181, 1159, \'March 22 - Day 5: 22 miles \', \'Heralds proclaim the coming of King Elessar. Cross stream on bridge.\', NULL, \'FitDistanceDailySummary\', 4565.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1182, 1159, \'March 22 - Day 5: 22 miles \', \'Heralds proclaim the coming of King Elessar. \', NULL, \'FitDistanceDailySummary\', 4577.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1183, 1159, \'March 22 - Day 5: 22 miles \', \'Cross stream on bridge.\', NULL, \'FitDistanceDailySummary\', 4574.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1184, 1159, \'March 22 - Day 5: 22 miles \', \'Heralds proclaim the coming of King Elessar. \', NULL, \'FitDistanceDailySummary\', 552, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1185, 1159, \'March 22 - Day 5: 22 miles \', \'Reach the point where the road turns northeast toward the Black Gate. Camp west of road, next to a stream.\', NULL, \'FitDistanceDailySummary\', 4583.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1186, 1159, \'March 23 - Day 6: 18 miles\', \'Swing northwest away from the road.\', NULL, \'FitDistanceDailySummary\', 4583.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1187, 1159, \'March 23 - Day 6: 18 miles\', \'Follow a dry stream-bed leading toward the Wetwang.\', NULL, \'FitDistanceDailySummary\', 4585.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1188, 1159, \'March 23 - Day 6: 18 miles\', \'Turn northeast, roughly paralleling the road.\', NULL, \'FitDistanceDailySummary\', 4587.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1189, 1159, \'March 23 - Day 6: 18 miles\', \'Rest. Reach the desert-like lands west of Mordor. See the beginnings of the Desolation of the Morannon. Aragorn dismisses the faint-hearted.\', NULL, \'FitDistanceDailySummary\', 4589.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1190, 1159, \'March 23 - Day 6: 18 miles\', \'Eat. Continue on, slowly.\', NULL, \'FitDistanceDailySummary\', 4592.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1191, 1159, \'March 23 - Day 6: 18 miles\', \'Camp.\', NULL, \'FitDistanceDailySummary\', 4601.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1192, 1159, \'March 24 - Day 7: 15 miles\', \'Continue northeast.\', NULL, \'FitDistanceDailySummary\', 4601.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1193, 1159, \'March 24 - Day 7: 15 miles\', \'Pass among the moors of the Noman-lands. Draw together. No scouts.\', NULL, \'FitDistanceDailySummary\', 4605.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1194, 1159, \'March 24 - Day 7: 15 miles\', \'Eat. Rest. Continue on very slowly. Expect attack, but none comes.\', NULL, \'FitDistanceDailySummary\', 4609.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1195, 1159, \'March 24 - Day 7: 15 miles\', \'Camp northwest of the Black Gates. All are wakeful. Sense that things prowl around them. No wind. Cold.\', NULL, \'FitDistanceDailySummary\', 4616.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1196, 1159, \'March 25 - Day 8: 5 miles The Day of Doom\', \'Dawn. North wind rises. Turn southeast toward the Morannon.\', NULL, \'FitDistanceDailySummary\', 4616.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1197, 1159, \'March 25 - Day 8: 5 miles The Day of Doom\', \'Pass among slag heaps and noisome pits.\', NULL, \'FitDistanceDailySummary\', 4619.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1198, 1159, \'March 25 - Day 8: 5 miles The Day of Doom\', \'Early day: reach the Black Gate. Aragorn arrays Host on two hills of stone. Parley with the Mouth of Sauron. The Battle of Morannon. Barad-dûr and the Morannon collapse when the Ring is destroyed.\', NULL, \'FitDistanceDailySummary\', 4621.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1199, 227, \'The Morannon to Minas Tirith: The Return Journey\', \'\', NULL, \'FitDistanceDailySummary\', NULL, \'flow\', NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1200, 1199, \'March 26 - Day 1: 19 miles\', \'Wounded are placed on supply-wains. Move slowly to protect the wounded. Begin trek down the Southward Road, away from the rubble of the Morannon. Scouts follow retreating enemies to assure they do not return.\', NULL, \'FitDistanceDailySummary\', 4621.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1201, 1199, \'March 26 - Day 1: 19 miles\', \'Ride southwest. Road runs in a trenchlike valley between the mountains and the moors. It is newly repaired for many miles.\', NULL, \'FitDistanceDailySummary\', 4623.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1202, 1199, \'March 26 - Day 1: 19 miles\', \'End of the slag heaps.\', NULL, \'FitDistanceDailySummary\', 4630.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1203, 1199, \'March 26 - Day 1: 19 miles\', \'Stop for the night. Camp along the road.\', NULL, \'FitDistanceDailySummary\', 4640.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1204, 1199, \'March 27 - Day 2: 19 miles\', \'Start ca. 8 a.m. Continue down the road.\', NULL, \'FitDistanceDailySummary\', 4640.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1205, 1199, \'March 27 - Day 2: 19 miles\', \'Road turns more to the south.\', NULL, \'FitDistanceDailySummary\', 4643.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1206, 1199, \'March 27 - Day 2: 19 miles\', \'Reach northern edge of Ithilien. East across road are dark trees. Closer ‘a tumbled heathland’ with ‘knots of pine-trees.’ Air is fresh and fragrant.\', NULL, \'FitDistanceDailySummary\', 4645.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1207, 1199, \'March 27 - Day 2: 19 miles\', \'Road is straight and level. Go more quickly.\', NULL, \'FitDistanceDailySummary\', 4646.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1208, 1199, \'March 27 - Day 2: 19 miles\', \'In valley between mountains on east and steep slopes on west.\', NULL, \'FitDistanceDailySummary\', 4648.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1209, 1199, \'March 27 - Day 2: 19 miles\', \'Woods appear to the west. Some growth begins along the road edges.\', NULL, \'FitDistanceDailySummary\', 4651.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1210, 1199, \'March 27 - Day 2: 19 miles\', \'Road crosses stream on an arched masonry bridge.\', NULL, \'FitDistanceDailySummary\', 4654.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1211, 1199, \'March 27 - Day 2: 19 miles\', \'Road becomes more overgrown. Camp along the road.\', NULL, \'FitDistanceDailySummary\', 4659.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1212, 1199, \'March 28 - Day 3: 18 miles\', \'Start ca. 8 a.m. Continue on Southward Road.\', NULL, \'FitDistanceDailySummary\', 4659.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1213, 1199, \'March 28 - Day 3: 18 miles\', \'Another stream is bridged.\', NULL, \'FitDistanceDailySummary\', 4663.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1214, 1199, \'March 28 - Day 3: 18 miles\', \'Reach north end of a long straight cutting through a stony ridge.\', NULL, \'FitDistanceDailySummary\', 4665.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1215, 1199, \'March 28 - Day 3: 18 miles\', \'Turn off the road. Climb west bank and go downhill. Many wounded now can walk. Some ride horses. Others are carried on litters. Many troops continue south on the road for return directly to Minas Tirith.\', NULL, \'FitDistanceDailySummary\', 4668.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1216, 1199, \'March 28 - Day 3: 18 miles\', \'Follow the nearby stream to the small clear pool visited 3 weeks before by Frodo and Sam. Troops find and cleanse nearby orc fire-ring.\', NULL, \'FitDistanceDailySummary\', 4669.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1217, 1199, \'March 28 - Day 3: 18 miles\', \'Troops stay north of stream. Descend steep slope.\', NULL, \'FitDistanceDailySummary\', 4671.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1218, 1199, \'March 28 - Day 3: 18 miles\', \'Thread their way through woodland, north of the stream channel.\', NULL, \'FitDistanceDailySummary\', 4673.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1219, 1199, \'March 28 - Day 3: 18 miles\', \'Trees grow thinner. The stream now runs “in a narrow gorge.”\', NULL, \'FitDistanceDailySummary\', 4676.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1220, 1199, \'March 28 - Day 3: 18 miles\', \'Camp near Henneth Annûn. Some go to the caves for supplies.\', NULL, \'FitDistanceDailySummary\', 4677.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1221, 1199, \'March 29 - Day 4: 14 miles\', \'Continue downhill through woodland. Must skirt widely around the hollow of the waterfall. \', NULL, \'FitDistanceDailySummary\', 4677.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1222, 1199, \'March 29 - Day 4: 14 miles\', \'Return to the stream. It still falls swiftly.\', NULL, \'FitDistanceDailySummary\', 4680.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1223, 1199, \'March 29 - Day 4: 14 miles\', \'Slope is more gentle. Trees begin to open out. The Anduin can be seen.\', NULL, \'FitDistanceDailySummary\', 4683.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1224, 1199, \'March 29 - Day 4: 14 miles\', \'Another stream joins on the southern shore.\', NULL, \'FitDistanceDailySummary\', 4685.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1225, 1199, \'March 29 - Day 4: 14 miles\', \'Reach the open, grassy flatlands by the Anduin: the Field of Cormallen.\', NULL, \'FitDistanceDailySummary\', 4689.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1226, 1199, \'March 29 - Day 4: 14 miles\', \'Set up camp with numerous pavilions. \', NULL, \'FitDistanceDailySummary\', 4691.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1227, 1199, \'April 28 - Day 33 since The Day of Doom: 37 miles\', \'Leave early. The Host goes south, taking boats down the Anduin.\', NULL, \'FitDistanceDailySummary\', 4691.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1228, 1199, \'April 28 - Day 33 since The Day of Doom: 37 miles\', \'The south end of Cair Andros lies on the west, stream mouth on east.\', NULL, \'FitDistanceDailySummary\', 4692.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1229, 1199, \'April 28 - Day 33 since The Day of Doom: 37 miles\', \'Stream enters on east.\', NULL, \'FitDistanceDailySummary\', 4715.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1230, 1199, \'April 28 - Day 33 since The Day of Doom: 37 miles\', \'Can see Amon Dîn due west.\', NULL, \'FitDistanceDailySummary\', 4705.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1231, 1199, \'April 28 - Day 33 since The Day of Doom: 37 miles\', \'Stream enters on east.\', NULL, \'FitDistanceDailySummary\', 552, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1232, 1199, \'April 28 - Day 33 since The Day of Doom: 37 miles\', \'Reach northern edge of Osgiliath. Continue down river to landings.\', NULL, \'FitDistanceDailySummary\', 4727.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1233, 1199, \'April 28 - Day 33 since The Day of Doom: 37 miles\', \'Reach landings of Osgiliath. Dock and unload wounded.\', NULL, \'FitDistanceDailySummary\', 4728.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1234, 1199, \'April 30 - Day 35: 13 miles\', \'Mid-morning. Leave Osgiliath and go west along the Causeway.\', NULL, \'FitDistanceDailySummary\', 4728.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1235, 1199, \'April 30 - Day 35: 13 miles\', \'Reach the Causeway Forts on the Rammas Echor.\', NULL, \'FitDistanceDailySummary\', 4729.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1236, 1199, \'April 30 - Day 35: 13 miles\', \'Continue on the road across the Pelennor.\', NULL, \'FitDistanceDailySummary\', 4733.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1237, 1199, \'April 30 - Day 35: 13 miles\', \'Reach the Gates of Minas Tirith. Aragorn camps in the field.\', NULL, \'FitDistanceDailySummary\', 4741.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1238, 227, \'The Road Home: Minas Tirith to Isengard\', \'\', NULL, \'FitDistanceDailySummary\', NULL, \'flow\', NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1239, 1238, \'July 19 - Day 1: 10 miles\', \'Noon - Depart from the Gates of Minas Tirith. Merry rides on the wain, guarding the King’s arms. With them go all who remain of the Fellowship, as well as Queen Arwen, Elrond and his sons, Celeborn and Galadriel, and many knights of Gondor and Rohan.\', NULL, \'FitDistanceDailySummary\', 4741.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1240, 1238, \'July 19 - Day 1: 10 miles\', \'Process through the Pelennor. Stop for the night at the gate of the Rammas Echor: the wall surrounding the Pelennor Fields.\', NULL, \'FitDistanceDailySummary\', 4751.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1241, 1238, \'July 20 - Day 2: 20 miles\', \'Mt. Mindolluin is visible to the southwest, lit by the predawn glow.\', NULL, \'FitDistanceDailySummary\', 4758.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1242, 1238, \'July 20 - Day 2: 20 miles\', \'The Grey Wood begins.\', NULL, \'FitDistanceDailySummary\', 4762.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1243, 1238, \'July 20 - Day 2: 20 miles\', \'The Morgul Vale lies 35 miles due east.\', NULL, \'FitDistanceDailySummary\', 4768.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1244, 1238, \'July 20 - Day 2: 20 miles\', \'Camp.\', NULL, \'FitDistanceDailySummary\', 4771.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1245, 1238, \'July 21 - Day 3: 20 miles\', \'Thickets of the Grey Wood lie left of the road with Amon Dîn rising to the west of the Wood. Drums can be heard in the distance. King Aragorn’s heralds announce that the Forest of Drúadan is given to Ghân-buri-ghân and his folk and none may enter it without their leave.\', NULL, \'FitDistanceDailySummary\', 4776.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1246, 1238, \'July 21 - Day 3: 20 miles\', \'Road curves more to the west around Amon Dîn.\', NULL, \'FitDistanceDailySummary\', 4780.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1247, 1238, \'July 21 - Day 3: 20 miles\', \'The beacon hill Amon Dîn is 5 miles due south.\', NULL, \'FitDistanceDailySummary\', 4786.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1248, 1238, \'July 21 - Day 3: 20 miles\', \'Camp by road north of the Drúadan Forest. \', NULL, \'FitDistanceDailySummary\', 4791.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1249, 1238, \'July 22 - Day 4: 20 miles\', \'Road curves slightly to the north. Due east across the Anduin the peaks of the Ephel Dùath can be seen dark against the climbing sun.\', NULL, \'FitDistanceDailySummary\', 4794.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1250, 1238, \'July 22 - Day 4: 20 miles\', \'Camp.\', NULL, \'FitDistanceDailySummary\', 4811.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1251, 1238, \'July 23 - Day 5: 19 miles\', \'Eilenach beacon stands on a steep hill to the south, rising above the trees of Drúadan Forest.\', NULL, \'FitDistanceDailySummary\', 4814.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1252, 1238, \'July 23 - Day 5: 19 miles\', \'Cross a small stream - the most eastern which empties into the delta of the Entwash. Along the Anduin the delta extends over 100 miles. The west edge of Drúadan Forest south of the road. Camp.\', NULL, \'FitDistanceDailySummary\', 4830.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1253, 1238, \'July 24 - Day 6: 21 miles\', \'Pass the beacon on Nardol, the ‘Fire Hill.’\', NULL, \'FitDistanceDailySummary\', 4842.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1254, 1238, \'July 24 - Day 6: 21 miles\', \'Cross a small stream.\', NULL, \'FitDistanceDailySummary\', 4847.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1255, 1238, \'July 24 - Day 6: 21 miles\', \'Camp.\', NULL, \'FitDistanceDailySummary\', 4851.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1256, 1238, \'July 25 - Day 7: 20 miles\', \'The beacon hill of Erelas stands south of the road.\', NULL, \'FitDistanceDailySummary\', 4861.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1257, 1238, \'July 25 - Day 7: 20 miles\', \'Camp.\', NULL, \'FitDistanceDailySummary\', 4871.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1258, 1238, \'July 26 - Day 8: 20 miles\', \'High above to the south rise the sawtoothed tips of Rimmon - the highest peak in the eastern White Mountains: still snowcapped.\', NULL, \'FitDistanceDailySummary\', 4878.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1259, 1238, \'July 26 - Day 8: 20 miles\', \'To the north the delta of the Entwash still stretches over 50 miles north to south. Rauros lies beyond, 100 miles away.\', NULL, \'FitDistanceDailySummary\', 4888.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1260, 1238, \'July 26 - Day 8: 20 miles\', \'Camp.\', NULL, \'FitDistanceDailySummary\', 4891.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1261, 1238, \'July 27 - Day 9: 20 miles\', \'Cross a small stream. The beacon hill of Minrimmon is on the left.\', NULL, \'FitDistanceDailySummary\', 4893.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1262, 1238, \'July 27 - Day 9: 20 miles\', \'Cross a small stream.\', NULL, \'FitDistanceDailySummary\', 4904.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1263, 1238, \'July 27 - Day 9: 20 miles\', \'Camp.\', NULL, \'FitDistanceDailySummary\', 4911.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1264, 1238, \'July 28 - Day 10: 20 miles\', \'The beacon tower of Calenhad stands on a foothill of Calenhad peak.\', NULL, \'FitDistanceDailySummary\', 4922.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1265, 1238, \'July 28 - Day 10: 20 miles\', \'Camp.\', NULL, \'FitDistanceDailySummary\', 4931.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1266, 1238, \'July 29 - Day 11: 20 miles\', \'The peak above Calenhad rises to the left - still streaked with snow.\', NULL, \'FitDistanceDailySummary\', 4933.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1267, 1238, \'July 29 - Day 11: 20 miles\', \'Cross a small stream.\', NULL, \'FitDistanceDailySummary\', 4941.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1268, 1238, \'July 29 - Day 11: 20 miles\', \'Reach the edge of Firien Wood.\', NULL, \'FitDistanceDailySummary\', 4943.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1269, 1238, \'July 29 - Day 11: 20 miles\', \'Camp in Firien Wood.\', NULL, \'FitDistanceDailySummary\', 4951.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1270, 1238, \'July 30 - Day 12: 20 miles\', \'The Beacon of Halifirien lies left of the road on a hill which rises above the trees.\', NULL, \'FitDistanceDailySummary\', 4954.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1271, 1238, \'July 30 - Day 12: 20 miles\', \'Cross the Mering Stream: Rohan. Enter the heart of the Firien Wood. This is the area called the ‘Fenmarch’ - a wet area, especially north of the road where the Entwash becomes sluggish and starts its spread outward into a delta.\', NULL, \'FitDistanceDailySummary\', 4965.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1272, 1238, \'July 30 - Day 12: 20 miles\', \'Northeast across the plain (80 miles away) the East Wall of Rohan and the Western Emyn Muil can be seen.\', NULL, \'FitDistanceDailySummary\', 4968.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1273, 1238, \'July 30 - Day 12: 20 miles\', \'Camp. Still among the trees.\', NULL, \'FitDistanceDailySummary\', 4971.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1274, 1238, \'August 1 - Day 13: 20 miles\', \'South of the road the last of the great oak trees stand - end of Firien Wood.\', NULL, \'FitDistanceDailySummary\', 4981.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1275, 1238, \'August 1 - Day 13: 20 miles\', \'Cross a small stream.\', NULL, \'FitDistanceDailySummary\', 4984.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1276, 1238, \'August 1 - Day 13: 20 miles\', \'Camp. \', NULL, \'FitDistanceDailySummary\', 4991.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1277, 1238, \'August 2 - Day 14: 20 miles\', \'Cross a small stream. The Fenmarch ends. Enter the area called the ‘Folde’, tucked against the hills, sheltered from the west and the south.\', NULL, \'FitDistanceDailySummary\', 5001.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1278, 1238, \'August 2 - Day 14: 20 miles\', \'North of the road, the Entwash, flowing slowly in the level plains is choked with vegetation and is split into multiple braided channels.\', NULL, \'FitDistanceDailySummary\', 5008.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1279, 1238, \'August 2 - Day 14: 20 miles\', \'Camp.\', NULL, \'FitDistanceDailySummary\', 5011.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1280, 1238, \'August 3 - Day 15: 21 miles Note: Although ‘Many Partings’ (LOTR:RK) states that the journey took 15 days, this conflicts with the specific dates given in‘The Tale of Years’. The latter reference is used here.\', \'Cross a small stream. North across the Entwash the wide grassy Plains of Rohan lie green in the sun.\', NULL, \'FitDistanceDailySummary\', 5021.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1281, 1238, \'August 3 - Day 15: 21 miles Note: Although ‘Many Partings’ (LOTR:RK) states that the journey took 15 days, this conflicts with the specific dates given in‘The Tale of Years’. The latter reference is used here.\', \'Cross a small stream. Camp.\', NULL, \'FitDistanceDailySummary\', 5032.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1282, 1238, \'August 4 - Day 16: 19 miles\', \'Road turns more to the west.\', NULL, \'FitDistanceDailySummary\', 5038.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1283, 1238, \'August 4 - Day 16: 19 miles\', \'Leave the Folde. A peak rises on the south - no longer snowcapped.\', NULL, \'FitDistanceDailySummary\', 5048.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1284, 1238, \'August 4 - Day 16: 19 miles\', \'Camp.\', NULL, \'FitDistanceDailySummary\', 5051.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1285, 1238, \'August 5 - Day 17: 20 miles\', \'Willow woods appear. Road turns more north, parallels the Entwash.\', NULL, \'FitDistanceDailySummary\', 5060.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1286, 1238, \'August 5 - Day 17: 20 miles\', \'A wide willow thicket grows where the Snowbourne meets the Entwash, but narrows to scattered trees beside the road.\', NULL, \'FitDistanceDailySummary\', 5068.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1287, 1238, \'August 5 - Day 17: 20 miles\', \'Camp.\', NULL, \'FitDistanceDailySummary\', 5071.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1288, 1238, \'August 6 - Day 18: 20 miles\', \'Hills draw away to the south. Road continues through scattered willows.\', NULL, \'FitDistanceDailySummary\', 5078.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1289, 1238, \'August 6 - Day 18: 20 miles\', \'The road curves northwest, hugging the foothills of Irensaga.\', NULL, \'FitDistanceDailySummary\', 5086.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1290, 1238, \'August 6 - Day 18: 20 miles\', \'Camp.\', NULL, \'FitDistanceDailySummary\', 5091.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1291, 1238, \'August 7 - Day 19: 10 miles\', \'The Snowbourne meanders through willow trees right of the road.\', NULL, \'FitDistanceDailySummary\', 5096.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1292, 1238, \'August 7 - Day 19: 10 miles\', \'The road curves westerly around the mountain spur east of Edoras.\', NULL, \'FitDistanceDailySummary\', 5098.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1293, 1238, \'August 7 - Day 19: 10 miles\', \'Reach field below the barrow mounds.\', NULL, \'FitDistanceDailySummary\', 5100.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1294, 1238, \'August 7 - Day 19: 10 miles\', \'Climb to Meduseld in Edoras.\', NULL, \'FitDistanceDailySummary\', 5101.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1295, 1238, \'August 14 - Day 26: 24 miles\', \'Leave Edoras. Turn west on the road to Helm’s Deep.\', NULL, \'FitDistanceDailySummary\', 5101.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1296, 1238, \'August 14 - Day 26: 24 miles\', \'Ford the Snowbourne.\', NULL, \'FitDistanceDailySummary\', 5102.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1297, 1238, \'August 14 - Day 26: 24 miles\', \'Cross a small stream.\', NULL, \'FitDistanceDailySummary\', 5125.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1298, 1238, \'August 15 - Day 27: 24 miles\', \'Cross a small stream.\', NULL, \'FitDistanceDailySummary\', 5138.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1299, 1238, \'August 15 - Day 27: 24 miles\', \'Cross a small stream. Camp.\', NULL, \'FitDistanceDailySummary\', 5149.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1300, 1238, \'August 16 - Day 28: 24 miles\', \'Cross a small stream.\', NULL, \'FitDistanceDailySummary\', 5165.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1301, 1238, \'August 16 - Day 28: 24 miles\', \'Cross a small stream.\', NULL, \'FitDistanceDailySummary\', 882, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1302, 1238, \'August 16 - Day 28: 24 miles\', \'Camp.\', NULL, \'FitDistanceDailySummary\', 5173.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1303, 1238, \'August 17 - Day 29: 24 miles\', \'Cross a small stream.\', NULL, \'FitDistanceDailySummary\', 5188.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1304, 1238, \'August 17 - Day 29: 24 miles\', \'Cross a small stream.\', NULL, \'FitDistanceDailySummary\', 905, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1305, 1238, \'August 17 - Day 29: 24 miles\', \'Camp.\', NULL, \'FitDistanceDailySummary\', 5197.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1306, 1238, \'August 18 - Day 30: 23 miles\', \'Reach the road to the Deeping Coomb and Helm’s Deep. Turn south.\', NULL, \'FitDistanceDailySummary\', 5210.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1307, 1238, \'August 18 - Day 30: 23 miles\', \'Climb upward through the Coomb.\', NULL, \'FitDistanceDailySummary\', 5216.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1308, 1238, \'August 18 - Day 30: 23 miles\', \'Pass through Helm’s Dike.\', NULL, \'FitDistanceDailySummary\', 5220, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1309, 1238, \'August 18 - Day 30: 23 miles\', \'Reach Helm’s Deep. Enter the Hornburg.\', NULL, \'FitDistanceDailySummary\', 5220.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1310, 1238, \'August 21 - Day 33: 40 miles\', \'Leave Helm’s Deep.\', NULL, \'FitDistanceDailySummary\', 5220.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1311, 1238, \'August 21 - Day 33: 40 miles\', \'Pass through Helm’s Dike. Ride down the Deeping Coomb.\', NULL, \'FitDistanceDailySummary\', 5221, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1312, 1238, \'August 21 - Day 33: 40 miles\', \'Reach the beaten road and turn west to the Fords of Isen.\', NULL, \'FitDistanceDailySummary\', 5230.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1313, 1238, \'August 21 - Day 33: 40 miles\', \'The peaks of the Thrihyrne rise to the south.\', NULL, \'FitDistanceDailySummary\', 5236.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1314, 1238, \'August 21 - Day 33: 40 miles\', \'Cross the Fords of Isen. Pass the burial mound of Erkenbrand’s Riders.\', NULL, \'FitDistanceDailySummary\', 5245.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1315, 1238, \'August 21 - Day 33: 40 miles\', \'Turn north on the highway to Isengard.\', NULL, \'FitDistanceDailySummary\', 5246.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1316, 1238, \'August 21 - Day 33: 40 miles\', \'Camp 15 miles north of the Fords - the same campsite as March 4.\', NULL, \'FitDistanceDailySummary\', 5260.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1317, 1238, \'August 22 - Day 34: 16 miles\', \'Enter the south end of the Wizard’s Vale.\', NULL, \'FitDistanceDailySummary\', 5262.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1318, 1238, \'August 22 - Day 34: 16 miles\', \'All around are newly planted trees and shrubs.\', NULL, \'FitDistanceDailySummary\', 5266.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1319, 1238, \'August 22 - Day 34: 16 miles\', \'Highway becomes a wide street, paved with stones.\', NULL, \'FitDistanceDailySummary\', 5270.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1320, 1238, \'August 22 - Day 34: 16 miles\', \'The rubble from pillar of the White Hand now surrounds a sapling.\', NULL, \'FitDistanceDailySummary\', 5272.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1321, 1238, \'August 22 - Day 34: 16 miles\', \'All is green and growing.\', NULL, \'FitDistanceDailySummary\', 5274.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1322, 1238, \'August 22 - Day 34: 16 miles\', \'Reach the circle of Isengard, but the stone-circle is gone. A tall tree stands on each side of the old gateway, with a green path to Orthanc. \', NULL, \'FitDistanceDailySummary\', 5276, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1323, 1238, \'August 22 - Day 34: 16 miles\', \'Saruman’s Isengard is no more.\', NULL, \'FitDistanceDailySummary\', 5276.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1324, 227, \'The Road Home: Isengard to Rivendell\', \'\', NULL, \'FitDistanceDailySummary\', NULL, \'flow\', NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1325, 1324, \'Continue August 22 - Day 34: 17 miles\', \'Saruman’s Isengard is no more. The Ents have transformed it into the Treegarth of Orthanc. The Tower rises from a mirroring lake, with an east-running stream feeding the Isen. All the circle is filled with trees and orchards. Treebeard tells Gandalf of Saruman’s release. Legolas and Gimli say farewell, and turn east to go home via Fangorn Forest.\', NULL, \'FitDistanceDailySummary\', 5276.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1326, 1324, \'Continue August 22 - Day 34: 17 miles\', \'Pass from the circle of Isengard. Follow the stone-paved road south.\', NULL, \'FitDistanceDailySummary\', 5277, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1327, 1324, \'Continue August 22 - Day 34: 17 miles\', \'All is green and growing.\', NULL, \'FitDistanceDailySummary\', 5278.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1328, 1324, \'Continue August 22 - Day 34: 17 miles\', \'Pass the sapling at the old pillar of the White Hand.\', NULL, \'FitDistanceDailySummary\', 5280.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1329, 1324, \'Continue August 22 - Day 34: 17 miles\', \'Stone pavement ends. Highway continues.\', NULL, \'FitDistanceDailySummary\', 5282.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1330, 1324, \'Continue August 22 - Day 34: 17 miles\', \'All around are newly planted trees and shrubs.\', NULL, \'FitDistanceDailySummary\', 5286.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1331, 1324, \'Continue August 22 - Day 34: 17 miles\', \'Leave the Wizard’s Vale.\', NULL, \'FitDistanceDailySummary\', 5290.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1332, 1324, \'Continue August 22 - Day 34: 17 miles\', \'Reach the campsite of the night before. Sunset. Final Separation: Aragorn and his knights ride on toward the Fords. Travellers turn west.\', NULL, \'FitDistanceDailySummary\', 5292.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1333, 1324, \'Continue August 22 - Day 34: 17 miles\', \'Camp in the dell next to the south-facing slope of Dol Baran, the last hill of the northern ranges. Here Pippin looked into the palantír.\', NULL, \'FitDistanceDailySummary\', 5293.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1334, 1324, \'August 23 - Day 35: 28 miles\', \'Curve west from Dol Baran around the foothills of Methedras.\', NULL, \'FitDistanceDailySummary\', 5293.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1335, 1324, \'August 23 - Day 35: 28 miles\', \'Camp. Still in the Gap of Rohan. White Mountains only ca. 50 miles south.\', NULL, \'FitDistanceDailySummary\', 5321.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1336, 1324, \'August 24 - Day 36: 30 miles\', \'Continue west near foothills.\', NULL, \'FitDistanceDailySummary\', 5321.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1337, 1324, \'August 24 - Day 36: 30 miles\', \'Turn slightly north. Open lands widen into wasted plains of Dunland.\', NULL, \'FitDistanceDailySummary\', 5336.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1338, 1324, \'August 24 - Day 36: 30 miles\', \'Camp by a small stream.\', NULL, \'FitDistanceDailySummary\', 5351.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1339, 1324, \'August 25 - Day 37: 30 miles\', \'Cross stream. Turn northwest.\', NULL, \'FitDistanceDailySummary\', 5351.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1340, 1324, \'August 25 - Day 37: 30 miles\', \'Dunlendings see company and hide.\', NULL, \'FitDistanceDailySummary\', 5366.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1341, 1324, \'August 25 - Day 37: 30 miles\', \'Camp at base of an out-thrust hill of Methedras.\', NULL, \'FitDistanceDailySummary\', 5381.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1342, 1324, \'August 26 - Day 38: 30 miles\', \'Continue riding almost due north.\', NULL, \'FitDistanceDailySummary\', 5381.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1343, 1324, \'August 26 - Day 38: 30 miles\', \'Cross a small stream.\', NULL, \'FitDistanceDailySummary\', 5387.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1344, 1324, \'August 26 - Day 38: 30 miles\', \'Hills draw away to east. Wide plains lie west.\', NULL, \'FitDistanceDailySummary\', 5396.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1345, 1324, \'August 26 - Day 38: 30 miles\', \'Reach the remains of the roadway to Tharbad. Camp.\', NULL, \'FitDistanceDailySummary\', 5411.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1346, 1324, \'August 27 - Day 39: 30 miles\', \'Follow the old roadway northwest.\', NULL, \'FitDistanceDailySummary\', 5411.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1347, 1324, \'August 27 - Day 39: 30 miles\', \'See woods in the distance across the roadway.\', NULL, \'FitDistanceDailySummary\', 5426.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1348, 1324, \'August 27 - Day 39: 30 miles\', \'Snowcapped peak of Methedras rises due east.\', NULL, \'FitDistanceDailySummary\', 5431.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1349, 1324, \'August 27 - Day 39: 30 miles\', \'Stop at a small stream. Woods lie to east and north. Camp.\', NULL, \'FitDistanceDailySummary\', 5441.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1350, 1324, \'August 28 - Day 40: 30 miles\', \'Cross stream and enter the woods.\', NULL, \'FitDistanceDailySummary\', 5441.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1351, 1324, \'August 28 - Day 40: 30 miles\', \'Woods extend further west, into a valley between two streams.\', NULL, \'FitDistanceDailySummary\', 5451.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1352, 1324, \'August 28 - Day 40: 30 miles\', \'A root of Methedras reaches west toward the road.\', NULL, \'FitDistanceDailySummary\', 5461.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1353, 1324, \'August 28 - Day 40: 30 miles\', \'Leave wood just before sunset. Overtake Saruman and Grima Wormtongue walking north also. Saruman turns west with Grima.\', NULL, \'FitDistanceDailySummary\', 5469.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1354, 1324, \'August 28 - Day 40: 30 miles\', \'Company stops by a stream. Camp.\', NULL, \'FitDistanceDailySummary\', 5471.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1355, 1324, \'August 29 - Day 41: 30 miles\', \'Cross stream. Enter Northern Dunland. Continue on roadway.\', NULL, \'FitDistanceDailySummary\', 5471.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1356, 1324, \'August 29 - Day 41: 30 miles\', \'Empty land, though green and pleasant.\', NULL, \'FitDistanceDailySummary\', 5486.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1357, 1324, \'August 29 - Day 41: 30 miles\', \'Camp.\', NULL, \'FitDistanceDailySummary\', 5501.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1358, 1324, \'August 30 - Day 42: 30 miles\', \'Continue northwest on roadway.\', NULL, \'FitDistanceDailySummary\', 5501.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1359, 1324, \'August 30 - Day 42: 30 miles\', \'Draw farther and farther from the mountains and foothills.\', NULL, \'FitDistanceDailySummary\', 5516.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1360, 1324, \'August 30 - Day 42: 30 miles\', \'Camp.\', NULL, \'FitDistanceDailySummary\', 5531.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1361, 1324, \'September 1 - Day 43: 30 miles\', \'Continue northwest on roadway.\', NULL, \'FitDistanceDailySummary\', 5531.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1362, 1324, \'September 1 - Day 43: 30 miles\', \'Reach a point where the land drops into the valley of the Greyflood. Turn northeast from the roadway and follow the ridge of the upland shelf. Weather golden.\', NULL, \'FitDistanceDailySummary\', 5541.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1363, 1324, \'September 1 - Day 43: 30 miles\', \'Camp in plains. Marshes of the Swanfleet lie to the north.\', NULL, \'FitDistanceDailySummary\', 5561.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1364, 1324, \'September 2 - Day 44: 30 miles\', \'Continue northeast. \', NULL, \'FitDistanceDailySummary\', 5561.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1365, 1324, \'September 2 - Day 44: 30 miles\', \'Continue to follow the eastern edge of the upland shelf.\', NULL, \'FitDistanceDailySummary\', 5576.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1366, 1324, \'September 2 - Day 44: 30 miles\', \'Camp in plains. Silver night.\', NULL, \'FitDistanceDailySummary\', 5591.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1367, 1324, \'September 3 - Day 45: 30 miles\', \'Continue northeast.\', NULL, \'FitDistanceDailySummary\', 5591.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1368, 1324, \'September 3 - Day 45: 30 miles\', \'Can see mists above the fens of the Swanfleet delta.\', NULL, \'FitDistanceDailySummary\', 5601.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1369, 1324, \'September 3 - Day 45: 30 miles\', \'Cross the ford of the Swanfleet. West of the ford are falls where the river descends from the upland shelf to the lowlands of the Greyflood, spreading in a broad inland delta.\', NULL, \'FitDistanceDailySummary\', 5616.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1370, 1324, \'September 3 - Day 45: 30 miles\', \'Eregion - Turn east and follow the river.\', NULL, \'FitDistanceDailySummary\', 5617.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1371, 1324, \'September 3 - Day 45: 30 miles\', \'Camp by river.\', NULL, \'FitDistanceDailySummary\', 5621.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1372, 1324, \'September 4 - Day 46: 30 miles\', \'Continue east next to the river.\', NULL, \'FitDistanceDailySummary\', 5621.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1373, 1324, \'September 4 - Day 46: 30 miles\', \'Reach the ruins of Ost-en-Edhil, the former chief city of the Elf-realm of Hollin/Eregion. Camp at the confluence of the Glanduin and the Sirannon.\', NULL, \'FitDistanceDailySummary\', 5651.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1374, 1324, \'September 5 - Day 47: 30 miles\', \'Follow the Moria-road east on the north bank of the Sirannon.\', NULL, \'FitDistanceDailySummary\', 5651.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1375, 1324, \'September 5 - Day 47: 30 miles\', \'Valley deepens. Road runs above the valleyway.\', NULL, \'FitDistanceDailySummary\', 5666.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1376, 1324, \'September 5 - Day 47: 30 miles\', \'Camp.\', NULL, \'FitDistanceDailySummary\', 5681.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1377, 1324, \'September 6 - Day 48: 35 miles\', \'Continue east on Moria-road. Mountains of Moria rise ahead of them.\', NULL, \'FitDistanceDailySummary\', 5681.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1378, 1324, \'September 6 - Day 48: 35 miles\', \'Turn northeast from the road.\', NULL, \'FitDistanceDailySummary\', 5706.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1379, 1324, \'September 6 - Day 48: 35 miles\', \'Reach the hill where the Fellowship had sheltered from the Warg attack. Camp.\', NULL, \'FitDistanceDailySummary\', 5716.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1380, 1324, \'September 13 - Day 55: 28 miles\', \'Galadriel, Celeborn, and others from Lórien depart. Travel NE toward the Redhorn Gate. Others watch until see the flash of Galadriel’s ring. Gandalf and the hobbits start for Rivendell. Travel northwest from the hill.\nNote: This journey takes only 9 days vs. 20 days for the Fellowship going south. The need for stealth can carry a high price, time-wise - and ponies go faster than hobbits!\', NULL, \'FitDistanceDailySummary\', 5716.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1381, 1324, \'September 13 - Day 55: 28 miles\', \'Camp.\', NULL, \'FitDistanceDailySummary\', 5744.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1382, 1324, \'September 14 - Day 56: 28 miles\', \'Continue northwest from the hill.\nNote: This journey is about 25 - 30 miles west of the path taken by the Fellowship.\', NULL, \'FitDistanceDailySummary\', 5744.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1383, 1324, \'September 14 - Day 56: 28 miles\', \'Open country. Gentle slopes, easier for the ponies.\', NULL, \'FitDistanceDailySummary\', 5751.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1384, 1324, \'September 14 - Day 56: 28 miles\', \'Cross a small stream. Camp. Due east Caradhras glows in sunset.\', NULL, \'FitDistanceDailySummary\', 5772.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1385, 1324, \'September 15 - Day 57: 29 miles\', \'Turn due north.\', NULL, \'FitDistanceDailySummary\', 5772.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1386, 1324, \'September 15 - Day 57: 29 miles\', \'Reach the foot of Hollin Ridge. Begin to climb, angling west.\', NULL, \'FitDistanceDailySummary\', 5796.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1387, 1324, \'September 15 - Day 57: 29 miles\', \'Camp atop Hollin Ridge among the large smooth towering rocks.\', NULL, \'FitDistanceDailySummary\', 5801.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1388, 1324, \'September 16 - Day 58: 28 miles\', \'Start down the north side of the ridge. Thread their way between rocks.\', NULL, \'FitDistanceDailySummary\', 5801.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1389, 1324, \'September 16 - Day 58: 28 miles\', \'Reach the base of the ridge. Turn northeast.\', NULL, \'FitDistanceDailySummary\', 5806.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1390, 1324, \'September 16 - Day 58: 28 miles\', \'Cross a small stream.\', NULL, \'FitDistanceDailySummary\', 5816.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1391, 1324, \'September 16 - Day 58: 28 miles\', \'Camp west of a hill.\', NULL, \'FitDistanceDailySummary\', 5829.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1392, 1324, \'September 17 - Day 59: 28 miles\', \'Continue northeast.\', NULL, \'FitDistanceDailySummary\', 5829.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1393, 1324, \'September 17 - Day 59: 28 miles\', \'Land becomes more rugged to the east.\', NULL, \'FitDistanceDailySummary\', 5841.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1394, 1324, \'September 17 - Day 59: 28 miles\', \'Descend a slope to a small stream valley. Camp by stream.\', NULL, \'FitDistanceDailySummary\', 5857.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1395, 1324, \'September 18 - Day 60: 28 miles\', \'Cross stream and ride east alongside it.\', NULL, \'FitDistanceDailySummary\', 5857.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1396, 1324, \'September 18 - Day 60: 28 miles\', \'Climb out of stream valley. Continue northeast.\', NULL, \'FitDistanceDailySummary\', 5858.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1397, 1324, \'September 18 - Day 60: 28 miles\', \'Reach crest of a hill. Start down at an angle.\', NULL, \'FitDistanceDailySummary\', 5871.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1398, 1324, \'September 18 - Day 60: 28 miles\', \'Reach a small stream. Marshy area lies to the west. Camp.\', NULL, \'FitDistanceDailySummary\', 5885.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1399, 1324, \'September 19 - Day 61: 28 miles\', \'Cross the stream and follow valley east-northeast.\', NULL, \'FitDistanceDailySummary\', 5885.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1400, 1324, \'September 19 - Day 61: 28 miles\', \'Climb northeast up a slope. In the west, the marsh ends.\', NULL, \'FitDistanceDailySummary\', 5891.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1401, 1324, \'September 19 - Day 61: 28 miles\', \'Turn north. Start downhill again.\', NULL, \'FitDistanceDailySummary\', 5901.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1402, 1324, \'September 19 - Day 61: 28 miles\', \'Cross a small stream. Camp.\', NULL, \'FitDistanceDailySummary\', 5913.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1403, 1324, \'September 20 - Day 62: 28 miles\', \'To the west the Loudwater/Bruinen now runs in a deep valley and the surrounding terrain is too rugged to cross easily. Turn northeast again. \nNote: Gradually they have returned to the path followed south by the Fellowship.\', NULL, \'FitDistanceDailySummary\', 5913.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1404, 1324, \'September 20 - Day 62: 28 miles\', \'Cross a small stream.\', NULL, \'FitDistanceDailySummary\', 5926.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1405, 1324, \'September 20 - Day 62: 28 miles\', \'Cross a small stream. Camp.\', NULL, \'FitDistanceDailySummary\', 5941.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1406, 1324, \'September 21 - Day 63: 28 miles\', \'Turn slightly west of north.\', NULL, \'FitDistanceDailySummary\', 5941.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1407, 1324, \'September 21 - Day 63: 28 miles\', \'Reach Ford of Bruinen. Follow stone-marked path NE to Rivendell.\', NULL, \'FitDistanceDailySummary\', 5961.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1408, 1324, \'September 21 - Day 63: 28 miles\', \'Come to the valley of Rivendell and descend zig-zag road.\', NULL, \'FitDistanceDailySummary\', 5968.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1409, 1324, \'September 21 - Day 63: 28 miles\', \'Reach the Last Homely House.\', NULL, \'FitDistanceDailySummary\', 5969.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1410, 227, \'The Road Home: Rivendell to Bag End\', \'\', NULL, \'FitDistanceDailySummary\', NULL, \'flow\', NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1411, 1410, \'October 5 - Day 77: 7 miles\', \'Leave the Last Homely House - mid-morning. Cold.\', NULL, \'FitDistanceDailySummary\', 5969.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1412, 1410, \'October 5 - Day 77: 7 miles\', \'Climb out of the valley of Rivendell. Ride slowly.\', NULL, \'FitDistanceDailySummary\', 5970.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1413, 1410, \'October 5 - Day 77: 7 miles\', \'Camp northeast of the Ford of Bruinen.\', NULL, \'FitDistanceDailySummary\', 5976.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1414, 1410, \'October 6 - Day 78: 10 miles\', \'Continue slowly.\', NULL, \'FitDistanceDailySummary\', 5976.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1415, 1410, \'October 6 - Day 78: 10 miles\', \'Reach the Ford. Frodo hesitates to cross. He is in pain: anniversary of his wounding on Weathertop. Continue across the Ford.\', NULL, \'FitDistanceDailySummary\', 5977.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1416, 1410, \'October 6 - Day 78: 10 miles\', \'Road climbs through a cutting of red stone topped with tall pines.\', NULL, \'FitDistanceDailySummary\', 5978.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1417, 1410, \'October 6 - Day 78: 10 miles\', \'Road continues gently uphill. Much grass on sides. Hills on the north.\', NULL, \'FitDistanceDailySummary\', 5981.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1418, 1410, \'October 6 - Day 78: 10 miles\', \'Camp south side of road.\', NULL, \'FitDistanceDailySummary\', 5986.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1419, 1410, \'October 7 - Day 79: 10 miles\', \'Continue west-southwest along road, riding slowly. Frodo still ill.\', NULL, \'FitDistanceDailySummary\', 5986.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1420, 1410, \'October 7 - Day 79: 10 miles\', \'Cross a small stream. Road bends more SW, skirting the feet of the Trollshaws. The steep ravine of the Bruinen also runs WSW not far S.\', NULL, \'FitDistanceDailySummary\', 5988.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1421, 1410, \'October 7 - Day 79: 10 miles\', \'Eat. Frodo begins to feel better.\', NULL, \'FitDistanceDailySummary\', 5991.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1422, 1410, \'October 7 - Day 79: 10 miles\', \'Camp near a valley from the north.\', NULL, \'FitDistanceDailySummary\', 5996.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1423, 1410, \'October 8 - Day 80: 10 miles\', \'Leave after a leisurely breakfast.\', NULL, \'FitDistanceDailySummary\', 5996.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1424, 1410, \'October 8 - Day 80: 10 miles\', \'Bruinen turns more to the south.\', NULL, \'FitDistanceDailySummary\', 5998.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1425, 1410, \'October 8 - Day 80: 10 miles\', \'Eat. Rest. Can see ruins on hilltop to the north.\', NULL, \'FitDistanceDailySummary\', 6001.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1426, 1410, \'October 8 - Day 80: 10 miles\', \'Camp near a valley from the north.\', NULL, \'FitDistanceDailySummary\', 6006.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1427, 1410, \'October 9 - Day 81: 10 miles\', \'Road now runs due west.\', NULL, \'FitDistanceDailySummary\', 6006.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1428, 1410, \'October 9 - Day 81: 10 miles\', \'Eat below out-thrust ‘toe’ of a hill.\', NULL, \'FitDistanceDailySummary\', 6011.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1429, 1410, \'October 9 - Day 81: 10 miles\', \'Camp. Wander in autumn woods which run into the valley on the north.\', NULL, \'FitDistanceDailySummary\', 6016.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1430, 1410, \'October 10 - Day 82: 10 miles\', \'Continue west on road through woods.\', NULL, \'FitDistanceDailySummary\', 6016.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1431, 1410, \'October 10 - Day 82: 10 miles\', \'Leave woods.\', NULL, \'FitDistanceDailySummary\', 6018.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1432, 1410, \'October 10 - Day 82: 10 miles\', \'Eat.\', NULL, \'FitDistanceDailySummary\', 6021.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1433, 1410, \'October 10 - Day 82: 10 miles\', \'Camp. Still warm.\', NULL, \'FitDistanceDailySummary\', 6026.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1434, 1410, \'October 11 - Day 83: 1 miles\', \'Road now turns northwest. Still skirts hills.\', NULL, \'FitDistanceDailySummary\', 6026.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1435, 1410, \'October 11 - Day 83: 1 miles\', \'Reach pathway to Stone Trolls. Sam tells Frodo what happened there.\', NULL, \'FitDistanceDailySummary\', 6027.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1436, 1410, \'October 12 - Day 84: 9 miles\', \'Eat. Continue northwest on the road.\', NULL, \'FitDistanceDailySummary\', 6027.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1437, 1410, \'October 12 - Day 84: 9 miles\', \'Road climbs over an out-thrust hill from north. Hills now also south of road with valleys running SW to Hoarwell.\', NULL, \'FitDistanceDailySummary\', 6031.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1438, 1410, \'October 12 - Day 84: 9 miles\', \'Reach hillcrest. Can see Hoarwell below. \', NULL, \'FitDistanceDailySummary\', 6034.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1439, 1410, \'October 12 - Day 84: 9 miles\', \'Ruins on hilltop north of road. Camp in a SW-running valley.\', NULL, \'FitDistanceDailySummary\', 6036.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1440, 1410, \'October 13 - Day 85: 10 miles\', \'Road rounds ‘toe’ of a hill from the north: the end of the Trollshaws.\', NULL, \'FitDistanceDailySummary\', 6036.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1441, 1410, \'October 13 - Day 85: 10 miles\', \'Pass point where Strider led them north from road (exactly 1 year ago).\', NULL, \'FitDistanceDailySummary\', 6040.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1442, 1410, \'October 13 - Day 85: 10 miles\', \'Cross The Last Bridge. Road now turns more to the west. Eat.\', NULL, \'FitDistanceDailySummary\', 6041.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1443, 1410, \'October 13 - Day 85: 10 miles\', \'Reach northeast end of valley which they had followed from Weathertop. They pass by and continue WNW on the road into the Lone-lands.\', NULL, \'FitDistanceDailySummary\', 6043.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1444, 1410, \'October 13 - Day 85: 10 miles\', \'Weather still fair. Camp.\', NULL, \'FitDistanceDailySummary\', 6046.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1445, 1410, \'October 14 - Day 86: 15 miles\', \'Road swings northwest through open country. South of the road are bushes and stunted trees: wild and pathless. Ride now more quickly.\', NULL, \'FitDistanceDailySummary\', 6046.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1446, 1410, \'October 14 - Day 86: 15 miles\', \'Camp.\', NULL, \'FitDistanceDailySummary\', 6061.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1447, 1410, \'October 15 - Day 87: 15 miles\', \'Road curves more to west. Open country. No streams\', NULL, \'FitDistanceDailySummary\', 6061.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1448, 1410, \'October 15 - Day 87: 15 miles\', \'Camp..\', NULL, \'FitDistanceDailySummary\', 6076.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1449, 1410, \'October 16 - Day 88: 15 miles\', \'Continue west. Far ahead begin to see tops of the Weather Hills.\', NULL, \'FitDistanceDailySummary\', 6076.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1450, 1410, \'October 16 - Day 88: 15 miles\', \'Camp.\', NULL, \'FitDistanceDailySummary\', 6091.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1451, 1410, \'October 17 - Day 89: 15 miles\', \'Continue west on road. \', NULL, \'FitDistanceDailySummary\', 6091.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1452, 1410, \'October 17 - Day 89: 15 miles\', \'Weather hills slowly rise on the horizon.\', NULL, \'FitDistanceDailySummary\', 6098.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1453, 1410, \'October 17 - Day 89: 15 miles\', \'Camp.\', NULL, \'FitDistanceDailySummary\', 6106.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1454, 1410, \'October 18 - Day 90: 15 miles\', \'Continue west.\', NULL, \'FitDistanceDailySummary\', 6106.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1455, 1410, \'October 18 - Day 90: 15 miles\', \'Road turns slightly to the south. Hills now are more prominent.\', NULL, \'FitDistanceDailySummary\', 6111.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1456, 1410, \'October 18 - Day 90: 15 miles\', \'Camp.\', NULL, \'FitDistanceDailySummary\', 6121.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1457, 1410, \'October 19 - Day 91: 15 miles\', \'Road now runs southwest. Weathertop becomes visible straight ahead.\', NULL, \'FitDistanceDailySummary\', 6121.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1458, 1410, \'October 19 - Day 91: 15 miles\', \'Camp. Weather still is warm and clear.\', NULL, \'FitDistanceDailySummary\', 6136.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1459, 1410, \'October 20 - Day 92: 15 miles\', \'Road continues southwest. Land rises slowly toward Hills.\', NULL, \'FitDistanceDailySummary\', 6136.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1460, 1410, \'October 20 - Day 92: 15 miles\', \'Camp. Weathertop lies just south of due west.\', NULL, \'FitDistanceDailySummary\', 6151.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1461, 1410, \'October 21 - Day 93: 20 miles\', \'Hurry along the road.\', NULL, \'FitDistanceDailySummary\', 6151.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1462, 1410, \'October 21 - Day 93: 20 miles\', \'Pass the first foothills below Weathertop.\', NULL, \'FitDistanceDailySummary\', 6156.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1463, 1410, \'October 21 - Day 93: 20 miles\', \'Road reaches southeastern foot of Weathertop. Eat in haste.\', NULL, \'FitDistanceDailySummary\', 6161.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1464, 1410, \'October 21 - Day 93: 20 miles\', \'Weathertop immediately north of road. Frodo refuses to look at it. As the shadows lengthen, they continue hurriedly past.\', NULL, \'FitDistanceDailySummary\', 6166.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1465, 1410, \'October 21 - Day 93: 20 miles\', \'Camp. Weather turns damp and cold.\', NULL, \'FitDistanceDailySummary\', 6171.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1466, 1410, \'October 22 - Day 94: 15 miles\', \'Road continues south to swing south of the Midgewater Marshes.\', NULL, \'FitDistanceDailySummary\', 6171.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1467, 1410, \'October 22 - Day 94: 15 miles\', \'Weather turns wet and cold.\', NULL, \'FitDistanceDailySummary\', 6176.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1468, 1410, \'October 22 - Day 94: 15 miles\', \'Land now slopes slowly downhill, away from Weathertop.\', NULL, \'FitDistanceDailySummary\', 6181.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1469, 1410, \'October 22 - Day 94: 15 miles\', \'Camp. Damp and cold.\', NULL, \'FitDistanceDailySummary\', 6186.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1470, 1410, \'October 23 - Day 95: 15 miles\', \'Road continues southwest and slowly downhill. \', NULL, \'FitDistanceDailySummary\', 6186.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1471, 1410, \'October 23 - Day 95: 15 miles\', \'Reach the southeast edge of the Midgewater Marshes.\', NULL, \'FitDistanceDailySummary\', 6201.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1472, 1410, \'October 24 - Day 96: 16 miles\', \'Road curves west around southern edge of the Marshes.\', NULL, \'FitDistanceDailySummary\', 6201.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1473, 1410, \'October 24 - Day 96: 16 miles\', \'Drizzly all day. Ride a bit more quickly.\', NULL, \'FitDistanceDailySummary\', 6211.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1474, 1410, \'October 24 - Day 96: 16 miles\', \'Camp due south of the Marshes.\', NULL, \'FitDistanceDailySummary\', 6217.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1475, 1410, \'October 25 - Day 97: 16 miles\', \'Road curves slightly north of west. Marshes fill all the northern horizon.\', NULL, \'FitDistanceDailySummary\', 6217.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1476, 1410, \'October 25 - Day 97: 16 miles\', \'Camp. Marshes farther north from the road.\', NULL, \'FitDistanceDailySummary\', 6233.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1477, 1410, \'October 26 - Day 98: 16 miles\', \'Road continues west-northwest.\', NULL, \'FitDistanceDailySummary\', 6233.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1478, 1410, \'October 26 - Day 98: 16 miles\', \'Can see western edge of the Marshes through the misty rain.\', NULL, \'FitDistanceDailySummary\', 6241.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1479, 1410, \'October 26 - Day 98: 16 miles\', \'Still drizzly. Camp.\', NULL, \'FitDistanceDailySummary\', 6249.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1480, 1410, \'October 27 - Day 99: 16 miles\', \'Road continues west-northwest. Rises slightly uphill.\', NULL, \'FitDistanceDailySummary\', 6249.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1481, 1410, \'October 27 - Day 99: 16 miles\', \'Begin to see the Chetwood in distance ahead. Dark through the rain.\', NULL, \'FitDistanceDailySummary\', 6255.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1482, 1410, \'October 27 - Day 99: 16 miles\', \'Rain becomes heavy. West wind. Reach the south edge of the Chetwood. Trees nearly barren.\', NULL, \'FitDistanceDailySummary\', 6259.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1483, 1410, \'October 27 - Day 99: 16 miles\', \'Camp in stables of The Forsaken Inn: inn now closed. Rains all night.\nNote: Bilbo stayed at the inn nearly 80 years before.\', NULL, \'FitDistanceDailySummary\', 6265.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1484, 1410, \'October 28 - Day 100: 16 miles\', \'Continue NW toward Bree. Bree-hill is hidden in the “curtain of rain.”\', NULL, \'FitDistanceDailySummary\', 6265.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1485, 1410, \'October 28 - Day 100: 16 miles\', \'Continue uphill along road next to the heart of the Chetwood.\', NULL, \'FitDistanceDailySummary\', 6270.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1486, 1410, \'October 28 - Day 100: 16 miles\', \'Pass spot where Strider had led them north from the road.\', NULL, \'FitDistanceDailySummary\', 6275.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1487, 1410, \'October 28 - Day 100: 16 miles\', \'Reach the South-gate of Bree: Locked. Have to call many times.\', NULL, \'FitDistanceDailySummary\', 6280.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1488, 1410, \'October 28 - Day 100: 16 miles\', \'Bree - Arrive at The Prancing Pony. Talk with Butterbur. Sam learns ‘Bill the Pony’ has returned. Stay at the Inn.\', NULL, \'FitDistanceDailySummary\', 6281.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1489, 1410, \'October 30 - Day 102: 40 miles\', \'Leave Bree very early. Still raining. Bree-folk see them off.\', NULL, \'FitDistanceDailySummary\', 6281.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1490, 1410, \'October 30 - Day 102: 40 miles\', \'Gandalf turns south to visit Tom Bombadil. Ride on as fast as possible.\nNote: This is at the same place Tom had brought the hobbits back to the Road.\', NULL, \'FitDistanceDailySummary\', 6285.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1491, 1410, \'October 30 - Day 102: 40 miles\', \'The Old Forest begins to the south, but is hidden in the rain.\', NULL, \'FitDistanceDailySummary\', 6297.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1492, 1410, \'October 30 - Day 102: 40 miles\', \'Hobbits continue on at a fast pace. Forest is now quite close, but still hidden in the rain.\', NULL, \'FitDistanceDailySummary\', 6305.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1493, 1410, \'October 30 - Day 102: 40 miles\', \'Sunset makes the ride even darker.\', NULL, \'FitDistanceDailySummary\', 6311.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1494, 1410, \'October 30 - Day 102: 40 miles\', \'Reach the Brandywine Bridge late in the evening. Gates bar the way. When refused entry, Merry and Pippin climb the gate. Confront Bill Ferny. Spend the night in the Bridge-house with Shirriffs.\', NULL, \'FitDistanceDailySummary\', 6321.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1495, 1410, \'November 1 - Day 103: 22 miles\', \'Decide to go straight to Hobbiton. Go west on the Road. Grey, but calm.\', NULL, \'FitDistanceDailySummary\', 6321.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1496, 1410, \'November 1 - Day 103: 22 miles\', \'See smoke rising several places, especially in Woody End to the south.\', NULL, \'FitDistanceDailySummary\', 6331.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1497, 1410, \'November 1 - Day 103: 22 miles\', \'Frogmorton: Shirriffs ‘arrest’ Frodo and friends. Stay at Shirriff-house.\', NULL, \'FitDistanceDailySummary\', 6343.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1498, 1410, \'November 2 - Day 104: 18 miles\', \'10:00 a.m. Leave for Bywater. Merry makes Shirriffs march in front.\', NULL, \'FitDistanceDailySummary\', 6343.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1499, 1410, \'November 2 - Day 104: 18 miles\', \'Noon. Rest.\', NULL, \'FitDistanceDailySummary\', 6349.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1500, 1410, \'November 2 - Day 104: 18 miles\', \'Three-Farthing Stone (ca. 3 p.m.). Frodo and friends leave Shirriffs behind.\', NULL, \'FitDistanceDailySummary\', 6357.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1501, 1410, \'November 2 - Day 104: 18 miles\', \'Turn NW on Bywater Road. High banks with hedges rise on each side.\', NULL, \'FitDistanceDailySummary\', 6359.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1502, 1410, \'November 2 - Day 104: 18 miles\', \'Reach Bywater in late afternoon. All houses shut. Meet ruffians at west end of town. When confronted by Merry, Pippin and Sam, ruffians run. Merry blows the horn of Rohan, rallies hobbits. Pippin heads to Tookland to gather support. Merry sets trap: first Battle of Bywater. Frodo, Sam and Merry spend night with Farmer Cotton.\', NULL, \'FitDistanceDailySummary\', 6361.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1503, 1410, \'November 3 - Day 105: 5 miles\', \'Eat late lunch at Cottons, then leave for Hobbiton. \', NULL, \'FitDistanceDailySummary\', 6361.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1504, 1410, \'November 3 - Day 105: 5 miles\', \'Go west along Hobbiton Road. All trees felled along the road.\', NULL, \'FitDistanceDailySummary\', 6363.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1505, 1410, \'November 3 - Day 105: 5 miles\', \'Reach bridge. Turn north across the Water. Much destroyed in Hobbiton. Can see the Hill ahead. Party Tree has been cut down.\', NULL, \'FitDistanceDailySummary\', 6366, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1506, 1410, \'November 3 - Day 105: 5 miles\', \'Reach Bag End with a large party of hobbits. Frodo confronts Saruman. Wormtongue slays Saruman, and is killed by hobbits. \nEnd of the War of the Ring.\', NULL, \'FitDistanceDailySummary\', 6366.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1507, 227, \'Bag End To The Grey Havens\', \'\', NULL, \'FitDistanceDailySummary\', NULL, \'flow\', NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1508, 1507, \'Sept. 21 - Day 1: 18 miles\', \'Sam and Frodo leave Bag End during the morning: Frodo on his pony, Strider, and Sam on Bill. They go south on the lane into Hobbiton. Cross the bridge over The Water and turn west. \', NULL, \'FitDistanceDailySummary\', 6366.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1509, 1507, \'Sept. 21 - Day 1: 18 miles\', \'Follow lane west along The Water.\', NULL, \'FitDistanceDailySummary\', 6367.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1510, 1507, \'Sept. 21 - Day 1: 18 miles\', \'Come to the plank bridge over The Water: the way they had taken from Bag End during the Quest. Retracing their journey, they go south along a path.\', NULL, \'FitDistanceDailySummary\', 6369.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1511, 1507, \'Sept. 21 - Day 1: 18 miles\', \'Cross the Great East Road from the Brandywine Bridge. Enter Tookland.\', NULL, \'FitDistanceDailySummary\', 6371.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1512, 1507, \'Sept. 21 - Day 1: 18 miles\', \'Hobbiton can still be seen from first slopes of the Green Hill Country.\', NULL, \'FitDistanceDailySummary\', 6374, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1513, 1507, \'Sept. 21 - Day 1: 18 miles\', \'Hobbiton is hidden as slopes rise and fall.\', NULL, \'FitDistanceDailySummary\', 6375.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1514, 1507, \'Sept. 21 - Day 1: 18 miles\', \'Ride by a birch wood.\', NULL, \'FitDistanceDailySummary\', 6377.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1515, 1507, \'Sept. 21 - Day 1: 18 miles\', \'Reach Stock Road\', NULL, \'FitDistanceDailySummary\', 6381, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1516, 1507, \'Sept. 21 - Day 1: 18 miles\', \'Ride through a deeply cloven track between tall trees.\', NULL, \'FitDistanceDailySummary\', 6382, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1517, 1507, \'Sept. 21 - Day 1: 18 miles\', \'Climb a steep slope.\', NULL, \'FitDistanceDailySummary\', 6384, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1518, 1507, \'Sept. 21 - Day 1: 18 miles\', \'Camp - In a firwood just over top of the hill. Sleep by a large tree.\nNote: Same campsite as the one from the original journey.\', NULL, \'FitDistanceDailySummary\', 6384.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1519, 1507, \'Sept. 22 - Day 2: 37 miles\', \'They get water from the stream at the foot of the hill. “A little fall where the water fell a few feet over an outcrop of grey stone.”\', NULL, \'FitDistanceDailySummary\', 6384.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1520, 1507, \'Sept. 22 - Day 2: 37 miles\', \'Road rolls up and down.\', NULL, \'FitDistanceDailySummary\', 6386.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1521, 1507, \'Sept. 22 - Day 2: 37 miles\', \'Road zig-zigs to top of a steep bank and goes down for the last time. Can see across Woody End to the River. Continue on down the hill.\', NULL, \'FitDistanceDailySummary\', 6395.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1522, 1507, \'Sept. 22 - Day 2: 37 miles\', \'Road ahead runs fairly straight and level. Behind, it curves slightly. Sam points out the tree behind which Frodo had hidden from the Black Rider.\', NULL, \'FitDistanceDailySummary\', 6398.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1523, 1507, \'Sept. 22 - Day 2: 37 miles\', \'Stars are coming out as they reach the point where the road splits. The road to Stock bends left and goes down into the lowlands, while the path they took on their journey goes right, through ancient Oaks. Quite close to the road-meeting is the huge oak tree they had crept inside to eat. Standing beside it, they hear Elves singing: Galadriel, Celeborn, Elrond, and others appear on the valley road below, with Bilbo. Frodo and Sam join them.\', NULL, \'FitDistanceDailySummary\', 6403.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1524, 1507, \'Sept. 22 - Day 2: 37 miles\', \'The company takes the branching path a short distance, then turns southwest into the woods.\', NULL, \'FitDistanceDailySummary\', 6404.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1525, 1507, \'Sept. 22 - Day 2: 37 miles\', \'When they reach a woodland trail, they pass west through the woods, weaving through the Green-hill country. Continue all night.\', NULL, \'FitDistanceDailySummary\', 6406.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1526, 1507, \'Sept. 22 - Day 2: 37 miles\', \'Camp during the day (S. 23) at the south edge of the woods, still in the Green-hill country.\', NULL, \'FitDistanceDailySummary\', 6421.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1527, 1507, \'Sept. 23/24 - Day/Nt. 3: 35 miles\', \'Continue west at dusk.\', NULL, \'FitDistanceDailySummary\', 6421.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1528, 1507, \'Sept. 23/24 - Day/Nt. 3: 35 miles\', \'Pass south of Tuckburrow. Leave the hills and turn slightly more southwest.\', NULL, \'FitDistanceDailySummary\', 6431.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1529, 1507, \'Sept. 23/24 - Day/Nt. 3: 35 miles\', \'Cross the road from Sarn Ford to Waymeet.\', NULL, \'FitDistanceDailySummary\', 6436.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1530, 1507, \'Sept. 23/24 - Day/Nt. 3: 35 miles\', \'Pass now through open fields.\', NULL, \'FitDistanceDailySummary\', 6446.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1531, 1507, \'Sept. 23/24 - Day/Nt. 3: 35 miles\', \'Camp in the open lands (day: S. 24).\', NULL, \'FitDistanceDailySummary\', 6456.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1532, 1507, \'Sept. 24/25 - Day/Nt. 4: 35 miles\', \'Continue southwest across open land.\', NULL, \'FitDistanceDailySummary\', 6456.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1533, 1507, \'Sept. 24/25 - Day/Nt. 4: 35 miles\', \'Land begins to climb west toward the White Downs.\', NULL, \'FitDistanceDailySummary\', 6461.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1534, 1507, \'Sept. 24/25 - Day/Nt. 4: 35 miles\', \'Cross the road from Hardbottle.\', NULL, \'FitDistanceDailySummary\', 6466.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1535, 1507, \'Sept. 24/25 - Day/Nt. 4: 35 miles\', \'Skirt south of the higher hills of the White Downs. Turn more to the west.\', NULL, \'FitDistanceDailySummary\', 6471.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1536, 1507, \'Sept. 24/25 - Day/Nt. 4: 35 miles\', \'Beyond the Downs are grassy lowlands, almost uninhabited.\', NULL, \'FitDistanceDailySummary\', 6481.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1537, 1507, \'Sept. 24/25 - Day/Nt. 4: 35 miles\', \'Camp (day: S. 25).\', NULL, \'FitDistanceDailySummary\', 6491.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1538, 1507, \'Sept. 25/26 - Day/Nt. 5: 35 miles\', \'Curve now more north of west through grasslands.\', NULL, \'FitDistanceDailySummary\', 6491.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1539, 1507, \'Sept. 25/26 - Day/Nt. 5: 35 miles\', \'Land slopes gently up toward the Far Downs.\', NULL, \'FitDistanceDailySummary\', 6496.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1540, 1507, \'Sept. 25/26 - Day/Nt. 5: 35 miles\', \'Reach the crest of the Far Downs.\', NULL, \'FitDistanceDailySummary\', 6511.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1541, 1507, \'Sept. 25/26 - Day/Nt. 5: 35 miles\', \'Zig-zag down the steep face of the Downs.\', NULL, \'FitDistanceDailySummary\', 6512.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1542, 1507, \'Sept. 25/26 - Day/Nt. 5: 35 miles\', \'Reach the dry grasslands west of the Downs.\', NULL, \'FitDistanceDailySummary\', 6516.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1543, 1507, \'Sept. 25/26 - Day/Nt. 5: 35 miles\', \'Can see the Tower Hills on the western horizon. Camp day and night (S. 26).\', NULL, \'FitDistanceDailySummary\', 6526.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1544, 1507, \'Sept. 27 - Day 6: 35 miles\', \'Ride now during the day, through uninhabited lands.\', NULL, \'FitDistanceDailySummary\', 6526.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1545, 1507, \'Sept. 27 - Day 6: 35 miles\', \'Land begins to rise toward the Tower Hills.\', NULL, \'FitDistanceDailySummary\', 6546.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1546, 1507, \'Sept. 27 - Day 6: 35 miles\', \'Camp not far south of the Great East Road.\', NULL, \'FitDistanceDailySummary\', 6561.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1547, 1507, \'Sept. 28 - Day 7: 35 miles\', \'Continue northwest toward the Great East Road.\', NULL, \'FitDistanceDailySummary\', 6561.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1548, 1507, \'Sept. 28 - Day 7: 35 miles\', \'Reach the Great East Road. Turn west.\', NULL, \'FitDistanceDailySummary\', 6566.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1549, 1507, \'Sept. 28 - Day 7: 35 miles\', \'Road climbs the lowest slopes of the Tower Hills.\', NULL, \'FitDistanceDailySummary\', 6571.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1550, 1507, \'Sept. 28 - Day 7: 35 miles\', \'Road reaches the Towers at the crest of the hills. To the west they can see the waters of the Gulf of Lune. Continue downhill.\', NULL, \'FitDistanceDailySummary\', 6586.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1551, 1507, \'Sept. 28 - Day 7: 35 miles\', \'Camp just at the western feet of the Tower Hills.\', NULL, \'FitDistanceDailySummary\', 6596.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1552, 1507, \'Sept. 29 - Day 8: 30 miles\', \'Ride west on the Road toward the Grey Havens.\', NULL, \'FitDistanceDailySummary\', 6596.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1553, 1507, \'Sept. 29 - Day 8: 30 miles\', \'Land drops gently down toward the Gulf.\', NULL, \'FitDistanceDailySummary\', 6606.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1554, 1507, \'Sept. 29 - Day 8: 30 miles\', \'Land drops more rapidly and the waters are clearly visible to the horizon.\', NULL, \'FitDistanceDailySummary\', 6616.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1555, 1507, \'Sept. 29 - Day 8: 30 miles\', \'Begin to see towers of the Havens on both sides of the firth of Lune.\', NULL, \'FitDistanceDailySummary\', 6621.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1556, 1507, \'Sept. 29 - Day 8: 30 miles\', \'Reach the Gates of the south Haven. Are greeted by Círdan the Shipwright.\', NULL, \'FitDistanceDailySummary\', 6625.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1557, 1507, \'Sept. 29 - Day 8: 30 miles\', \'Reach the shore. See Gandalf and Shadowfax awaiting them. Merry and Pippin arrive as the party is boarding the White Ship. Frodo says farewell. End of the Fellowship of the Ring. The ship sails Into the West.\', NULL, \'FitDistanceDailySummary\', 6626.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1558, 1507, \'Continuing Sept. 29 - Day 8: 2 miles\', \'Sam, Merry and Pippin watch the ship as it passes out of sight, and remain watching far into the night.\', NULL, \'FitDistanceDailySummary\', 6626.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1559, 1507, \'Continuing Sept. 29 - Day 8: 2 miles\', \'At last they turn east and leave the Havens.\', NULL, \'FitDistanceDailySummary\', 6627.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1560, 1507, \'Continuing Sept. 29 - Day 8: 2 miles\', \'Go a short way on the Road and camp.\', NULL, \'FitDistanceDailySummary\', 6628.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1561, 1507, \'Sept. 30 - Day 9: 28 miles\', \'After breakfast, the hobbits ride east along the Road. Land rises steeply.\', NULL, \'FitDistanceDailySummary\', 6628.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1562, 1507, \'Sept. 30 - Day 9: 28 miles\', \'Slope becomes more gentle, but still climbs. Can see the top of the Towers ahead on the Tower Hills.\', NULL, \'FitDistanceDailySummary\', 6636.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1563, 1507, \'Sept. 30 - Day 9: 28 miles\', \'Camp at the feet of the Tower Hills (same site as the western journey).\', NULL, \'FitDistanceDailySummary\', 6656.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1564, 1507, \'Oct. 1 - Day 10: 30 miles\', \'Road climbs the western slope of the Tower Hills.\', NULL, \'FitDistanceDailySummary\', 6656.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1565, 1507, \'Oct. 1 - Day 10: 30 miles\', \'Reach the Towers on the crest of the Hills. Turn back for a last look west at the sea. Start down the eastern slope.\', NULL, \'FitDistanceDailySummary\', 6666.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1566, 1507, \'Oct. 1 - Day 10: 30 miles\', \'Reach the foot of the Hills. Continue east on the Road. Road falls gently.\', NULL, \'FitDistanceDailySummary\', 6681.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1567, 1507, \'Oct. 1 - Day 10: 30 miles\', \'Camp in grassland next to the Road.\', NULL, \'FitDistanceDailySummary\', 6686.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1568, 1507, \'Oct. 2 - Day 11: 30 miles\', \'Continue through grassy plain. See no one.\', NULL, \'FitDistanceDailySummary\', 6686.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1569, 1507, \'Oct. 2 - Day 11: 30 miles\', \'Ahead to the east, they can see the crest of the Far Downs.\', NULL, \'FitDistanceDailySummary\', 6706.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1570, 1507, \'Oct. 2 - Day 11: 30 miles\', \'Camp just off the Road. Weather pleasant.\', NULL, \'FitDistanceDailySummary\', 6716.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1571, 1507, \'Oct. 3 - Day 12: 30 miles\', \'Ride out early. Road curves east-northeast.\', NULL, \'FitDistanceDailySummary\', 6716.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1572, 1507, \'Oct. 3 - Day 12: 30 miles\', \'Reach the steep western face of the Far Downs. The Road climbs through a long cutting with steep, rocky walls on each side.\', NULL, \'FitDistanceDailySummary\', 6726.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1573, 1507, \'Oct. 3 - Day 12: 30 miles\', \'Road reaches the eastern end of the cutting. Now slopes gently down.\', NULL, \'FitDistanceDailySummary\', 6728.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1574, 1507, \'Oct. 3 - Day 12: 30 miles\', \'Downlands gradually flow into the grassy lowlands to the east.\', NULL, \'FitDistanceDailySummary\', 6736.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1575, 1507, \'Oct. 3 - Day 12: 30 miles\', \'Camp next to the Road.\', NULL, \'FitDistanceDailySummary\', 6746.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1576, 1507, \'Oct. 4 - Day 13: 30 miles\', \'Early morning: continue east-northeast on road.\', NULL, \'FitDistanceDailySummary\', 6746.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1577, 1507, \'Oct. 4 - Day 13: 30 miles\', \'Begin to see grazing lands.\', NULL, \'FitDistanceDailySummary\', 6761.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1578, 1507, \'Oct. 4 - Day 13: 30 miles\', \'Reach the steep western face of the White Downs.\', NULL, \'FitDistanceDailySummary\', 6771.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1579, 1507, \'Oct. 4 - Day 13: 30 miles\', \'Road rises sharply, cutting between chalky rock walls.\', NULL, \'FitDistanceDailySummary\', 6773.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1580, 1507, \'Oct. 4 - Day 13: 30 miles\', \'Reach Michel Delving. Stay at an Inn.\', NULL, \'FitDistanceDailySummary\', 6776.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1581, 1507, \'Oct. 5 - Day 14: 35 miles\', \'Leave after an early breakfast.\', NULL, \'FitDistanceDailySummary\', 6776.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1582, 1507, \'Oct. 5 - Day 14: 35 miles\', \'Descend gentle east-running backslope. Can see many grazing lands and some cultivated fields in lowlands below.\', NULL, \'FitDistanceDailySummary\', 6781.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1583, 1507, \'Oct. 5 - Day 14: 35 miles\', \'Reach the valleybottom east of the Downs. Road passes now through more settled area.\', NULL, \'FitDistanceDailySummary\', 6786.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1584, 1507, \'Oct. 5 - Day 14: 35 miles\', \'Come to Waymeet. Stay at an Inn.\', NULL, \'FitDistanceDailySummary\', 6811.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1585, 1507, \'Oct. 6 - Day 15: 22 miles\', \'Leave after a leisurely breakfast.\', NULL, \'FitDistanceDailySummary\', 6811.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1586, 1507, \'Oct. 6 - Day 15: 22 miles\', \'To the south they can see the wooded hills of Tookland.\', NULL, \'FitDistanceDailySummary\', 6816.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1587, 1507, \'Oct. 6 - Day 15: 22 miles\', \'Pass the pathway Sam and Frodo had taken south.\', NULL, \'FitDistanceDailySummary\', 6821.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1588, 1507, \'Oct. 6 - Day 15: 22 miles\', \'Come to Bywater Road. Sam says farewell to Merry and Pippin. They continue east on the Road, singing as they go. Sam turns northwest on Bywater Road.\', NULL, \'FitDistanceDailySummary\', 6826.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1589, 1507, \'Oct. 6 - Day 15: 22 miles\', \'Sam reaches Bywater and turns west toward Hobbiton.\', NULL, \'FitDistanceDailySummary\', 6828.5, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1590, 1507, \'Oct. 6 - Day 15: 22 miles\', \'Sam comes to Hobbiton. Goes north over the bridge across the Water and climbs up the Hill.\', NULL, \'FitDistanceDailySummary\', 6833.3, NULL, NULL, NULL, 12)');
        $this->addSql('INSERT INTO rpg_challenge_global VALUES(1591, 1507, \'Oct. 6 - Day 15: 22 miles\', \'Sam arrives at Bag End at sunset: Home.\', NULL, \'FitDistanceDailySummary\', 6833.5, NULL, NULL, NULL, 12)');

